INSERT INTO `reading` VALUES(15562, 'Art', 1, 28, 'B.28', '2.7-14', '', '\n<w type="hw" lemma="ard 1">Art</w> <w>tréide</w> <w>fordongair</w>. <w>art</w> .i. <w>uasal</w>. <w>unde</w> <w>dicitur</w> <w>fine</w> <w>airt</w> <add>ł <w>art</w> fine</add>, <w>art</w> .i. <w>dia</w> <w>undo</w> <w>dicitur</w> <add>Eochaid find</add> <w>fuath</w> n-<w>airt</w> .i. <w>fuath</w> <w>dee</w> .i. <w>ar</w> <w>cæime</w> <add>in <w>fir</w> sin</add>. <w>Item</w> <w>Cúchulainn</w> <add>post mortem</add> <w>dicere</w> <w>perhibetur</w> <w>domemaidh</w> <w>art</w> <w>uasal</w> .i. <w>dia</w> <w>uasal</w>. <w>ocus</w> <w>art</w> .i. <w>cloch</w> <add>ł <w>lec</w> <w>lige</w> <w>cuius</w> diminutiuum</add> <w>arteine</w> .i. <w>clocheni</w> <w>unde</w> <w>uel</w> <w>inde</w> <w>dixit</w> <w>Guaire</w> <w>Aidne</w> <w>dochelit</w> <w>mor</w> n-<w>ámra</w> <w>indairtine</w> <w>bede</w> <w>forlige</w> <w>Marcáin</w> <add>ł Maircini</add> <w>maic</w> <w>Æda</w> <w>maic</w> <w>Marceine</w>. \n', NULL, 'p. 263a', 'ard 1');
INSERT INTO `reading` VALUES(15565, 'Arg', 1, 29, 'B.29', '2.15-23', '', '\n<w type="hw" lemma="arg 1">Arg</w> <w>tréde</w> <w>fordongair</w>. <w>arg</w> .i. <w>bainne</w>. <w>unde</w> <w>dicitur</w> <add>argda</add> <w>ruarc</w> .i. <w>robanna</w> .i. <w>snige</w> <w>mor</w> <w>doḟleochud</w>. <w>arg</w> <w>din</w> .i. lœch. <w>unde</w> <w>dicitur</w> <add>argda .i. laechda</add> <w>cuius</w> <w>uxor</w> <w>argeind</w>. <w>argeind</w> <w>din</w> .i. <w>is</w> <w>gein</w> <w>do</w> <w>arg</w> .i. <w>do</w> <w>læch</w> <w>abeth</w> <w>aige</w> <add>7 <w>is</w> <w>maith</w> do</add>. <w>uel</w> <w>argcuin</w> <add>.i. <w>is</w> <w>arg</w> .i. laech</add> .i. <w>cuiniu</w> .i. <w>bean</w>. <w>Arg</w> <w>din</w> <w>airdhairc</w> <w>unde</w> <w>dicitur</w> <w>airchedul</w> <add>.i. argcetul</add> .i. <w>cedul</w> <w>orrdhairc</w> <w>ara</w> <w>mence</w> <w>conchanair</w>. <w>is</w> <w>aire</w> <w>din</w> <w>nícedul</w> lœch <w>atberar</w>. <w>arní</w> <w>do</w> lœchu <add>tantum</add> .i. <w>náma</w> <w>dognithear</w>. \n', NULL, 'p. 263a', 'arg 1');
