INSERT INTO `reading` VALUES(15583, 'Anforbracht', 1, 45, 'B.45', '3.22-4', '', '\n<w type="hw" lemma="anfobracht">Anforbracht</w> .i. <w>ainm</w> <w>duine</w> <w>bís</w> <w>asirg</w> ⁊ <w>timairgeas</w> <w>galur</w> <w>conabí</w> <w>beoil</w> <w>nasúg</w> <w>and</w>. <w>bracht</w> <w>din</w> <w>enim</w> <w>nomen</w> <w>béoil</w> <w>uocatur</w>. \n', NULL, 'p. 263a', 'anfobracht');
INSERT INTO `reading` VALUES(15584, 'Adart', 1, 46, 'B.46', '3.25-8', '', '\n<w type="hw" lemma="adart">Adart</w> .i. <add>quasi</add> <w>adirt</w> .i. <w>adæ</w> <w>mbáis</w> <w>arisarbás</w> <w>adrimther</w> <w>codlud</w>. <w>is</w> <w>ainm</w> <w>dono</w> <w>irt</w> <w>do</w> <w>bas</w> ⁊ <w>is</w> <w>ainm</w> <w>bas</w> <w>dont</w> ṡuan. {?} <w>telcud</w> <w>fri</w> <w>hadart</w> <corr>7 <w>is</w> <w>airde</w> codalta</corr>. <w>unde</w> <w>dicitur</w> <w>descaid</w> <w>chodulta</w> <w>freslige</w>. \n', NULL, 'p. 263a', 'adart');
