INSERT INTO `reading` VALUES(15590, 'Ana', 1, 52, 'B.52', '3.35-43', '', '\n<w type="hw" lemma="án 3">Ana</w> .i. <w>sdaba</w> <w>beca</w> <w>bidís</w> <w>forsna</w> <w>tibradaib</w> <w>isna</w> <w>cánaib</w> <w>dlúthaib</w>. <w>unde</w> <w>dicitur</w> <w>damaid</w> <w>ána</w> <w>for</w> <w>lindib</w>. ⁊ <w>bá</w> <w>doargad</w> <w>badís</w> <w>mence</w> <w>ut</w> <w>Mac</w> <w>da</w> <w>Cherda</w> <w>dixit</w> <w>for</w> <w>Cnucc</w> <w>Rafand</w>, <w>INráith</w> <w>morsa</w> <add>ł hisa</add> <w>forsna</w> <w>mfil</w>, <w>ambid</w> <w>tibran</w> <w>fo</w> <w>án</w> <w>gil</w>, <w>babínd</w> <w>gáir</w> <w>choille</w> <w>loinche</w>, <w>umráith</w> <w>Fiachach</w> <w>maic</w> <w>Moinche</w> <add>.i. Muilaethan</add>. <w>Fri</w> <w>hól</w> <w>do</w> <w>dháinib</w> <w>scítha</w> <w>estib</w> <w>nofácbatis</w> <w>imorro</w> <w>uasu</w> <w>forsna</w> <w>tibratib</w> ⁊ <w>ba</w> <w>ho</w> <w>rígaib</w> <w>dobertís</w> <w>forru</w> <w>dofromad</w> a <w>cána</w>. \n', NULL, 'p. 263a', 'án 3');
INSERT INTO `reading` VALUES(15591, 'Athgabail', 1, 53, 'B.53', '4.1-4', '', '\n<w type="hw" lemma="athgabáil">Athgabail</w> .i. <w>na</w> <w>teora</w> <w>ba</w> <w>toisechu</w> <cb n="p. 263b"/> <w>rogab</w> <w>Assal</w> <w>ar</w> <w>Mog</w> <w>mac</w> <w>Nuadhat</w>. <w>Athgabail</w> <w>din</w> iar<corr>sinní</corr> <w>adgaib</w> <w>cách</w> <w>aleass</w> <w>trethi</w>. <w>Athgabail</w> <w>din</w> .i. <w>na</w> .ui. <w>ba</w> <w>namairech</w>. <w>lege</w> <w>hi</w> <w>Fenchus</w> <w>már</w>. \n', NULL, 'p. 263a', 'athgabáil');
INSERT INTO `reading` VALUES(15592, 'Aithech', 1, 54, 'B.54', '4.5-6', '', '\n<w type="hw" lemma="aithech 2">Aithech</w> .i. <w>áith</w> ⁊ <w>aech</w> .i. <w>náma</w> <w>aith</w>. <w>Aithech</w> <w>din</w> <w>náma</w> <w>aith</w>. <w>ní</w> <w>ainm</w> <w>acht</w> <w>do</w> <w>dheglæch</w>. \n', NULL, 'p. 263b', 'aithech 2');
