INSERT INTO `reading` VALUES(15598, 'Airber', 1, 60, 'B.60', '4.18-24', '', '\n<w type="hw" lemma="airber 1">Airber</w> .i. <w>fritt</w> <w>anair</w> <w>munabire</w> <add>ł nombere</add> <w>iter</w> <w>dó</w> <w>di</w> <w>láim</w> <w>ar</w> <w>is</w> <w>fort</w> <w>aniar</w> <w>dombere</w> <w>na</w> <w>haire</w> <w>árchena</w>. <w>Air</w> <w>din</w> <w>cach</w> ṅairther <w>ut</w> <w>est</w> Airmhuṁa .i. <w>ir</w> <w>cach</w> <w>ní</w> <w>is</w> <w>híre</w> <w>uat</w> <w>ut</w> <w>est</w> Irṁuma .i. <w>Muma</w> <w>is</w> <w>ire</w> <w>asesside</w> <w>asi</w> rmhuṁa{?}. ⁊ <w>ut</w> <w>dicitur</w> <w>Ara</w> <w>airther</w> <w>ar</w> <w>attatt</w> <w>na</w> <w>teora</w> <w>hAirne</w> <w>and</w> .i. <w>Ára</w> <w>airther</w> <w>as</w> <w>nessa</w> <w>do</w> <w>Eirinn</w>. <w>Ára</w> <w>irther</w> <w>din</w> <w>esside</w> <w>is</w> <w>iram</w> <w>ho</w> <w>Eirinn</w> <w>siar</w>. <w>acht</w> <w>is</w> <w>esside</w> <w>in</w> <w>Ara</w> <w>iarthair</w> <w>betha</w>. \n', NULL, 'p. 263b', 'airber 1');
