INSERT INTO `reading` VALUES(15600, 'Abarta', 1, 62, 'B.62', '4.26-30', '', '\n<w type="hw" lemma="apartu">Abarta</w> .i. <w>sechtmad</w> <w>furirid</w> <w>induine</w> <w>gabar</w> <w>isin</w> <w>abartain</w>. <w>isi</w> <w>abartain</w> <w>techta</w>. <w>is</w> <w>ara</w> <w>aipert</w> <w>din</w> <w>namá</w> <w>atobair</w> <w>in</w> <w>duine</w> <w>di</w> <w>araile</w> <w>sin</w> <w>níarárullad</w> <w>chena</w> <w>acht</w> <w>epert</w> <w>dó</w> <w>fri</w> a <w>cheile</w> <w>nodgebim</w> <w>in</w> <w>abartain</w>. <w>archobli</w> <add>ł <w>ar</w> cobele</add> <w>din</w> <w>doberair</w>. \n', NULL, 'p. 263b', 'apartu');
INSERT INTO `reading` VALUES(15601, 'Ailges', 1, 63, 'B.63', '4.31-3', '', '\n<w type="hw" lemma="áilges">Ailges</w> <w>din</w> .i. <w>geis</w> ġuide, <w>is</w> <w>aráil</w> <w>din</w> <w>nama</w> <w>doberar</w> inġuidesin. ⁊ <w>ní</w> <w>ar</w> <w>molad</w>. <w>uii</w> <w>mad</w> <w>loige</w> <w>enig</w> <w>intí</w> <w>cusacuindigar</w> inailġes <add>isi inailges</add> <w>techta</w>. \n', NULL, 'p. 263b', 'áilges');
