INSERT INTO `reading` VALUES(15608, 'Adand', 1, 70, 'B.70', '4.41-5.7', '', '\n<w type="hw" lemma="adann">Adand</w> .i. <w>æn</w> <w>hitharna</w>. <w>ut</w> <w>poeta</w> <w>Hitharna</w>, <w>mad</w> <w>dia</w> <w>tecma</w> <w>hi</w> <w>tlithadba</w>, <w>ar</w> <w>dia</w> <w>ni</w> <w>radluathadna</w>, <w>arluathlabra</w> <w>nitharba</w>. <w>ut</w> <w>dixit</w> <w>Colman</w> <w>mac</w> <w>Lénín</w>. <w>Luin</w> <w>ho</w> <w>celaib</w> <w>uinge</w> <w>hoc</w> <w>dírnai</w>, <w>crotha</w> <w>banaithech</w> <w>occ</w> <w>rothaib</w> <w>rignai</w>, <w>rig</w> <w>hoc</w> <w>Domnall</w> <w>dord</w> <w>ocaibsi</w>, <w>adand</w> <w>oc</w> <w>cainnill</w> <w>colg</w> <w>ac</w> <w>mo</w> <w>choilgsi</w>.\n', NULL, 'p. 263b', 'adann');
INSERT INTO `reading` VALUES(15609, 'A', 1, 71, 'B.71', '5.8-14', '', '\n<w type="hw" lemma="á 1">A</w> .i. <w>fén</w> ł <w>carr</w> ł <w>carpat</w>. <w>item</w> <w>Fer</w> <w>Muman</w> a <w>quibusdam</w> <w>plebilibus</w> <w>audiuit</w> <w>in</w> <w>aquius</w> <w>parte</w> <w>ut</w> <w>dixerunt</w> <w>INnéssar</w> <w>dam</w> <w>thá</w>, <w>tó</w> <w>mana</w> <w>mó</w> <w>mo</w> a, <w>árataire</w> <w>mo</w> a <w>mó</w>, <w>maini</w> <w>má</w> <w>do</w> á <w>tó</w>.\n', NULL, 'p. 263b', 'á 1');
