INSERT INTO `reading` VALUES(15619, 'Anidan', 1, 80, 'B.80', '5.26-7', '', '\n<w type="hw" lemma="ainidan">Anidan</w> .i. <w>an</w> <w>fó</w> <w>diultad</w>. <w>hidan</w> <w>imorro</w> .i. <w>hidon</w> <w>ab</w> <w>eo</w> <w>quod</w> <w>est</w> <w>idoneus</w> .i. <w>tairise</w>. \n', NULL, 'p. 263b', 'ainidan');
INSERT INTO `reading` VALUES(15620, 'Adba othnoe', 1, 81, 'B.81', '5.26-33', '', '\n<w type="hw" lemma="adba 1">Adba othnoe</w> .i. <w>adba</w> <w>uath</w> <w>onæ</w> <add>ł uinde</add>. <w>uath</w> <w>uir</w> ⁊ <w>ond</w> <w>cloch</w> .i. <w>ádba</w> <w>úire</w> ⁊ <w>chloiche</w> <w>ut</w> <w>dixit</w> <w>IShé</w> <w>inlia</w> <w>lith</w> <w>rolass</w>, <w>iarsrethaib</w> <w>suad</w> <w>is</w> <w>senchass</w>, <w>issed</w> <w>hond</w> <w>iarnaignead</w> <w>ail</w>, <w>inchloch</w> <w>issí</w> <w>iarrastair</w>.\n', NULL, 'p. 263b', 'adba 1');
INSERT INTO `reading` VALUES(15621, 'Aigillne', 1, 82, 'B.82', '5.34-42', '', '\n<w type="hw" lemma="aicill(n)e">Aigillne</w> .i. <w>áugo</w> <w>gillnæ</w> .i. <w>hodhorand</w> <w>in</w> <w>fer</w> <w>sét</w> <w>taurchlotha</w> <w>di</w> <w>araile</w> .i. <w>lóg</w> a eniġ <w>arairidin</w> <add>ł arairitin</add> <w>sét</w> <w>uad</w> <w>isaugo</w> <w>dó</w> <w>iarom</w> <w>gillnnæ</w> <w>don</w> <w>firsin</w> ⁊ <w>airitiu</w> <w>sét</w> <w>uad</w> <w>arbes</w> <w>naircenda</w>. <w>Cid</w> <w>adlaic</w> <w>do</w> <w>din</w> <w>airitiu</w> <w>sét</w> <w>oneoch</w> <w>aile</w> <w>nichumaing</w> <w>acht</w> <w>anairitiu</w> <w>ho</w> <w>fir</w> <w>ombeir</w> <w>seodu</w> <w>taurchlothu</w>. <w>cid</w> <w>iarnairitin</w> <w>tra</w> <w>sét</w> <w>arbes</w> <w>naircenda</w> <w>onaib</w> <w>ceilib</w> <w>dona</w> <w>flathib</w> <w>is</w> <w>ainm</w> <w>aigille</w> <w>donaib</w> <w>célib</w> ⁊ <w>is</w> <w>improprie</w> <w>son</w> <w>imorro</w> <w>proprie</w> <w>autem</w> <w>aigille</w> <w>dicere</w> <w>dona</w> <w>feraib</w> <w>gabait</w> <w>seodu</w> <w>taurclotha</w> <w>ceniberat</w> <w>taurcrec</w> <w>arimḟógnam</w> ṅairchendchaide.\n', NULL, 'p. 263b', 'aicill(n)e');
INSERT INTO `reading` VALUES(15622, 'Bendacht', 1, 83, 'B.83', '5.43', '', '\n<w type="hw" lemma="bennacht">Bendacht</w> <w>quasi</w> <w>benedicht</w> a <w>benedictione</w>. \n', NULL, 'p. 263b', 'bennacht');
INSERT INTO `reading` VALUES(15623, 'Buanand', 1, 84, 'B.84', '5.44-6.6', '', '\n<w type="hw" lemma="Búanann">Buanand</w> <w>muimme</w> <w>na</w> <w>fiann</w> .i. <w>be</w> <w>nAnand</w> <w>cosmaile</w> <w>diblínib</w>. <w>amail</w> <w>robu</w> <w>máthair</w> <w>dee</w> <w>indí</w> <w>Ánu</w> <w>sic</w> <w>Buanand</w> <w>crat</w> <w>máthair</w> <w>na</w> <w>fian</w> .i. <w>dagmathair</w>. <corr>Aliter Buanand</corr> <w>am</w> <w>buan</w> .i. <w>is</w> <w>bón</w> .i. <w>dendi</w> <w>is</w> <w>bonum</w>. <w>amail</w> <w>dicitur</w> <w>genither</w> <w>buan</w> o <w>ambuan</w> .i. <w>maith</w> o <w>ulc</w>. <w>an</w> <w>and</w> <w>fil</w> <w>isin</w> <w>ní</w> <w>is</w> <w>Buanand</w> <add>is mater</add> <w>is</w> <corr>ed fil</corr> <w>inni</w> <w>is</w> <w>Anu</w> .i. <w>mater</w> <w>deorum</w>. <w>Buanand</w> <w>din</w> .i. dáġmathair <w>oc</w> <w>forcedul</w> <w>gaiscid</w> <w>dona</w> <w>fianaib</w>. \n', NULL, 'p. 263b', 'Búanann');
INSERT INTO `reading` VALUES(15624, 'Bran', 1, 85, 'B.85', '6.7-9', '', '\n<w type="hw" lemma="bran 1">Bran</w> .i. <w>fiach</w>. <w>unde</w> <w>dicitur</w> <w>brandæ</w> .i. <w>fiachda</w> <w>arduibe</w> ⁊ <w>scothim</w>. ⁊ <w>brandub</w> .i. <w>fiach</w> <w>dub</w>. <w>unde</w> <w>dicitur</w> <w>branorgain</w> <w>arinní</w> <add>.i.</add> <w>foirgges</w> <w>fiach</w> <w>iudsin</w> .i. <w>branorgain</w>. <cb n="p. 264a"/>\n', NULL, 'p. 263b', 'bran 1');
INSERT INTO `reading` VALUES(15626, 'Beist', 1, 86, 'B.86', '6.10', '', '\n<w type="hw" lemma="bíast">Beist</w> .i. a <w>bestia</w>. \n', NULL, 'p. 264a', 'bíast');
INSERT INTO `reading` VALUES(15627, 'Bárc', 1, 87, 'B.87', '6.11', '', '\n<w type="hw" lemma="bárc 1">Bárc</w> .i. a <w>barca</w>. \n', NULL, 'p. 264a', 'bárc 1');
INSERT INTO `reading` VALUES(15628, 'Bés', 1, 88, 'B.88', '6.12', '', '\n<w type="hw" lemma="bés 1">Bés</w> .i. <w>ab</w> <w>eo</w> <w>quod</w> <w>est</w> <w>besus</w> .i. <w>bés</w>. \n', NULL, 'p. 264a', 'bés 1');
INSERT INTO `reading` VALUES(15629, 'Breth', 1, 89, 'B.89', '6.13-14', '', '\n<w type="hw" lemma="breth">Breth</w> .i. <w>fuigell</w>. <w>ar</w> <w>is</w> <w>fuigell</w> <w>neich</w> <w>ele</w> <w>inbreth</w> <w>ar</w> <w>rouc</w> <w>nech</w> <w>ele</w> <w>inbreth</w> <w>remi</w>. \n', NULL, 'p. 264a', 'breth');
INSERT INTO `reading` VALUES(15630, 'Brath', 1, 90, 'B.90', '6.15-16', '', '\n<w type="hw" lemma="bráth">Brath</w> .i. <w>combrec</w> <w>din</w> <w>donni</w> <w>is</w> <w>braut</w> .i. <w>iudex</w>. <w>is</w> <w>labrethemain</w> <w>din</w> a <w>ænur</w> <w>inlaethesin</w> <w>inbrátha</w> .i. <w>Iesu</w> <w>Christi</w>. \n', NULL, 'p. 264a', 'bráth');
INSERT INTO `reading` VALUES(15631, 'Brathair', 1, 91, 'B.91', '6.17-19', '', '\n<w type="hw" lemma="bráthair">Brathair</w> <w>din</w> <w>quasi</w> <w>fratair</w> <w>ar</w> <w>frater</w> <w>rotruaillned</w> <w>ind</w>. <w>Frater</w> <w>quasi</w> <w>frauter</w> <w>eo</w> <w>quod</w> <w>fraudat</w> <w>ter</w> .i. <w>patrem</w> <w>et</w> <w>matrem</w> <w>et</w> <w>fratrem</w>. \n', NULL, 'p. 264a', 'bráthair');
INSERT INTO `reading` VALUES(15632, 'Bachall', 1, 92, 'B.92', '6.20-4', '', '\n<w type="hw" lemma="bachall">Bachall</w> <w>quasi</w> <w>bacul</w> <w>id</w> <w>est</w> a <w>baculo</w>. ł <w>bachall</w> <w>ut</w> <w>poeta</w> <w>dicit</w> <w>Iath</w> <w>ainm</w> <w>do</w> <w>chlug</w> conaḟǽid <w>nocochelad</w> inglanġaith, <w>bach</w> <w>buain</w> <w>inadhorus</w> <w>tall</w>, <w>bricht</w> <w>ocus</w> <w>bacc</w> <w>is</w> <w>bachall</w>.\n', NULL, 'p. 264a', 'bachall');
INSERT INTO `reading` VALUES(15633, 'Bádudh', 1, 93, 'B.93', '6.25', '', '\n<w type="hw" lemma="bádud">Bádudh</w> .i. <w>ondí</w> <w>is</w> <w>bath</w> .i. <w>muir</w>. \n', NULL, 'p. 264a', 'bádud');
INSERT INTO `reading` VALUES(15634, 'Baten', 1, 94, 'B.94', '6.26-7', '', '\n<w type="hw" lemma="baten">Baten</w> .i. <w>bath</w> <w>aitin</w> .i. <w>éc</w> <w>oband</w> .i. <w>muirtchend</w> <w>adbail</w> <w>aænur</w>. <w>arinní</w> <w>asbath</w> <w>intan</w> <w>timorta</w> <w>ised</w> <w>indso</w> <w>bas</w> <w>fordingair</w>. \n', NULL, 'p. 264a', 'baten');
INSERT INTO `reading` VALUES(15635, 'Baircne', 1, 95, 'B.95', '6.28', '', '\n<w type="hw" lemma="baircne">Baircne</w> .i. <w>catt</w> <w>boineand</w> <w>ar</w> <add>fobíth</add> <w>is</w> <w>ambairc</w> <w>dosfucad</w>. \n', NULL, 'p. 264a', 'baircne');
INSERT INTO `reading` VALUES(15636, 'Babluan', 1, 96, 'B.96', '6.29-30', '', '\n<w type="hw" lemma="Bablúan">Babluan</w> .i. <w>nomen</w> <w>mulieris</w>. <w>quasi</w> <w>Babilón</w> <w>id</w> <w>est</w> <w>confussio</w> .i. <w>dochumasc</w> <w>in</w> <w>ænberla</w> a Miġ <w>Shennáir</w> <w>oc</w> <w>an</w> <w>tur</w> a n-<w>ilberlaib</w>. \n', NULL, 'p. 264a', 'Bablúan');
INSERT INTO `reading` VALUES(15637, 'Babloir', 1, 97, 'B.97', '6.31', NULL, '\n<w type="hw" lemma="bablóir">Babloir</w> .i. <w>ainm</w> <w>do</w> <w>Patraic</w>. \n', NULL, 'p. 264a', 'bablóir');
INSERT INTO `reading` VALUES(15638, 'Bab', 1, 98, 'B.98', '6.32-4', '', '\n<w type="hw" lemma="babb">Bab</w> <w>interiecht</w> <w>aidbligthe</w> <w>de</w> <w>nomine</w> <w>bainb</w> <w>Breiss</w> <w>maic</w> <w>Elathan</w>. <w>arniboi</w> <w>an</w> <w>Erinn</w> <w>muc</w> <w>budgrátu</w>. <w>Babgither</w> <add>ł Bóbgither</add> <w>din</w> <w>aainmside</w>. \n', NULL, 'p. 264a', 'babb');
INSERT INTO `reading` VALUES(15639, 'Brossnai', 1, 99, 'B.99', '6.35-6', '', '\n<w type="hw" lemma="brosna">Brossnai</w> .i. <w>brissni</w> <add>insin <w>do</w> <w>chrinach</w> ⁊ do</add> <w>minbach</w> <w>fedai</w> <w>iarsinni</w> <w>brister</w> <w>heláim</w> ⁊ <w>nibíail</w> <w>gabar</w> <w>dó</w>. \n', NULL, 'p. 264a', 'brosna');
INSERT INTO `reading` VALUES(15640, 'Boll', 1, 100, 'B.100', '6.37', '', '\n<w type="hw" lemma="boll">Boll</w> <w>quasi</w> <w>bull</w> <w>de</w> <w>nomine</w> <w>bulla</w>, <w>bolg</w> <w>uisce</w>. \n', NULL, 'p. 264a', 'boll');
INSERT INTO `reading` VALUES(15641, 'Biror', 1, 101, 'B.101', '6.38-9', '', '\n<w type="hw" lemma="birar">Biror</w> .i. <w>bir</w> <w>tipra</w> ł <w>sruth</w>. <w>hor</w> .i. <w>mong</w>. <w>biror</w> <w>din</w> <w>mong</w> <w>thiprat</w> ł <w>srothai</w>. \n', NULL, 'p. 264a', 'birar');
INSERT INTO `reading` VALUES(15642, 'Belltaine', 1, 102, 'B.102', '6.40-3', '', '\n<w type="hw" lemma="Bel(l)taine">Belltaine</w> .i. <w>bil</w> <w>tene</w> .i. <w>tene</w> ṡoinmech .i. <w>dáthene</w> <w>dognítis</w> <w>druidhe</w> <w>tria</w> <w>thaircedlu</w> <add>ł cotinchetlaib</add> <w>móraib</w> <w>combertis</w> <w>na</w> <w>cethrai</w> <w>arthedmannaib</w> <w>cacha</w> <w>bliadna</w> <w>cusnaténdtibsin</w> <add place="margin-left">eictis <w>na</w> <w>cethra</w> etarru</add>. \n', NULL, 'p. 264a', 'Bel(l)taine');
INSERT INTO `reading` VALUES(15643, 'Braccille', 1, 103, 'B.103', '6.44', '', '\n<w type="hw" lemma="braccaille">Braccille</w> <w>bracc</w> <w>lam</w> ⁊ <w>cáil</w> <w>coimét</w> .i. <w>lámand</w>. \n', NULL, 'p. 264a', 'braccaille');
INSERT INTO `reading` VALUES(15644, 'Brócoit', 1, 104, 'B.104', '6.45-7.2', '', '\n<w type="hw" lemma="brocóit">Brócoit</w> .i. <w>combréc</w>. <w>braccat</w> <w>din</w> <w>ised</w> <w>la</w> <w>Bretnu</w>. <w>bracc</w> <w>iarom</w> <w>ainm</w> <w>do</w> <w>braich</w>. <w>braccat</w> <w>imorro</w> <w>sainlind</w> .i. <w>lind</w> <w>sæinmech</w> <w>brócoit</w> .i. <w>sainlind</w> <w>dognither</w> <w>do</w> <w>braich</w>. \n', NULL, 'p. 264a', 'brocóit');
INSERT INTO `reading` VALUES(15645, 'Binit', 1, 105, 'B.105', '7.3', '', '\n<w type="hw" lemma="binit">Binit</w> .i. <w>benait</w> .i. <w>benaidh</w> <w>inas</w> <w>conad</w> <w>tiug</w> ⁊ <w>conad</w> <w>techt</w>. \n', NULL, 'p. 264a', 'binit');
INSERT INTO `reading` VALUES(15646, 'Braracht', 1, 106, 'B.106', '7.4', '', '\n<w type="hw" lemma="braracht">Braracht</w> .i. <w>breath</w> .i. <w>partus</w>. \n', NULL, 'p. 264a', 'braracht');
INSERT INTO `reading` VALUES(15647, 'Biáil', 1, 107, 'B.107', '7.5', '', '\n<w type="hw" lemma="bíail">Biáil</w> .i. <w>bithail</w> .i. <w>bí</w> <w>fæbar</w>. \n', NULL, 'p. 264a', 'bíail');
INSERT INTO `reading` VALUES(15648, 'Barad', 1, 108, 'B.108', '7.6', '', '\n<w type="hw" lemma="barad 1">Barad</w> .i. <w>bás</w>. \n', NULL, 'p. 264a', 'barad 1');
INSERT INTO `reading` VALUES(15649, 'Bomlacht', 1, 109, 'B.109', '7.7', '', '\n<w type="hw" lemma="bómlacht">Bomlacht</w> .i. <w>bó</w> ⁊ <w>lacht</w>. \n', NULL, 'p. 264a', 'bómlacht');
INSERT INTO `reading` VALUES(15650, 'Buachail', 1, 110, 'B.110', '7.8', '', '\n<w type="hw" lemma="búachaill">Buachail</w> .i. <w>cail</w> <w>coimétaige</w> <w>na</w> <w>mbó</w>. \n', NULL, 'p. 264a', 'búachaill');
INSERT INTO `reading` VALUES(15651, 'Buarach', 1, 111, 'B.111', '7.9-10', '', '\n<w type="hw" lemma="búarach 1">Buarach</w> .i. <w>bó</w> ⁊ <w>árach</w> .i. <w>fosta</w>. <w>Buarach</w> <w>dana</w> <w>bóergi</w> .i. <w>matan</w> <w>modi</w>, <w>unde</w> <w>dicitur</w> <w>fescor</w> <w>imbuarach</w>. \n', NULL, 'p. 264a', 'búarach 1');
INSERT INTO `reading` VALUES(15652, 'Basc', 1, 112, 'B.112', '7.11-13', '', '\n<w type="hw" lemma="basc 2">Basc</w> .i. cechṅderg. <w>Basc</w> <w>dana</w> <w>intan</w> <w>is</w> <w>do</w> <w>chuibrech</w> <add>ł <w>is</w> <w>do</w> chuimriug</add> <w>braiget</w> <w>is</w> <w>ainmm</w> ⁊ <w>dona</w> <w>mellaib</w> <w>dracondai</w> <w>is</w> <w>dileas</w>. <w>base</w> .i. <w>cach</w> ṅderg. \n', NULL, 'p. 264a', 'basc 2');
INSERT INTO `reading` VALUES(15654, 'Brisc', 1, 113, 'B.113', '7.14-15', '', '\n<w type="hw" lemma="brisc">Brisc</w> .i. <w>ab</w> <w>eo</w> <w>quod</w> <w>est</w> <w>priscus</w> <w>arisbrisc</w> <add>cach <w>crin</w> 7</add> <w>cach</w> ṅarsaid. \n', NULL, 'p. 264a', 'brisc');
INSERT INTO `reading` VALUES(15655, 'Bó', 1, 114, 'B.114', '7.16', '', '\n<w type="hw" lemma="bó">Bó</w> <w>nomen</w> <w>de</w> <w>sono</w> <w>uocis</w> <w>suae</w> <add>factum est</add>. \n', NULL, 'p. 264a', 'bó');
INSERT INTO `reading` VALUES(15656, 'Bobaith', 1, 115, 'B.115', '7.17', '', '\n<w type="hw" lemma="bóbath">Bobaith</w> .i. <w>bó</w> <w>bath</w>. <add>bath</add> .i. <w>bás</w>. <w>essidein</w> <w>inboár</w>. \n', NULL, 'p. 264a', 'bóbath');
INSERT INTO `reading` VALUES(15657, 'Bolg belchi', 1, 116, 'B.116', '7.18', '', '\n<w type="hw" lemma="belc(h)e">Bolg belchi</w> .i. <w>bélcheo</w> .i. <w>ceo</w> <add>do</add>thæd <w>asabeolu</w>. \n', NULL, 'p. 264a', 'belc(h)e');
INSERT INTO `reading` VALUES(15658, 'Berit', 1, 117, 'B.117', '7.19', NULL, '\n<w type="hw" lemma="birit">Berit</w> .i. <w>berith</w> .i. <w>brithit</w>. \n', NULL, 'p. 264a', 'birit');
INSERT INTO `reading` VALUES(15659, 'Blind', 1, 118, 'B.118', '7.20-1', '', '\n<w type="hw" lemma="blinn">Blind</w> .i. <w>saile</w> <w>mairb</w> <w>unde</w> <w>dicitur</w> <w>bás</w> <add>in</add> <w>blinna</w> <w>ch</w>. <w>Blindauga</w> <w>caech</w> <w>in</w> <w>lingua</w> <w>Galleorum</w> <w>dicitur</w>. \n', NULL, 'p. 264a', 'blinn');
INSERT INTO `reading` VALUES(15660, 'Benntraige', 1, 119, 'B.119', '7.22-3', '', '\n<w type="hw" lemma="Bentraige">Benntraige</w> .i. <w>binitrige</w> .i. <add>de</add> <w>millsen</w> <w>dliges</w> <w>rí</w> <w>Caissil</w> <w>dib</w> <w>indsin</w>. ł a <w>Benta</w> <w>patre</w> <w>eorum</w>. \n', NULL, 'p. 264a', 'Bentraige');
INSERT INTO `reading` VALUES(15661, 'Bóge', 1, 120, 'B.120', '7.24-31', '', '\n<w type="hw" lemma="bóige">Bóge</w> .i. <w>ainm</w> <w>do</w> <w>choire</w> ṡainnte <w>dorigned</w> <w>lasin</w> <w>æs</w> <w>cerda</w>. <w>ise</w> <w>din</w> <w>cruth</w> <w>ambíd</w> .i. <w>nóe</w> <w>slabraid</w> <w>ass</w>. ⁊ <w>niba</w> <w>moasom</w> <w>oldás</w> <w>cend</w> <w>cingite</w> <w>moire</w>. <w>brefe</w> <w>din</w> <w>for</w> <w>cind</w> <w>cacha</w> <w>slabraid</w> ⁊ <w>nonbar</w> <w>æsa</w> <w>cerda</w> <w>inasessam</w> <w>uimme</w> <w>oc</w> <w>cantain</w> <add>ł ocur</add> <w>na</w> <w>cléri</w> <w>corínd</w> <w>gæi</w> <w>cach</w> <add>æn</add> <w>fir</w> <w>tria</w> <w>brefe</w> cachṡlabraid <w>ba</w> <w>nessa</w> <w>dó</w>. <w>Ocus</w> <w>intí</w> <w>iarom</w> <w>doberead</w> <w>rath</w> <w>doib</w> <w>ba</w> <w>hisin</w> <w>coiresin</w> <w>doberead</w>. <w>unde</w> <w>dicitur</w> <w>coire</w> <w>sainnte</w>. <w>Ba</w> <w>hé</w> <w>din</w> <w>alán</w> <w>cóir</w> <w>inchoire</w> .i. <w>bretnasc</w> <w>bánóir</w> <w>da</w> <w>uinge</w> <w>dég</w>. \n', NULL, 'p. 264a', 'bóige');
INSERT INTO `reading` VALUES(15662, 'Bóge', 1, 121, 'B.121', '7.32-5', '', '\n<w type="hw" lemma="bóige">Bóge</w> <w>din</w> <w>ainm</w> <w>do</w> <w>ballan</w> <w>bec</w> <w>ambidís</w> .u. <w>ungi</w> <w>oir</w>. <w>issed</w> <add>ł sech</add> <w>nobíd</w> <w>fri</w> <w>hól</w> <w>sainlenda</w> <w>ass</w>. ⁊ <w>nobíd</w> <w>din</w> <w>fri</w> <w>géll</w> <w>doḟilid</w> .i. <w>do</w> <w>ollam</w>. <w>unde</w> <w>dicitur</w> i <w>mBrethaib</w> <w>nemid</w> <w>ballan</w> <w>baisse</w> <w>boge</w> <add>.u. ṅuinge banoir</add>. \n', NULL, 'p. 264a', 'bóige');
INSERT INTO `reading` VALUES(15663, 'Briar', 1, 122, 'B.122', '7.36-7', '', '\n<w type="hw" lemma="briar">Briar</w> .i. <w>delg</w> ṅuinge <add>.i.</add> <w>óir</w> <w>ut</w> <w>est</w> i <w>mBrethaibh</w> <w>nemidh</w>. <w>briar</w> <w>delg</w> n-<w>uinge</w>. \n', NULL, 'p. 264a', 'briar');
INSERT INTO `reading` VALUES(15664, 'Brathchæi', 1, 123, 'B.123', '7.38-44', '', '\n<w type="hw" lemma="bráth">Brathchæi</w> .i. <w>brethcheo</w> ǽi. <w>aliter</w> <w>quod</w> <w>est</w> <w>uerius</w> .i. Cǽi <w>Cænbrethach</w> <w>dalta</w> <w>Feniusa</w> F<supplied>arsad</supplied>. <w>ise</w> <w>in</w> <w>descipulsin</w> <w>rosiacht</w> <w>mec</w> <w>Isra</w> <w>heil</w> <w>fri</w> <w>fóglaimm</w> nǼbhra. ⁊ <w>ise</w> <w>ba</w> <w>bretheam</w> <w>la</w> <w>loinges</w> <w>mac</w> <w>Milid</w>. <w>is</w> <w>aire</w> <w>asberair</w> <w>Cæi</w> <w>Cænbrethach</w> <w>de</w> <w>fobith</w> <w>itbretha</w> <w>rechta</w> <w>nosberead</w>. ⁊ <w>is</w> <w>aire</w> <w>atimdha</w> <w>isin</w> <w>belra</w>. <w>nachtan</w> <w>bíther</w> <w>canríg</w> <w>isna</w> <w>tuathaib</w> <w>is</w> bráthchǽi <w>fogniad</w> <w>forru</w> <w>fri</w> <w>hurradus</w>. <w>diambe</w> <w>imorro</w> <w>rig</w> <w>is</w> <w>rechtge</w> <w>són</w> <w>amail</w> <w>asmaith</w> <w>lais</w>. \n', NULL, 'p. 264a', 'bráth');
INSERT INTO `reading` VALUES(15665, 'Bruinech', 1, 124, 'B.124', '7.45-6', '', '\n<w type="hw" lemma="bruin(n)ech">Bruinech</w> .i. <w>máthair</w>. <w>arinní</w> <w>biathas</w> <w>náidenu</w> <w>for</w> <w>abruindib</w> .i. <w>suis</w> <w>mammillis</w>. \n', NULL, 'p. 264a', 'bruin(n)ech');
