INSERT INTO `reading` VALUES(15668, 'Buas', 1, 127, 'B.127', '8.4-5', '', '\n<w type="hw" lemma="búas 1">Buas</w> .i. <w>soas</w> ṅairchedail iṁais <w>arindí</w> <w>dotéit</w> <w>himais</w> <w>iarmbuas</w> <w>unde</w> <w>dicitur</w> <w>barr</w> <w>buaisse</w>. \n', NULL, 'p. 264a', 'búas 1');
INSERT INTO `reading` VALUES(15669, 'Bri', 1, 128, 'B.128', '8.6-12', '', '\n<w type="hw" lemma="brí 2">Bri</w> <w>gach</w> ṅaccais <add>ł cachṅocus</add> <w>ut</w> <w>est</w> a <w>mBrethaib</w> <w>nemid</w> .i. <w>briamon</w> <w>smethraige</w> .i. <w>ainm</w> <cb n="p. 264b"/> <w>nemtheossa</w> <w>dogniat</w> <w>filid</w> <w>imnech</w> <w>ada</w> <w>toing</w>. <w>melid</w> <w>smitt</w> <w>induine</w> <w>iter</w> a <w>dá</w> ṁer ⁊ <w>do</w> <w>écci</w> <w>induine</w> <w>imandeni</w> <w>nemthess</w>. <w>fir</w> <w>inson</w> <w>amail</w> <w>asfri</w> a <w>induine</w> <w>anechtair</w> <w>ata</w> <w>inballso</w> <w>is</w> <w>fri</w> <w>adóini</w> <w>anectair</w> <w>ata</w> <w>induineseo</w>. <w>amail</w> <w>astimme</w> ⁊ <w>istlathi</w> <w>inballso</w> <w>quam</w> <w>alia</w> <w>membra</w> <w>sic</w> <w>et</w> <w>hic</w> <w>homo</w>. \n', NULL, 'p. 264a', 'brí 2');
INSERT INTO `reading` VALUES(15670, 'Brigit', 1, 129, 'B.129', '8.13-19', '', '\n<w type="hw" lemma="Brigit">Brigit</w> .i. <w>banfile</w> <w>ingen</w> <w>in</w> <w>Dagdai</w>. <w>is</w> <w>eiside</w> <w>Brigit</w> <w>baneceas</w> <add>ł <w>be</w> neicsi</add> .i. <w>Brigit</w> <w>bandee</w> <w>noadradís</w> <w>filid</w>. <w>arba</w> <w>romor</w> ⁊ <w>baroán</w> <w>afri</w> <w>thgnam</w>. <w>is</w> <w>airesin</w> <w>ideo</w> <w>eam</w> <add>deam</add> <w>uocant</w> <w>poetarum</w> <w>hoc</w> <w>nomine</w> <w>cuius</w> <w>sorores</w> <w>erant</w> <w>Brigit</w> <w>be</w> <w>legis</w> <w>Brigit</w> <w>bé</w> <w>goibnechta</w> .i. <w>bandé</w> .i. <w>tri</w> <w>hingena</w> <w>in</w> <w>Dagdai</w> <w>insin</w>. <w>de</w> <w>quarum</w> <w>nominibus</w> <w>pene</w> <w>omnes</w> <w>Hibernenses</w> <w>dea</w> <w>Brigit</w> <w>uocabatur</w>. <w>Brigit</w> <w>din</w> .i. <w>breoaigit</w> ł breoṡaigit. \n', NULL, 'p. 264b', 'Brigit');
