INSERT INTO `reading` VALUES(15678, 'Cormac', 1, 136, 'B.136', '8.28-32', '', '\n<w type="hw" lemma="Cormac">Cormac</w> .i. <w>corbmac</w> .i. <w>corb</w> <w>carput</w>. <w>Corbmac</w> <w>dín</w> <w>mac</w> <w>carpait</w>. <w>fri</w> a <w>Cormac</w> <w>geltai</w> <w>gæth</w> <w>do</w> <w>Laignib</w> <w>cetna</w> <w>erbrad</w> <w>arba</w> <w>isin</w> <w>carput</w> <w>roghenair</w> <w>sidhen</w>. <w>issed</w> <w>iarom</w> a <w>cóirortagraiph</w> <w>in</w> <w>anmma</w> <w>sin</w> .i. <w>corbmac</w> .i. <w>coraib</w> .b. <w>isin</w> <w>dialt</w> <add>tuisig</add> <w>nominis</w> <w>Cormaic</w> <w>sin</w> .i. b. <w>scribitur</w> <w>ut</w> <w>Corbmac</w>. \n', NULL, 'p. 264b', 'Cormac');
