INSERT INTO `reading` VALUES(15685, 'Clithar set', 1, 141, 'B.141', '8.40-9.6', '', '\n<w type="hw" lemma="clithar">Clithar set</w>. <w>alii</w> <w>dicunt</w> <corr>combad ainm</corr> <w>do</w> <w>bhoin</w> indlǽig <w>arinní</w> <w>docel</w> <w>alaeg</w> <w>indi</w> <w>quod</w> <w>non</w> <w>uerum</w> <w>est</w> <w>sed</w> <w>uerius</w> <w>uel</w> <w>aliter</w> <w>Clithar</w> <w>sét</w> .i. <w>rigshét</w>. <w>ar</w> <w>is</w> <w>ainm</w> <w>dovríg</w> <w>isin</w> <w>Duil</w> <w>feda</w> <w>mair</w> <w>inni</w> <w>is</w> <w>clithar</w> ⁊ <w>is</w> <w>as</w> <add>ł <w>ised</w> dath</add> <w>not</w> <w>reith</w>. <w>sét</w> <w>gábla</w> <w>din</w> <w>is</w> é <w>islugam</w> .i. <w>dartaid</w> <w>fhirend</w> ⁊ <w>colpach</w> <w>boineand</w>. ł <w>colpach</w> <w>fhirend</w> ⁊ <w>dairt</w> <w>boinend</w>. <w>samaisc</w> <w>in</w> <w>sét</w> <w>tanaise</w>. <w>laulgach</w> ł <w>dam</w> <w>timchill</w> <w>arathair</w> <w>in</w> <w>tress</w> <w>sét</w> ⁊ <w>is</w> <w>ésin</w> <w>in</w> <w>ríisét</w>. ⁊ <w>ise</w> <w>cruth</w> <w>adrenaiter</w> <w>ambreith</w> <w>Chæi</w> <w>Chænbrethaig</w> <w>cach</w> <w>tri</w> <w>seoit</w> <corr>sét</corr> <w>gablae</w> <corr>samaisc</corr> <w>alaile</w> <w>laulgach</w> ł <w>dam</w> <w>timchill</w> <w>arathair</w> <w>araile</w>. <w>impúd</w> <w>foraib</w> <w>beos</w> <w>corí</w> <w>cend</w> <w>na</w> <w>herca</w>. ⁊ <w>hite</w> <w>sin</w> <w>naseoit</w> <w>acobair</w> <w>asberar</w> <w>hi</w> <w>cáin</w> <w>Patraic</w> <add place="margin-right">ar <w>it</w> <w>leth</w> <w>uinge</w> a <w>séoit</w> side</add> \n', NULL, 'p. 264b', 'clithar');
INSERT INTO `reading` VALUES(15686, 'Cruimther', 1, 142, 'B.142', '9.7-16', '', '\n<w type="hw" lemma="cruimther">Cruimther</w> .i. <w>gædelg</w> <w>indi</w> <w>as</w> <w>presbyter</w>, <w>premter</w> <w>din</w> <w>acombrec</w> <w>side</w>. <w>prem</w> <w>iarum</w> <w>isin</w> <w>combreic</w> <w>as</w> <w>cruimm</w> <w>ingædilg</w> ⁊ <w>ni</w> <w>tinntúd</w> <w>coir</w> <w>din</w> <w>donní</w> <w>as</w> <w>presbytér</w> <w>inní</w> <w>as</w> <w>cruimthir</w>. <w>astinntud</w> <w>imorro</w> <w>coir</w> <w>din</w> <add>donní <w>as</w> premter</add>. <w>Na</w> <w>Bretain</w> <w>tra</w> <w>batar</w> <w>hi</w> <w>comitecht</w> <w>Patraic</w> <w>icon</w> <w>precept</w> <w>hite</w> <w>rothinntaiset</w> ⁊ <w>isí</w> <w>anní</w> <w>is</w> <w>primter</w> <w>rothinntaiset</w> ⁊ <w>is</w> fǽi <w>iarom</w> <w>latharsat</w> <w>légnide</w> <w>na</w> <w>mBretan</w> <w>innísin</w> .i. <w>amail</w> <w>is</w> <w>lómm</w> <w>inchruim</w> <w>síc</w> <w>debet</w> <w>presbyterum</w> <w>bess</w> <w>lómm</w> <w>ho</w> <w>pheccad</w> ⁊ <add>bes nimnocht</add> o <w>doman</w> ⁊ araile{?} <w>secundum</w> <w>eum</w> <w>qui</w> <w>dixit</w> <w>ego</w> <w>sum</w> <w>uermis</w> ⁊ araile{?}. \n', NULL, 'p. 264b', 'cruimther');
