INSERT INTO `reading` VALUES(15755, 'Crontṡaile', 1, 209, 'B.209', '11.27-30', '', '\n<w type="hw" lemma="crontsaile">Crontṡaile</w> .i. róntṡaile .i. rigentṡaile. <w>Crontsaile</w> <w>din</w> .i. <w>gransele</w> .i. <w>grant</w> <w>cach</w> <w>líath</w> ł <w>findach</w>. <w>unde</w> <w>dicitur</w> <w>fésóc</w> <w>grennach</w> <w>findfad</w> liath…{?} <w>dr</w>. <add place="margin-left">.i. <w>grantsaile</w> .i. <w>cach</w> <w>líath</w> ł <w>glas</w> ł rigin</add> \n', NULL, 'p. 265a', 'crontsaile');
