INSERT INTO `reading` VALUES(15768, 'Cerchaill', 1, 222, 'B.222', '12.9-14', '', '\n<w type="hw" lemma="cerchaill">Cerchaill</w> .i. <w>ciarchail</w>. <w>ciar</w> <w>coimet</w>. <w>uel</w> <w>ab</w> <w>eo</w> <w>quod</w> <w>est</w> <w>ceruical</w>, ł <w>in</w> <w>cer</w> <w>fil</w> <w>and</w> <w>is</w> <w>onní</w> <w>is</w> <w>ceruus</w> .i. <w>ag</w> <w>allaid</w> ⁊ <w>is</w> <w>dia</w> <w>beindside</w> <add>ł <w>bian</w> side</add> <w>dogníter</w> <w>coimet</w> <w>imonclum</w> ⁊ <w>is</w> <w>don</w> <w>choimetsin</w> <w>is</w> <w>ainmm</w> <w>cail</w> <add place="margin">comet <w>is</w> <w>ainmna</w> <w>do</w> cach</add> ⁊ <w>da</w> <w>gach</w> <w>coimet</w> <w>olchena</w>. <w>aliter</w> <w>is</w> a <w>ceruice</w> <w>ro</w> <w>hainmniged</w>. \n', NULL, 'p. 265a', 'cerchaill');
