INSERT INTO `reading` VALUES(15775, 'Cím', 1, 228, 'B.228', '12.16-30', '', '\n<w type="hw" lemma="cim 1">Cím</w> .i. <w>airged</w> .i. <w>don</w> <w>argad</w> <w>dobertha</w> <w>acis</w> <w>do</w> <w>Ḟomorib</w> <w>atrolli</w> a <w>ainmniugud</w>. <w>Cím</w> <w>tra</w> <w>ainm</w> <w>do</w> <w>cach</w> <w>cís</w> o <w>sin</w> <w>hille</w> <w>cepad</w> <w>do</w> <w>argad</w> <w>ba</w> <w>hainm</w> <w>prius</w> <w>ar</w> <w>amenci</w> ⁊ <w>aramet</w> <w>dobertha</w> <w>dona</w> <w>Ḟomorib</w> <w>unde</w> <cb n="p. 265b"/> <w>dicitur</w> a <w>mBrethaib</w> <w>nemid</w> <w>Cimb</w> <w>uim</w> o <w>lasnuim</w> i <w>punacerni</w> <w>puinc</w>. \n', NULL, 'p. 265a', 'cim 1');
