INSERT INTO `reading` VALUES(15779, 'Cumlachtaig', 1, 232, 'B.232', '12.35-9', '', '\n<w type="hw" lemma="cumlachtaid">Cumlachtaig</w> .i. <w>nomen</w> <w>do</w> <w>horc</w> <w>mhuice</w> <w>intan</w> <w>teit</w> <w>ácru</w> <w>deteit</w> <add>ł conetet</add> a <w>máthair</w> <w>fri</w> <w>deol</w> <w>asin</w> <w>ead</w> <add>quasi</add> <w>cum</w> <w>lacte</w> <w>ambulans</w>. <w>unde</w> <w>dicitur</w> <w>cumlachtach</w> <w>in</w> <w>duine</w> .i. <w>loigthech</w> <w>áilgen</w> <w>ernes</w> <w>ni</w> <w>do</w> <w>chach</w>. <w>sic</w> <w>porca</w> <w>suum</w> <w>suo</w> <w>largitur</w> <w>lac</w>. \n', NULL, 'p. 265b', 'cumlachtaid');
