INSERT INTO `reading` VALUES(15786, 'Coinḟodorne', 1, 239, 'B.239', '13.6-9', '', '\n<w type="hw" lemma="cú 1c">Coinḟodorne</w> .i. <w>dobarchoin</w> .i. <w>fodobarnai</w> .i. <w>fouiscidi</w>. <w>dobar</w> <w>ainm</w> <w>coitcend</w> <add>berla</add> <w>iter</w> <w>gaedilg</w> ⁊ <w>combrec</w>. <w>dobur</w> .i. <w>uisce</w> <w>unde</w> <w>dicitur</w> <w>dobarcu</w> ⁊ <w>dobreth</w> <w>doborci</w> <add>imorro isin</add> <w>chombreic</w>. \n', NULL, 'p. 265b', 'cú 1c');
