INSERT INTO `reading` VALUES(15790, 'Cerball', 1, 243, 'B.243', '13.17-24', '', '\n<w type="hw" lemma="Cerball">Cerball</w> .i. <w>cerrbél</w>. a <w>bél</w> <w>fora</w> <w>chirr</w>. <w>Cerrball</w> <w>din</w> .i. <w>cer</w> <w>focher</w>. <w>fochuir</w> <w>ball</w>. ł <w>bell</w>. <w>donní</w> <w>is</w> <w>bellum</w> <w>cath</w>. <w>Corrchathach</w> <w>din</w> <w>onní</w> <w>is</w> <w>cerball</w>. <w>inde</w> <w>poeta</w> <w>Sithbe</w> <w>Cerball</w> <w>for</w> a <w>chuairt</w>, <w>nibdar</w> <w>dermaill</w> a <w>dí</w> <w>dhóit</w>, <w>focher</w> <w>Cormac</w> <w>mor</w> <w>in</w> <w>bét</w>, <w>noe</w> <w>fichit</w> <w>cét</w> <w>cufochóic</w>.\n', NULL, 'p. 265b', 'Cerball');
