INSERT INTO `reading` VALUES(15841, 'Dreand', 1, 288, 'B.288', '15.42-3', '', '\n<w type="hw" lemma="drenn 1">Dreand</w> .i. <w>debaid</w> <w>unde</w> <w>dicitur</w> <w>drennach</w> .i. <w>debtach</w>. <w>Drénd</w> <w>din</w> .i. <w>garb</w> <w>unde</w> <w>dicitur</w> <w>aindreand</w> <add>.i. sliab</add>. \n', NULL, 'p. 266a', 'drenn 1');
INSERT INTO `reading` VALUES(15842, 'Deal', 1, 289, 'B.289', '15.44-5', '', '\n<w type="hw" lemma="dela 1">Deal</w> .i. <w>sine</w> <w>bó</w>. <w>unde</w> <w>dicitur</w> i <w>mBrethaib</w> <w>nemid</w> <w>combo</w> <w>do</w> <w>dílachta</w> <w>deal</w>. <corr>aliter <w>dalta</w> <w>dá</w> deal</corr> .i. <w>mac</w> <w>dabó</w>. \n', NULL, 'p. 266a', 'dela 1');
INSERT INTO `reading` VALUES(15843, 'Deliugud', 1, 290, 'B.290', '16.1-3', '', '\n<w type="hw" lemma="deiliugad">Deliugud</w> .i. <w>síniugud</w>. <w>etarscarud</w> ⁊ <w>deliugud</w> <w>inræda</w> <w>fri</w> <w>araile</w> <w>amail</w> <w>rodeligthea</w> <w>sine</w> <w>dianad</w> <w>anmand</w> <w>delái</w>. <w>deliugud</w> .i. <w>deailicad</w> .i. <w>da</w> <w>roind</w>. \n', NULL, 'p. 266a', 'deiliugad');
INSERT INTO `reading` VALUES(15844, 'Díthreb', 1, 291, 'B.291', '16.4', '', '\n<w type="hw" lemma="díthrub">Díthreb</w> .i. <w>beith</w> <w>cen</w> <w>treib</w> ł <w>cen</w> <w>trebaide</w> <w>and</w>. \n', NULL, 'p. 266a', 'díthrub');
INSERT INTO `reading` VALUES(15845, 'Dísert', 1, 292, 'B.292', '16.5', '', '\n<w type="hw" lemma="dísert">Dísert</w> .i. <w>disertus</w> <w>locus</w> .i. <w>robádus</w> <add>ł roboth</add> <w>and</w> <w>riam</w>. \n', NULL, 'p. 266a', 'dísert');
INSERT INTO `reading` VALUES(15846, 'Droichet', 1, 293, 'B.293', '16.6-9', '', '\n<w type="hw" lemma="drochet">Droichet</w> .i. <w>doroichet</w> <w>cách</w> <w>taris</w> <w>on</w> <w>ur</w> <w>co</w> <w>araile</w> <add>don <w>uisce</w> ł <w>na</w> fedhe</add>. droichṡet <w>din</w> .i. <w>sét</w> <w>dírech</w>. <w>ar</w> <w>is</w> <w>droch</w> <w>cach</w> <w>ndírech</w> .i. <w>nithalla</w> <w>nemdírge</w> <w>do</w> <w>arnab</w> <w>tusledach</w>. ł <w>drochsét</w> <w>ar</w> a <w>olcus</w>. \n', NULL, 'p. 266a', 'drochet');
INSERT INTO `reading` VALUES(15847, 'Deshruith', 1, 294, 'B.294', '16.10', '', '\n<w type="hw" lemma="desruith">Deshruith</w> .i. diṡruith .i. <w>ni</w> <w>sruith</w>. \n', NULL, 'p. 266a', 'desruith');
INSERT INTO `reading` VALUES(15848, 'Deme', 1, 295, 'B.295', '16.11-12', '', '\n<w type="hw" lemma="deime 1">Deme</w> .i. <w>teime</w> .i. <w>teim</w> <w>cach</w> ṅdub. <w>unde</w> <w>dicitur</w> <w>temen</w> .i. <w>doirche</w>. <w>Deme</w> <w>din</w> <w>for</w> <w>dorchi</w> <w>náidche</w>. \n', NULL, 'p. 266a', 'deime 1');
INSERT INTO `reading` VALUES(15849, 'Demess', 1, 296, 'B.296', '16.13-15', '', '\n<w type="hw" lemma="deimes">Demess</w> s .i. <w>meass</w> <w>déde</w> <w>and</w> <add>it <w>da</w> <w>scin</w> lais</add>. ł <w>demas</w> .i. <w>dé</w> <w>emeass</w> <w>asa</w> <w>degscín</w>. <add place="margin">ł <w>mes</w> .i. <w>fæbur</w> <w>nt</w> <w>dicitur</w> Mesgegra</add> \n', NULL, 'p. 266a', 'deimes');
