INSERT INTO `reading` VALUES(15851, 'Dubach', 1, 298, 'B.298', '16.17', '', '\n<w type="hw" lemma="dubach 1">Dubach</w> .i. <w>dísubach</w> .i. <w>dí</w> <w>fo</w> <w>díultad</w>. <w>de</w> ł <w>du</w> ł <w>do</w> <w>fodíultad</w>. \n', NULL, 'p. 266a', 'dubach 1');
