INSERT INTO `reading` VALUES(15857, 'Dona', 1, 303, 'B.303', '16.22', '', '\n<w type="hw" lemma="dona">Dona</w> .i. <w>diana</w> <add>.i. <w>bith</w> <w>cen</w> ana</add>. \n', NULL, 'p. 266a', 'dona');
INSERT INTO `reading` VALUES(15858, 'Dairfine', 1, 304, 'B.304', '16.23-7', '', '\n<w type="hw" lemma="Dairfine">Dairfine</w> <add>.i. <w>Corcolaigde</w> .i. <w>fine</w> <w>Daire</w> Dóimthiġ</add> <w>ainm</w> <w>dona</w> <w>filedu</w> .i. <w>duarfine</w>. <w>fine</w> <w>duar</w>. <w>duar</w> <w>din</w> <w>focul</w>. <w>duarḟine</w> <w>iaram</w> .i. <w>fine</w> <w>bís</w> <w>forordugud</w> .i. <w>ḟocul</w>. <w>duar</w> <w>din</w> <w>is</w> <w>ainm</w> <w>do</w> <w>rand</w>. <w>ut</w> <w>dicitur</w> i <w>mBrethaib</w> <w>nemid</w> .i. <w>duar</w> <w>donesa</w> <w>nath</w> .i. <w>rand</w> <w>is</w> <w>airdercem</w> <add>ł <w>is</w> airigda</add> <w>don</w> <w>molad</w>. \n', NULL, 'p. 266a', 'Dairfine');
INSERT INTO `reading` VALUES(15860, 'Diancécht', 1, 305, 'B.305', '16.28-35', '', '\n<w type="hw" lemma="Díancécht">Diancécht</w> <w>ainm</w> doṡaid <w>legis</w> <w>na</w> <w>hErenn</w> .i. <w>dia</w> <w>na</w> <w>cécht</w>, <w>na</w> <w>cumachta</w>. <w>cécht</w> <w>din</w> <w>ainm</w> <w>da</w> <w>cach</w> <w>cumachta</w>. <w>Diancécht</w> .i. <w>deus</w> <w>salutis</w> <add>.i. slainte</add>. <w>Diancécht</w> <w>din</w> <w>dia</w> <w>na</w> <w>hícce</w> <w>ut</w> <add>dixit</add> <w>Néde</w> <w>mac</w> <w>Ádna</w> .i. <w>cechtsom</w> <w>derco</w> <w>aithsceinm</w> <w>ailcne</w> .i. <w>cumachtaigsim</w>. <w>ailcne</w> <add>imorro</add> .i. <w>scillec</w> <w>beac</w> e <w>romebaid</w> <w>don</w> <w>ailig</w> <w>corbean</w> <w>fora</w> <w>súilsium</w> <w>conidcæch</w>. <w>amrubhairt</w> a <w>chumachtu</w> <w>fair</w>. <w>non</w> <w>ut</w> <w>imperiti</w> <w>dicunt</w> <w>céchtsom</w> .i. <w>caechsom</w> ⁊ araile{?}. \n', NULL, 'p. 266a', 'Díancécht');
INSERT INTO `reading` VALUES(15861, 'Deach', 1, 306, 'B.306', '16.36-17.21', '', '\n<w type="hw" lemma="deach">Deach</w> .i. <w>defuach</w> .i. <w>deḟocul</w>. <w>fuach</w> <w>focul</w> .i. <w>comrag</w> <w>focail</w>. .i. <w>dialt</w> <w>fri</w> <w>dialt</w>. <w>is</w> <w>deach</w> <w>is</w> <w>lugem</w>. <w>arciatberar</w> <w>déach</w> <w>don</w> <w>díalt</w> <w>ní</w> <w>hirasa</w> <w>sin</w> <w>acht</w> <add>is</add> <w>aire</w> <w>atberar</w> <w>deach</w> <w>fo</w> <w>bith</w> <w>is</w> <w>fondeach</w>. ł <w>is</w> <w>fotha</w> ṅdeich. <w>is</w> <w>as</w> <w>forberad</w> <w>coḟóircerid</w> <w>mbrechta</w> <w>imbiat</w> .i. <w>uiii</w>. ṅdiailt <w>amail</w> <w>asberr</w> <w>in</w> <w>laiten</w> <w>unus</w> <w>non</w> <w>est</w> <w>numerus</w> <w>sed</w> <w>ab</w> <w>eo</w> <w>crescunt</w> <w>numeri</w>. <w>Ocht</w> ṅdéich <w>tra</w> <w>atrimet</w> <w>filid</w> <w>na</w> <w>nGædel</w> ⁊ <w>is</w> <w>cos</w> inṅdialtson .i. <w>iarsinní</w> <w>na</w> <w>fil</w> <w>alt</w> <w>and</w> ⁊ <w>na</w> <w>róinnter</w>. <w>Recomarc</w> <w>indeach</w> <w>tanaise</w> .i. <w>recómracud</w> <w>fri</w> <w>araill</w> .i. <w>díalt</w> <w>fri</w> <w>dialt</w> <w>ut</w> <w>Cormac</w>. <w>Iarcomarc</w> <w>in</w> <w>tress</w> <w>deach</w>, <w>iar</w> <w>comracud</w> .i. <w>iarsincomrac</w> <w>tóisech</w> <w>ut</w> Cormac<add>an</add>. <w>Felis</w> <w>incethramad</w> <w>déach</w>. <w>iarsinní</w> <w>ḟilles</w> .i. <w>cia</w> <w>dobcrar</w> a <w>cethair</w> <w>imcrand</w> <w>anuas</w> ł <w>umcach</w> <w>raed</w> <w>ele</w> <w>iḟilled</w> <w>fillis</w> <w>imbe</w> <w>incetherda</w> .i. <w>adó</w> <w>ille</w> ⁊ <w>adó</w> <w>anund</w>. <w>niba</w> <w>claen</w> <w>intairesin</w> <w>arnibí</w> <w>dialt</w> <w>forcrith</w> <w>inechtair</w> <w>adoleath</w> <w>ut</w> <w>est</w> <w>Murchertachán</w>. <w>ni</w> <w>samlaid</w> <w>don</w> <w>deach</w> <w>fil</w> <w>inadhiaid</w> .i. <w>claenre</w> <w>incoiced</w> <w>deach</w>. <w>is</w> <w>aire</w> <w>atberar</w> <w>claenré</w> <w>de</w> <w>fobíth</w> <w>is</w> <w>lettromm</w> <w>fodailter</w> ⁊ <w>ciadoberar</w> <w>umní</w> <w>ar</w> <w>itruma</w> ⁊ <w>it</w> <w>lia</w> <w>inatri</w> <w>oldáite</w> <cb n="p. 266b"/> <w>adó</w>. <w>arit</w> .u. <w>dialta</w> <w>fil</w> <w>iclænré</w> <w>amail</w> <w>rogab</w> fianamail<corr>echar</corr>. <w>Luibenchosach</w> <w>in</w> <w>sesed</w> <w>deach</w>. <w>luib</w> .i. <w>luibne</w> <w>mér</w> <w>na</w> <w>láime</w> ⁊ <w>cossa</w> <w>na</w> <w>mer</w> <w>estib</w> <w>suas</w> .i. <w>inraig</w> ⁊ <w>indoit</w> <w>cusinalt</w> <w>na</w> <w>gualand</w> ⁊ <w>fri</w> <w>sodain</w> <w>samailter</w> <w>indeachsin</w> <w>icorp</w> <w>duine</w>. <w>se</w> <w>haisle</w> <w>din</w> <w>fil</w> o <w>chind</w> <w>in</w> <w>meoir</w> <w>co</w> <w>halt</w> <w>na</w> <w>gualand</w> .ui. <w>dialt</w> <w>din</w> <w>fil</w> <w>iluibenchossach</w> <w>ut</w> <w>est</w> fiannamail<corr>echarad</corr>. <w>Claidemnus</w> .i. <w>claidem</w> <w>manus</w> <w>sechtmad</w> <w>deach</w> i. e. <w>claidem</w> <w>manus</w> <add>.i. nálaime</add> .i. <w>claidem</w> <w>són</w> <w>uli</w> <w>óta</w> <w>hind</w> <w>in</w> <w>meoir</w> <w>conice</w> <w>alt</w> <w>fil</w> <w>iter</w> <w>animda</w> ⁊ <w>amaethán</w>. .uii. ṅaisle <w>din</w> <w>indsin</w> <w>uii</w>. ṅdialt <w>fil</w> i <w>claidemnus</w>. <w>ut</w> <w>est</w> fiannamail<corr>echaradard</corr>. <w>Bricht</w> <w>int</w> <w>ochtmad</w> <w>deach</w>. <w>forinní</w> <w>brígther</w>. <w>aris</w> <w>de</w> <w>dogníther</w> <w>nath</w>. <w>isé</w> <w>din</w> <w>is</w> <w>airegda</w> <w>díb</w> <w>inte</w> <w>innellegar</w> <w>nath</w> <w>darinní</w> <w>ellcither</w> <w>na</w> <w>dellaing</w> <w>nath</w>. <w>ocht</w> <w>naisle</w> <w>din</w> <w>fil</w> o <w>ind</w> <w>inméoir</w> <w>conathgabáil</w> <w>maethan</w> <w>animdha</w> .uiii. ṅdíalta <w>din</w> <w>fil</w> <w>ambricht</w>. <w>ut</w> <w>est</w> fiannamail<corr>echaradardae</corr>. \n', NULL, 'p. 266a', 'deach');
INSERT INTO `reading` VALUES(15862, 'Delind', 1, 307, 'B.307', '17.22', '', '\n<w type="hw" lemma="deilidin">Delind</w> .i. <w>deliugud</w> <w>hó</w> <w>ind</w>. <w>ut</w> <w>est</w> <w>ref</w> .i. <w>fer</w>. \n', NULL, 'p. 266b', 'deilidin');
