INSERT INTO `reading` VALUES(15864, 'Demi', 1, 309, 'B.309', '17.24-5', '', '\n<w type="hw" lemma="deime 2">Demi</w> .i. <w>cech</w> <w>neutur</w> <w>lasin</w> <w>laitneoir</w> <w>is</w> <w>deme</w> <w>lasin</w> <w>filid</w> <w>ngædelach</w>. \n', NULL, 'p. 266b', 'deime 2');
INSERT INTO `reading` VALUES(15865, 'Doiduine', 1, 310, 'B.310', '17.26-8', '', '\n<w type="hw" lemma="da 1">Doiduine</w> .i. <w>degduine</w>. <w>ut</w> <w>Néde</w> <w>mac</w> <w>Adna</w> <w>dixit</w> <w>indsa</w> <w>glam</w> <w>de</w> <w>doiduine</w>. <w>sed</w> <w>melius</w> <w>de</w> <w>daduine</w>. <w>Da</w> <w>din</w> <w>gach</w> <w>maith</w> <w>isin</w> <w>chombreic</w> <w>ut</w> <w>dicitur</w> <w>gruc</w> <w>da</w> .i. <w>dagben</w>. \n', NULL, 'p. 266b', 'da 1');
INSERT INTO `reading` VALUES(15866, 'Drúchta dea', 1, 311, 'B.311', '17.29-30', '', '\n<w type="hw" lemma="drúcht">Drúchta dea</w> .i. <w>hith</w> ⁊ <w>blicht</w>. <w>ut</w> <w>Scoti</w> <w>dicunt</w> <corr>drúchta <w>dea</w> <w>Droma</w> ceta</corr>.\n', NULL, 'p. 266b', 'drúcht');
INSERT INTO `reading` VALUES(15867, 'Emain', 1, 312, 'B.312', '17.31-6', '', '\n<w type="hw" lemma="Emain">Emain</w> .i. <w>eomáin</w> .i. <w>eo</w> <w>rind</w> ⁊ <w>muin</w> .i. <w>bráige</w>. <w>eomuin</w> <w>din</w> .i. <w>rind</w> <w>iar</w> <add>ł tar</add> <w>muin</w> .i. <w>delg</w>. <w>is</w> <w>amlaid</w> <w>adrimther</w> <w>tórraind</w> <w>inliss</w> <w>don</w> ṁnái. <w>ombí</w> <w>inasuide</w> <add>ic <w>aisce</w> <w>abruit</w> <w>cororand</w> <w>uimpe</w> <w>imacuairt</w>.</add> <w>doben</w> <w>adealg</w> <w>asabrutt</w> <w>da</w> <w>thoraind</w> <w>impe</w> <w>báchuairt</w> <w>conadelg</w>. <w>issia</w> <w>iarom</w> <w>rosiacht</w> <w>indelg</w> <w>uathi</w> <w>sair</w> <w>fora</w> <w>beolu</w> <w>oldás</w> <w>dia</w> <w>hessi</w> <w>imacuairt</w>. <w>is</w> <w>aire</w> <w>is</w> <w>claen</w> <w>inliss</w>. \n', NULL, 'p. 266b', 'Emain');
INSERT INTO `reading` VALUES(15868, 'Écmacht', 1, 313, 'B.313', '17.37', '', '\n<w type="hw" lemma="écmacht">Écmacht</w> .i. <w>écumachta</w> .i. <w>arníḟil</w> <w>incumachta</w>. \n', NULL, 'p. 266b', 'écmacht');
INSERT INTO `reading` VALUES(15869, 'Emuin', 1, 314, 'B.314', '17.38-44', '', '\n<w type="hw" lemma="emon 1">Emuin</w> .i. é <w>din</w> <w>fódiultad</w>. <w>Emuin</w> <w>din</w> e <w>hoen</w> .i. <w>ni</w>.hoen <add place="margin">acht inddalelap</add> <w>acht</w> a <w>dhó</w> <w>genit</w> <w>and</w>. corṡuidigset <add>iaram</add> <w>na</w> <w>filid</w> <w>muin</w> <w>amedon</w> <w>forimgabail</w> <w>meraigthe</w> <w>ar</w> <w>rob</w> <w>aille</w> <w>leo</w> <w>emoen</w> ł <w>emon</w> <corr>oldás e hoen</corr>. <add place="margin">aliter <w>emon</w> .i. é ⁊ <w>mon</w>. <w>ammon</w> <w>din</w> <w>isin</w> <w>ni</w> <w>as</w> <w>monus</w> <w>isin</w> <w>grec</w>. <w>ammonus</w> <w>is</w> <w>unus</w>. <w>emon</w> <w>din</w> <w>non</w> <w>uuus</w> <w>sed</w> <w>duo</w>.</add> \n', NULL, 'p. 266b', 'emon 1');
