INSERT INTO `reading` VALUES(15918, 'Ferend', 1, 359, 'B.359', '20.6-11', '', '\n<w type="hw" lemma="ferenn">Ferend</w> .i. <w>hig</w> <w>bis</w> <w>umcholpa</w> <w>fir</w> <w>in</w> <w>cuius</w> <w>uicem</w> <w>crechtair</w> <w>ig</w> <add>ł id</add> <w>crechta</w> <w>imcholpa</w> <w>fer</w>. <w>amail</w> <w>nobid</w> <w>din</w> ind<add>le</add> <w>comadus</w> <w>caich</w> <w>is</w> <w>di</w> <w>din</w> <w>dognitis</w> <w>na</w> <w>ferinn</w> <w>uerbi</w> <w>gratia</w> .i. <w>ferend</w> <add>ł ferrend</add> <w>oir</w> <w>imchoiss</w> <w>rig</w>. <w>Ferend</w> <w>din</w> <w>ainm</w> <w>do</w> <w>criss</w> <w>bis</w> <w>imonfer</w>. <w>unde</w> <w>dicitur</w> <w>tachmaicc</w> <w>snechta</w> <w>ferna</w> ł fairnniu) <w>fer</w> .i. <w>doecinaic</w> <w>in</w> <w>snechta</w> <w>crissa</w> <w>fer</w>. \n', NULL, 'p. 267a', 'ferenn');
INSERT INTO `reading` VALUES(15919, 'Fochlocon', 1, 360, 'B.360', '20.12-14', '', '\n<w type="hw" lemma="fochloc">Fochlocon</w> .i. <w>nomen</w> <w>graid</w> <w>filead</w> <w>fora</w> <w>chosmailius</w> <w>fri</w> <w>fochlocain</w> <w>asberar</w>. <w>dí</w> <w>dullind</w> <w>fairsium</w> <w>in</w> <w>cétbliadain</w>. <w>días</w> <w>dó</w> <add>don fochlocon</add> <w>for</w> <w>tuaith</w>. \n', NULL, 'p. 267a', 'fochloc');
