INSERT INTO `reading` VALUES(15923, 'Fochonnad', 1, 365, 'B.365', '20.20-3', '', '\n<w type="hw" lemma="fochnod">Fochonnad</w> .i. <w>fochonad</w> <w>lasamain</w> <w>doberar</w> <w>hi</w> <add>ł fo</add> <w>tenid</w>. <w>ainm</w> <w>dó</w> <w>iarom</w> <w>geltine</w> <add>inchrínaigsin</add>. <w>hide</w> <w>dicitur</w> <w>geltine</w> <w>gile</w> <w>fochonnad</w> <add>noch isin</add> a <w>lassarsium</w>. <w>et</w> <w>de</w> <w>eo</w> <w>dictum</w> <w>est</w> <w>grian</w> <w>in</w> ġaiṁ <w>geltine</w>. \n', NULL, 'p. 267a', 'fochnod');
