INSERT INTO `reading` VALUES(15930, 'Foi', 1, 371, 'B.371', '20.35-8', '', '\n<w type="hw" lemma="Foí">Foi</w> .i. <w>Cnámchaill</w>. <w>ut</w> <w>dixit</w> <w>Grúibne</w> <add>fili</add> <w>fri</w> <w>Corc</w> <w>mac</w> <w>Lúgdhach</w>. <w>In</w> <w>fess</w> <w>fó</w> <w>Foi</w> .i. <w>ba</w> <w>fessach</w> <add>ł befennach</add> <w>Cnámchoille</w>. <w>Item</w> <w>Mog</w> <w>Ruith</w> <add>ł Roth</add> <w>peribit</w> <w>quod</w> <w>Roth</w> <w>Fáil</w> <w>perueniet</w> <w>dicens</w> <w>cori</w> <w>Durluis</w> <w>find</w> <w>iar</w> <w>Foi</w> .i. <w>iar</w> <w>Cnámchaill</w>. \n', NULL, 'p. 267a', 'Foí');
