INSERT INTO `reading` VALUES(15934, 'Fogamur', 1, 375, 'B.375', '20.43-21.6', '', '\n<w type="hw" lemma="fogamar">Fogamur</w> .i. <w>donmís</w> <w>derid</w> <w>is</w> <w>ainm</w> <w>isin</w> <w>fogamur</w> .i. foġam .i. <w>gæth</w> ⁊ <w>mur</w> <w>imbad</w> <w>ut</w> <w>est</w> i <w>mBrethu</w> <w>nemid</w> <w>imbera</w> <w>fogamur</w> .i. foġemur <w>id</w> <w>est</w> <w>fo</w> <w>gemur</w> .i. <w>dag</w> <w>gemur</w>. Daġ .i. <w>cruithnecht</w>. <w>inde</w> <w>dicitur</w> <w>triar</w> <w>dag</w> .i. <w>triar</w> <w>sacarbaic</w> .i. <w>sacer</w> ⁊ <w>pít</w> .i. <w>próind</w>. <w>ut</w> <w>dicitur</w> <w>Pít</w> <w>proind</w> <w>doromult</w> <w>inné</w>, <w>dearb</w> <w>is</w> <w>dámna</w> <w>aithrige</w>, <w>inglan</w> <w>mo</w> <w>chorp</w> <w>lir</w> <w>mogrus</w>, <w>glan</w> <w>intí</w> <w>rochoimprius</w>. <add place="margin">quasi <w>fogamur</w> .i. <w>fota</w> <w>amir</w> <w>ngaim</w> 7rl</add>\n', NULL, 'p. 267a', 'fogamar');
INSERT INTO `reading` VALUES(15935, 'Fót', 1, 376, 'B.376', '21.7-12', '', '\n<w type="hw" lemma="fót 2">Fót</w> .i. <w>faitech</w>. <w>anbfót</w> .i. <w>anbfaitech</w> <w>ut</w> <w>dicitur</w> <w>Bid</w> <w>cách</w> <w>ifaitces</w> a <w>fóit</w>, <w>isciau</w> <w>imthigit</w> <w>innóic</w>, <w>is</w> <w>de</w> <w>ata</w> <w>fót</w> <w>faitech</w>, <w>ocus</w> <w>anfót</w> <w>andḟaitech</w>.\n', NULL, 'p. 267a', 'fót 2');
