INSERT INTO `reading` VALUES(15941, 'Fidchell', 1, 382, 'B.382', '20.40-22.2', '', '\n<w type="hw" lemma="fidchell">Fidchell</w> .i. <w>féthciall</w>. <w>fáthciall</w> .i. <w>ciall</w> ⁊ <w>fath</w> <w>oca</w> <w>himbirt</w>. ł <w>fuathcell</w> .i. <w>fuath</w> <w>cille</w> .i. <w>cetharcoir</w> <w>cétamus</w> <w>inḟidchell</w> ⁊ <w>dirge</w> a <w>tithe</w>, <w>dub</w> ⁊ <w>find</w> <w>forri</w> ⁊ <w>snainmuintir</w> <w>cach</w> <w>la</w> <w>fecht</w> <w>beos</w> <w>bereas</w> a <w>cluithe</w>. <w>Síc</w> ⁊ æcl<ex>es</ex>ia <w>per</w> <w>singulam</w> <w>per</w> .iiii. <w>terrae</w> <w>partes</w> .iiii. <w>euangeliis</w> <w>pásta</w>. <w>is</w> <w>direch</w> <w>ambesaib</w> ⁊ <w>hitíthib</w> <w>na</w> <w>screptra</w> <w>et</w> <w>nigri</w> <w>et</w> <w>albi</w> .i. <w>boni</w> <w>et</w> <w>mail</w> <w>habitant</w> <w>in</w> <w>ecclesia</w>. \n', NULL, 'p. 267b', 'fidchell');
