INSERT INTO `reading` VALUES(15943, 'Folasai', 1, 384, 'B.384', '22.4-7', '', '\n<w type="hw" lemma="folassa">Folasai</w> .i. <w>iarsinní</w> <w>foloing</w> <w>coiss</w> <w>induine</w>. <w>aliter</w> .i. <w>fol</w> .i. <w>quasi</w> <w>sol</w> .i. <w>bonnbach</w> .i. <w>bónd</w> <w>bruach</w>. <w>iter</w> <w>bónd</w> ⁊ <w>bruach</w> <w>bís</w>. <w>Fol</w> <w>din</w> <w>quasi</w> <w>sol</w> <w>ab</w> <w>eo</w> <w>quod</w> <w>est</w> <w>latine</w> <w>solum</w>. <w>Fól</w> .i. <w>cendfochrus</w> <add>.i.</add> .f. <w>pro</w> .s. \n', NULL, 'p. 267b', 'folassa');
