INSERT INTO `reading` VALUES(15945, 'Fasach', 1, 386, 'B.386', '22.9-13', '', '\n<w type="hw" lemma="fásach 1">Fasach</w> .i. <w>fesosech</w>. <w>dober</w> <w>inbretheam</w> <w>cosmailes</w> <w>dacach</w> <w>caingin</w> <w>imafuiglither</w> .i. <w>caingen</w> <w>cosmail</w> <w>di</w> <w>araile</w> ⁊ <w>atfét</w> <w>iarom</w> <w>inbreth</w> r<add>on</add>ucsat <w>brethemain</w> <w>gætha</w> <w>furri</w>. <w>Fássach</w> <w>din</w> .i. <w>fothechaid</w> <w>or</w> <w>seinchaingen</w> <w>frecnairc</w>. <add place="margin-right">ł <w>sechaid</w> <w>din</w> fo<corr>seinbreith</corr> <w>forsin</w> <w>caingin</w> <w>frecnairc</w>.</add> \n', NULL, 'p. 267b', 'fásach 1');
