INSERT INTO `reading` VALUES(15949, 'Gam', 1, 390, 'B.390', '22.18-19', '', '\n<w type="hw" lemma="gaim 1">Gam</w> <w>ab</w> <w>eo</w> <w>quod</w> <w>est</w> <w>gamos</w> <w>grece</w> <w>unde</w> <w>etiam</w> <w>grece</w> <w>mulier</w> <w>nominatur</w> .i. <w>bean</w>, <w>unde</w> <w>bigamus</w> <w>uel</w> <w>trigamus</w> <w>dicitur</w>. \n', NULL, 'p. 267b', 'gaim 1');
INSERT INTO `reading` VALUES(15950, 'Gaimred', 1, 391, 'B.391', '22.20-5', '', '\n<w type="hw" lemma="gemred">Gaimred</w> <w>quasi</w> <w>gamrith</w> <w>et</w> <w>inde</w> <w>Colman</w> <w>mac</w> <w>hui</w> <w>Cluasaig</w> <w>dixit</w> a <w>marbnaid</w> <w>Chumíne</w> <w>ḟota</w> <w>maic</w> <w>Fiachna</w> <w>Ua</w> <w>Choirpri</w> <w>ocus</w> <w>hua</w> <w>Chuirc</w>, <w>ba</w> <w>sái</w> <w>ba</w> <w>hán</w> <w>ba</w> <w>erdercc</w>. <w>dursan</w> <w>marban</w> a <w>mí</w> ġaim, <w>ni</w> <w>liach</w> <w>ni</w> <w>décaib</w> <w>iaram</w> <add>.i. <w>for</w> <w>neam</w> rainic</add>.\n', NULL, 'p. 267b', 'gemred');
INSERT INTO `reading` VALUES(15951, 'Gelistar', 1, 392, 'B.392', '22.26-32', '', '\n<w type="hw" lemma="gelester">Gelistar</w> .i. <w>ainm</w> <w>dáth</w> <w>uisce</w> <w>ambít</w> <w>cethra</w> <w>for</w> <w>óibell</w>. ⁊ <w>doepetar</w> <w>gulba</w> <w>da</w> <w>cach</w> <w>ferand</w> <w>ambí</w> <w>uime</w> ⁊ <w>dogníther</w> <w>cuairt</w> <w>nairbed</w> <w>uime</w> <w>mád</w> <w>iter</w> <w>chomaidchib</w> <w>beas</w> <add>intath</add> <w>arna</w> <w>hethat</w> <w>cethra</w> <w>na</w> <w>gurta</w>. <w>anniumain</w> <w>dognither</w> <w>isin</w> <w>áth</w> <add>ł <w>animon</w> <w>sech</w> <w>sin</w> <w>iaram</w> <w>dogniad</w> <w>ina</w> <w>cethra</w> <w>isin</w> nath</add> <w>is</w> <w>dó</w> <w>is</w> <w>ainm</w> <w>gelistar</w>. ⁊ <w>dlegar</w> <w>bóthar</w> <w>coitchenn</w> <w>do</w> <w>cach</w> <w>chomaitiuch</w> <w>chuici</w> <w>ma</w> <w>cenbóthar</w> <w>bes</w> <add>ł <w>adochum</w> <w>cid</w> <w>cin</w> beol</add>. \n', NULL, 'p. 267b', 'gelester');
INSERT INTO `reading` VALUES(15952, 'Gabur', 1, 393, 'B.393', '22.33-40', '', '\n<w type="hw" lemma="gabor 1">Gabur</w> <w>tre</w> ᚛ᚐ᚜ <corr>ailm</corr> <w>quasi</w> <w>caper</w>. <w>ar</w> <w>issed</w> <w>rotruaillned</w> <w>and</w>. <w>Góbur</w> <w>tre</w> ᚛ᚑ᚜ <corr>ond</corr> <w>di</w> <w>eoch</w> <w>is</w> <w>nomen</w> <w>son</w> ⁊ <w>is</w> <w>combrec</w> <w>rotruallned</w> <w>ind</w> <add>dana i suidiu</add>. <w>Gour</w> <w>din</w> <w>cach</w> <w>solas</w>. <w>inde</w> <w>dicitur</w> <w>gabur</w> <add>ł gobur</add> <w>don</w> <w>eoch</w> <w>geal</w> ⁊ araile{?}. <w>Gabur</w> <w>din</w> <w>ainm</w> <w>da</w> <w>cach</w> <w>each</w> <w>cipead</w> <w>dath</w> <w>bess</w> <w>laiss</w> <add>aile <w>dana</w> <w>ann</w> .i. <w>forsan</w> ech</add> <w>acht</w> <w>combe</w> <add>ł diambe</add> <w>cid</w> <w>becc</w> <w>do</w> <w>gil</w> <w>and</w> <add>is <w>gobur</w> a <w>nomen</w> <w>ar</w> <w>ise</w> <w>airegdam</w> <w>ann</w> <w>nominatur</w> bis</add>. <w>hon</w> <w>dath</w> <w>is</w> <w>airegda</w> <w>nominatur</w>. \n', NULL, 'p. 267b', 'gabor 1');
INSERT INTO `reading` VALUES(15955, 'Gilldæ', 1, 394, 'B.394', '22.41-4', '', '\n<w type="hw" lemma="gilla c">Gilldæ</w> .i. <w>cosmail</w> <w>fri</w> <w>geal</w> ł <w>fri</w> a <w>gil</w> .i. <w>fri</w> a <w>glan</w>. <w>ise</w> a <w>besside</w> <w>do</w> <w>sugud</w>. <w>ise</w> <w>din</w> <w>bés</w> <w>in</w> <w>gilldæ</w> doṡugud <w>forchedal</w> <w>do</w> <w>thengad</w> a <w>fithera</w>. <w>ut</w> <w>dicitur</w> i <w>mBrethaib</w> <w>nemid</w> <w>toglen</w> <w>gil</w> <w>tengaid</w>. \n', NULL, 'p. 267b', 'gilla c');
INSERT INTO `reading` VALUES(15956, 'Gaileng', 1, 395, 'B.395', '23.1-11', '', '\n<w type="hw" lemma="Gaileng">Gaileng</w> .i. <w>din</w> <w>fri</w> <w>Cormac</w> <w>mac</w> <w>Taidg</w> <w>maic</w> <w>Céin</w> <w>asrúbrad</w> .i. <w>dorigne</w> <w>fleid</w> <w>dia</w> <w>athair</w> .i. <w>do</w> <w>Thadg</w> <w>hua</w> <w>Oilella</w> <w>combí</w> <w>cét</w> <w>da</w> <w>cach</w> <w>cenél</w> <w>anmand</w> <w>aice</w> <w>acht</w> <w>bruicc</w> <w>namá</w>. <w>Teit</w> <w>Cormac</w> <w>don</w> <w>brocenaig</w> ⁊ <w>bá</w> <w>máll</w> <w>lais</w> <w>anad</w> <w>fri</w> a <w>togail</w> <w>co</w> <w>tachartsat</w> <w>imach</w> <w>for</w> <w>fír</w> <w>nenig</w> a <w>athar</w> .i. <w>Taidg</w>. <w>Lotar</w> <w>tra</w> <w>na</w> <w>bruicc</w> <w>imach</w> <w>coromarb</w> <w>Cormac</w> <w>cét</w> <w>dib</w> ⁊ <w>rothaispen</w> <w>iconḟleid</w>. <w>rográin</w> <w>iarom</w> <w>cride</w> <w>Thaidg</w> <w>fri</w> <w>hae</w> ⁊ <w>atbert</w> <w>an</w> <w>dorigned</w> <w>and</w> <w>coroainmnigestar</w> a <w>mac</w> <w>hoc</w> <w>nomine</w> .i. <w>Cormac</w> <w>Gælang</w> <add>.i. <w>cac</w> enech</add> <w>unde</w> <w>Galenga</w> <w>nominantur</w>. <w>Gaileng</w> .i. <w>gæi</w> <w>lang</w> .i. <w>cen</w> <w>cennach</w>. <w>gaileng</w> <w>din</w> .i. <w>gailseng</w> <w>iarsinní</w> <w>sengailter</w> <w>indala</w> nǽi. \n', NULL, 'p. 267b', 'Gaileng');
