INSERT INTO `reading` VALUES(15964, 'Gall', 1, 403, 'B.403', '23.19-28', '', '\n<w type="hw" lemma="gall 1a">Gall</w> .i. <w>corthi</w> <w>cloiche</w> .i. <w>nis</w> <w>comathig</w> <w>combatar</w> <w>selba</w> <w>cobrandaib</w> <w>gall</w>. <w>Gall</w> <w>din</w> <w>cetherda</w> <w>fordingair</w> .i. <w>gall</w> <w>corthi</w> <w>cloiche</w> <add>cetamus</add> <w>ut</w> <w>prediximus</w>. <w>adberar</w> <w>gall</w> <w>de</w> <w>ar</w> <w>it</w> <w>Gaill</w> <w>rosuidestar</w> <w>an</w> <w>Erinn</w> <w>artús</w>. <w>Gaill</w> <w>din</w> <w>ainm</w> <w>do</w> ṡaerchlannaib <w>Frangc</w> .i. <w>tress</w> <w>Galliae</w> ⁊ <add>is</add> <w>candore</w> <w>corporis</w> <w>rohainmniged</w>. <w>gall</w> <w>enim</w> <w>grece</w> <w>lac</w> <w>latine</w> <w>dicitur</w> <w>unde</w> <w>Galli</w> .i. <w>indasta</w> <w>sic</w> <w>dana</w> <w>gall</w> <w>is</w> <w>nomen</w> <w>do</w> <w>elu</w>. <w>inde</w> <w>Fear</w> <w>Muman</w> <w>dixit</w> <w>cocholl</w> <w>chos</w> <w>ngall</w> <w>gemin</w> <w>bráin</w>. <w>gall</w> <w>din</w> <w>ainm</w> <w>do</w> <w>chailech</w> .i. <w>gallus</w> .i. <w>dinni</w> <w>is</w> <w>galea</w> <w>capitis</w> <w>nominatur</w> <add>disuidiu</add>. \n', NULL, 'p. 267b', 'gall 1a');
INSERT INTO `reading` VALUES(15968, 'Grasticum', 1, 404, 'B.404', '23.29-31', '', '\n<w type="hw" lemma="gratsicum">Grasticum</w> .i. <w>graziacum</w> .i. <w>atlugud</w> <w>buide</w> <w>Patraic</w>. <w>quod</w> <w>Scoti</w> <w>corrupte</w> <w>dicunt</w>. <w>sic</w> <w>autem</w> <corr>dici</corr> <w>debet</w> .i. <w>grasagum</w> <w>do</w> <w>duiu</w> .i. <w>gratias</w> <w>deo</w> <w>agimus</w>. \n', NULL, 'p. 267b', 'gratsicum');
