INSERT INTO `reading` VALUES(15974, 'Gart', 1, 410, 'B.410', '23.44', '', '\n<w type="hw" lemma="gart 1">Gart</w> .i. <w>déde</w> <w>fordingair</w>. <w>gart</w> .i. <w>ceand</w> <w>isin</w> <w>Dúil</w> <w>fheda</w> <w>máir</w>. <w>gart</w> <w>din</w> .i. <w>féile</w> <w>is</w> <w>cend</w> <w>for</w> <w>cach</w> ṅdail <w>amra</w> <w>dogni</w> <w>duine</w>. \n', NULL, 'p. 267b', 'gart 1');
