INSERT INTO `reading` VALUES(15977, 'Gnó', 1, 412, 'B.412', '24.3-7', '', '\n<w type="hw" lemma="gnó">Gnó</w> .i. <w>cuidmide</w>. <w>unde</w> <w>dicitur</w> <w>ní</w> <w>recht</w> <w>nach</w> <w>gnó</w> .i. <w>ni</w> <w>dírech</w> <w>nach</w> <w>cuidmide</w> .i. <w>ní</w> <w>dir</w> <w>do</w> <w>recht</w> <w>minabmaith</w>. <w>ni</w> <corr>dir do</corr> <w>gno</w> <w>din</w> .i. <w>ni</w> <w>maith</w> <w>do</w> <w>chuidmidu</w> ł <w>do</w> <w>gáire</w> <w>and</w>. <w>Gnoe</w> <w>imorro</w> <w>cach</w> <w>ségda</w>. <w>ut</w> <w>dicitur</w> <w>isin</w> <w>tSenchus</w> <w>mar</w> <cb n="p. 268a"/> <w>cno</w> <w>gnoe</w> .i. <w>ségdai</w>. \n', NULL, 'p. 267b', 'gnó');
