INSERT INTO `reading` VALUES(16004, 'Himbath', 1, 438, 'B.438', '25.18-22', '', '\n<w type="hw" lemma="imbath">Himbath</w> .i. <w>oician</w>. <w>bath</w> .i. <w>muir</w> <w>ut</w> <corr>est</corr> <add>muir</add> <w>iter</w> <w>Erinn</w> ⁊ <w>Albain</w> <w>uel</w> <w>aliud</w> <w>quodcunque</w> <w>mare</w> <w>inatimchell</w> <w>imacuairt</w> <w>ut</w> <w>mare</w> <w>terrenum</w>. <w>Himbath</w> <w>din</w> .i. <w>immuir</w> <add>.i. muir</add> <w>imthimcelles</w> <w>imacuairt</w> <w>is</w> <w>di</w> <w>is</w> <w>ainm</w> <w>ocian</w> <add>ł <w>is</w> <w>hé</w> <w>ind</w> <w>ocian</w> <w>son</w> deitsiu</add>. \n', NULL, 'p. 268a', 'imbath');
