INSERT INTO `reading` VALUES(16007, 'Himbas forosnai', 1, 441, 'B.441', '25.27-45', '', '\n<w type="hw" lemma="imbas 1">Himbas forosnai</w> .i. <w>dofuarascaib</w> <w>seicib</w> <w>cach</w> <w>ræt</w> <w>bid</w> <w>maith</w> <w>lasin</w> <w>filid</w> ⁊ <w>bud</w> <w>ádlac</w> <w>dó</w> <w>do</w> <w>ḟaillsiugud</w>. <w>is</w> <w>amlaid</w> <w>dognither</w> <w>sin</w> .i. <w>cocnaid</w> <add>ł concna</add> <w>infili</w> <w>mír</w> <w>do</w> <w>charnna</w> <w>dhergmuice</w> ł <w>chon</w> ł <w>chaitt</w> ⁊ <w>dosber</w> <w>iaram</w> <w>isin</w> <w>líg</w> <w>fora</w> <w>chula</w> <w>na</w> <w>cómlad</w> ⁊ <w>canaid</w> <w>díchedul</w> <w>fair</w> ⁊ <w>hidbraid</w> <w>sin</w> <w>do</w> <w>dheib</w> <w>hídal</w>. ⁊ <w>gutagair</w> <w>dó</w> <w>iaram</w> a <w>hídalu</w>. ⁊ <w>nisfaghaib</w> <w>din</w> <w>iarnamárach</w>. ⁊ <w>dochan</w> <w>brichta</w> <w>for</w> a <w>dhí</w> <w>baiss</w>. <w>contagair</w> <w>beos</w> a <w>dhee</w> <w>hídal</w> <w>chuige</w> <w>arna</w> <w>toirmesctha</w> a <w>chodlad</w> <w>innnbe</w>. ⁊ <w>dosber</w> a <w>dí</w> <w>boiss</w> <w>ima</w> <w>díb</w> <w>lecnib</w> <w>contuil</w> <w>ísuan</w>. ⁊ <w>bíther</w> <w>oca</w> <w>fhaire</w> <w>ar</w> <w>na</w> <w>roimprá</w> ⁊ <w>na</w> <w>rothairmesca</w> <w>nech</w> <w>cotaispentar</w> <w>dó</w> <w>cach</w> <w>ní</w> <w>immbambí</w> <w>cocend</w> <w>nómaide</w> ł a <w>dó</w> ł a <w>tri</w> ł <w>fot</w> ł <w>mhessedh</w> <w>oc</w> <w>hídbert</w>. <w>et</w> <w>ideo</w> <w>himbas</w> <w>dicitur</w> .i. <w>dí</w> <w>boiss</w> <w>uime</w> .i. <w>bass</w> <w>ádiu</w> ⁊ <w>has</w> <w>anall</w> <w>ima</w> <w>leccnib</w>. ⁊ <w>atrogell</w> ł <w>atrarpe</w> <w>tra</w> <add>Patraicc</add> <w>innísin</w> ⁊ <w>anteinm</w> <w>lægda</w> .i. <w>roforgell</w> <w>na</w> <w>bud</w> <w>nime</w> <w>na</w> <w>talman</w> <w>nach</w> <w>æn</w> <w>dosgní</w> <w>uair</w> <w>is</w> <w>díultad</w> <w>do</w> <w>baithis</w>. <w>Díchedul</w> <w>do</w> <w>chendaib</w> <w>din</w> <w>for</w> <w>fhacbad</w> <add>són</add> a <w>dénum