INSERT INTO `reading` VALUES(16041, 'Leithech', 1, 473, 'B.473', '27.14-43', NULL, '\n<w type="hw" lemma="leithech 1">Leithech</w> .i. <w>déde</w> <w>fordingair</w> .i. <w>ainm</w> <w>cetamus</w> <w>do</w> <w>chenéul</w> <w>éisc</w> <w>indsin</w> .i. <w>fora</w> <w>lethe</w> <w>nech</w> <w>bís</w> <w>de</w> ⁊ <w>fora</w> <w>thanacht</w>. <w>arismor</w> <w>lethe</w> <w>nech</w> <w>bís</w> <w>de</w> <w>in</w> <w>oceano</w>. <w>Lethech</w> <w>din</w> <w>ainm</w> <w>do</w> <w>lossait</w> <w>iarsinní</w> <w>letair</w> <w>bairgean</w> <w>furri</w>. <w>amail</w> <w>atbert</w> <w>Cruitine</w> <w>fechtus</w> <w>luid</w> <w>do</w> <w>thig</w> <w>aroile</w> <w>écis</w> ⁊ a <w>gilla</w> <w>lais</w> .i. <w>écsíne</w> <w>esside</w> <w>comenmain</w> <w>aḟithiræ</w>. <w>Farolaid</w> <w>din</w> <w>Cruitíne</w> <w>bodesin</w> a <w>muig</w> ⁊ <w>lécis</w> a <w>gilla</w> <w>do</w> <w>aigidecht</w> <w>do</w> <w>thig</w> <w>inécis</w>. <w>Dobreth</w> <w>tarr</w> <w>tuirc</w> <w>íscábull</w> <w>do</w> ⁊ <w>rogab</w> <w>coléig</w> <w>int</w> <w>éces</w> <w>oc</w> <w>aacallaim</w> <w>inécsine</w> ⁊ <w>oc</w> <w>cur</w> ṡúla <w>dar</w> <w>aḟrithgnam</w>. <w>Rorathaig</w> <w>int</w> <w>éces</w> <w>mórmenmain</w> <w>inecsine</w> ⁊ <w>laigeat</w> <w>afri</w> thġnama. <w>Intan</w> <w>tra</w> <w>bha</w> <w>bruithe</w> <w>intarr</w> <w>atbert</w> <w>int</w> <w>éceas</w> <w>fiad</w> <w>inécsine</w> .i. <w>tofotha</w> <w>tarr</w> <w>tein</w> .i. <w>as</w> <w>mithig</w> a <w>thircáil</w> <add>ł a tiscáil</add> <w>do</w> <w>thenid</w> ⁊ <w>ba</w> <w>coḟessed</w> <w>som</w> <w>cia</w> <w>freccra</w> <w>doberad</w> <w>int</w> <w>écsin</w> <w>do</w> <w>fobith</w> <w>rochualasom</w> <w>int</w> <w>éces</w> <w>oc</w> <w>gúmháidim</w> <w>alanaile</w> <corr>ṅairec</corr> <w>ninganta</w> <w>amail</w> <w>bid</w> <w>hé</w> <w>bodessin</w> <w>ar</w> <w>dorissed</w> ł <w>ara</w> <w>tísead</w> ⁊ <w>ní</w> <w>rochredsium</w> <w>din</w> <w>int</w> <w>éces</w> ⁊ <w>ba</w> <w>aire</w> <w>atbert</w> <w>int</w> <w>éces</w> <w>do</w> <w>fromad</w> <w>inécsine</w> .i. <w>tófotha</w> <w>tarr</w> <w>tein</w>. <w>et</w> <w>tribus</w> <w>uicibus</w> <w>dixit</w> <w>Dofotha</w> <w>tarr</w> <w>tein</w> <w>et</w> <w>non</w> <w>respondit</w> <w>eí</w> <w>uel</w> <w>ullum</w> <w>uerbum</w>. <w>din</w> <w>iarom</w> <w>atracht</w> <w>int</w> <w>écsine</w> ⁊ <w>teit</w> <w>cusin</w> <w>maigin</w> <w>amboi</w> <w>Cruitíne</w> ⁊ <w>atfét</w> <w>scela</w> <w>dó</w> .i. <w>int</w> <w>aithesc</w> <w>roráid</w> <w>int</w> <w>éces</w> .i. <w>tófothá</w> <w>tarr</w> <w>tein</w>. <w>Maith</w> <w>ol</w> <w>Cruitíne</w> <w>intan</w> <w>asbera</w> <w>doridisi</w> <w>abair</w> <w>fris</w> <w>Toe</w> <w>lethaig</w> <w>foen</w> <w>friss</w> .i. <w>fon</w> <w>tarr</w> ⁊ <w>fris</w> <w>adaind</w> <w>indlis</w> ł <w>fri</w> <w>sin</w> <w>le</w> <w>adaind</w> <w>indlis</w> .i. <w>toe</w> <w>lossait</w> <w>foen</w> <w>fris</w> .i. <w>fon</w> <w>tarr</w>. ⁊ <w>fri</w> <w>sin</w> <w>dle</w> <w>coindil</w> <w>dodécsi</w> <w>dús</w> <w>inbruithe</w> <w>in</w> <w>tarr</w>. <w>intan</w> <w>tra</w> <w>dessid</w> <w>istig</w> <w>thall</w> <w>dixit</w> <w>int</w> <w>éces</w> <w>in</w> <w>cetnai</w> <w>et</w> <w>dixit</w> <w>int</w> <w>écsine</w> <w>Toe</w> <w>lethaig</w> ⁊ araile{?}. <w>Maith</w> <w>ol</w> <w>int</w> <w>éces</w> <w>ni</w> <w>brú</w> <w>ecsine</w> <w>rotoirne</w> ł <w>rotorma</w>. <w>is</w> <w>focus</w> <w>rothoirned</w> <w>is</w> <w>focus</w> <w>din</w> <w>Cruitine</w> <w>condogair</w> a <w>muig</w>. <w>Adagar</w> <w>iarom</w> <w>Cruitine</w> <w>ferthar</w> <w>failte</w> <w>fris</w> ⁊ <w>doberar</w> <w>biad</w> <w>naill</w> <w>isin</w> <w>coire</w> <w>iarom</w> ⁊ <w>ba</w> <w>bec</w> <w>amenma</w> <w>inécsine</w> <w>fobith</w> <w>contib</w> <w>int</w> <w>éces</w> <w>uime</w> <w>céin</w> <w>coracaillestar</w> <w>Cruitine</w> ⁊ araile{?}. \n', NULL, 'p. 268b', 'leithech 1');
INSERT INTO `reading` VALUES(16043, 'Leos', 1, 474, 'B.474', '27.44-28.2', NULL, '\n<w type="hw" lemma="lés 1a">Leos</w> .i. <w>imdergad</w> <w>imandergthar</w> <add>ł imdergthar</add> <w>duine</w> iarnaǽir ł <w>écnach</w>. <w>leos</w> <w>din</w> .i. <w>soillse</w> <w>tit</w> <w>est</w> i <w>nDúil</w> <w>roscaid</w> <w>grinniud</w> <w>leos</w> .i. <w>díbad</w> <w>soillsi</w> .i. <w>coindle</w>. <w>Item</w> <w>aigead</w> <w>ḟir</w> <w>ima</w> <w>leos</w> <w>luinether</w> ł <w>imaleos</w> <w>luindetar</w> .i. <w>imatimchella</w> <w>soillse</w>. \n', NULL, 'p. 268b', 'lés 1a');
