INSERT INTO `reading` VALUES(16070, 'Muilend', 1, 499, 'B.499', '29.3-6', '', '\n<w type="hw" lemma="muilend">Muilend</w> .i. <w>mol</w> ⁊ <w>bond</w> <add>.i. <w>ar</w> <w>issed</w> <w>deide</w> <w>as</w> <w>maillem</w> immuilend</add>. <w>hond</w> .i. <w>cloch</w>. <w>mó</w> a <w>oil</w> .i. a <w>chlocha</w> <w>quam</w> <w>clocha</w> <w>broon</w>. <w>Muilind</w> <w>din</w> .i. <w>meil</w> ⁊ <w>lind</w> <corr>ar is</corr> <w>for</w> <w>lind</w> <w>méileas</w>. <w>Molo</w> <w>muilend</w> .i. <w>mola</w> <w>broo</w> <w>din</w>. ł <w>muiliern</w>. \n', NULL, 'p. 269a', 'muilend');
INSERT INTO `reading` VALUES(16071, 'Merdrech', 1, 500, 'B.500', '29.7-11', '', '\n<w type="hw" lemma="meirdrech">Merdrech</w>. .i. <w>mear</w>. <add place="margin">merdrecb .i. <w>mer</w>. <w>drecb</w> .i. <w>mer</w> ⁊ <w>drech</w> <w>iarnacengal</w>.} <w>bean</w> <w>is</w> <w>mear</w> <w>dreach</w>. ł <w>mear</w> <add>.i. druth</add> ⁊ <w>drech</w> .i. <w>boeth</w>. <w>Merdrecb</w> <w>din</w> .i. <w>drúth</w> <w>baeth</w>. <w>inde</w> <w>poeta</w> <w>mear</w> <w>cach</w> <w>drúth</w> <w>mianach</w> <w>cach</w> <w>baeth</w>. <w>Merdrech</w> <w>ab</w> <w>eo</w> <w>quod</w> <w>est</w> <w>meretrix</w> i. e. a <w>merendo</w> <w>stupri</w> <w>pretium</w>.</add>\n', NULL, 'p. 269a', 'meirdrech');
