INSERT INTO `reading` VALUES(16075, 'Munnu', 1, 504, 'B.504', '29.21-7', '', '\n<w type="hw" lemma="Munnu">Munnu</w> .i. <w>moḟinnu</w> .i. <w>ainm</w> <w>bóid</w> <w>Finntain</w> <w>enim</w> <w>dictus</w> <w>est</w>. <w>unde</w> <w>Maedóc</w> <w>Ferna</w> <w>dixit</w> <w>ocaire</w> ł <w>oca</w> <w>hoer</w> <w>Munnu</w> <w>maic</w> <w>Thulcháin</w> A <w>chilian</w> <w>Dé</w> <w>chumachtaig</w>, a <w>maic</w> <w>Thulcháin</w> a <w>bachlaigh</w>, <w>ruc</w> <w>mac</w> <w>annsai</w> <add>.i. demon</add> <w>do</w> <w>múintir</w>, <w>mathair</w> <w>rotfucc</w> a <w>Ḟinntain</w>.\n', NULL, 'p. 269a', 'Munnu');
