INSERT INTO `reading` VALUES(16104, 'Noes', 1, 531, 'B.531', '31.42-32.6', '', '\n<w type="hw" lemma="nós 1">Noes</w> .i. <w>nó</w>-<w>ḟiss</w> .i. <w>fis</w> <w>nonbar</w> .i. <w>tri</w> <w>rig</w> ⁊ <w>tri</w> <w>nóib</w> ⁊ <w>tri</w> <w>said</w> .i. <w>said</w> <w>filidechta</w> ⁊ <w>said</w> <w>litre</w> ⁊ <w>sáid</w> <w>belra</w> <w>Ḟeni</w>. <w>batarsin</w> <w>uli</w> <w>oc</w> <w>dénam</w> <w>in</w> <w>tSenchusa</w> <w>máir</w>. <w>hide</w> <w>dicitur</w> <w>Læguire</w> <w>Core</w> <w>Dáire</w> <w>dúr</w>, <w>Patraic</w> <w>Beneoin</w> <w>Cairnech</w> <w>coir</w>, <w>Ross</w> <w>Dubthach</w> <w>Fergus</w> <w>cofheib</w>, .IX. <w>sailge</w> <w>sin</w> <w>Senchais</w> <w>moir</w>.\n', NULL, 'p. 269b', 'nós 1');
