INSERT INTO `reading` VALUES(16106, 'Nairne', 1, 533, 'B.533', '32.11-15', '', '\n<w type="hw" lemma="nairne 2">Nairne</w> <add>ł naire</add> .i. <w>gláine</w> ł <w>nairne</w> <w>amail</w> <w>bid</w> <w>nairc</w> <w>nobeth</w> <w>and</w>. <w>senbelra</w> <w>din</w> <w>innísin</w> .i. <w>inairne</w> <add>ł inaire</add> <w>sin</w> <w>asin</w> <w>and</w> ⁊ <w>amail</w> <w>atbertha</w> <w>écin</w> <w>isin</w> <w>gnathbelra</w> <w>indíu</w> <w>la</w> <w>hUr</w> ł <w>la</w> <w>hIr</w>-<w>Mumain</w> <w>maxime</w>. <w>inde</w> <w>dixit</w> <w>in</w> <w>file</w> <w>nífil</w> <w>ní</w> <w>bus</w> <w>toich</w> <w>duit</w>. <w>fhil</w> <w>naire</w> <w>arintí</w> <w>dianimchomaircther</w> .i. <w>fil</w> <w>écin</w> <w>ol</w> <w>se</w>. \n', NULL, 'p. 269b', 'nairne 2');
INSERT INTO `reading` VALUES(16108, 'Nith', 1, 534, 'B.534', '32.16-17', '', '\n<w type="hw" lemma="nethes">Nith</w> .i. <w>guin</w> <w>duine</w> <w>ut</w> <w>est</w> <w>nihe</w> <w>intí</w> <w>dogní</w>. <w>Nethes</w> <w>din</w> .i. <w>guin</w> <w>duine</w> <w>ut</w> <w>est</w> <w>ni</w> <w>hidnæ</w> <w>nethes</w> <w>nemthigetar</w>. \n', NULL, 'p. 269b', 'nethes');
INSERT INTO `reading` VALUES(16110, 'Nescoit', 1, 535, 'B.535', '32.18-39', '', '\n<w type="hw" lemma="nescóit 1">Nescoit</w> .i. <w>ise</w> <w>senchas</w> <w>na</w> <w>nGædel</w>. <w>intan</w> <w>tuccad</w> <w>cath</w> <w>Muige</w> <w>Tuired</w> <w>boi</w> <w>Goibniu</w> <w>goba</w> <w>isin</w> <w>cerdcha</w> <w>oc</w> <w>denam</w> <w>na</w> <w>narm</w> <w>do</w> <w>Tuathaib</w> d. d. <corr>Dé Domnann</corr> ⁊ <w>boi</w> <w>Luchtine</w> <w>sær</w> <w>oc</w> <w>denam</w> <w>na</w> <w>crand</w> <w>isna</w> <w>gaíb</w> ⁊ <w>boi</w> <w>Credni</w> <w>incerd</w> <w>oc</w> <w>denum</w> ṡemand <w>isna</w> <w>gáib</w> <w>cetna</w>. <w>Dicunt</w> <w>autem</w> <w>Scoti</w> <w>Góibniu</w> <w>goba</w> <w>faciebat</w> <w>hastas</w> <w>fri</w> <w>teora</w> <w>grésa</w> ⁊ <w>bafeth</w> <w>in</w> <w>gres</w> <w>dédinach</w>. <w>Dogníd</w> <w>tra</w> <w>Luctine</w> <w>na</w> <w>cranna</w> <w>fri</w> <w>teora</w> <w>snassa</w> ⁊ <w>ba</w> <w>féith</w> <w>insnass</w> <w>dédinach</w>. <w>Síc</w> <w>et</w> <w>Créidne</w> <w>faciebat</w> <w>na</w> <w>semanda</w>. <w>dobidgad</w> <w>Góibne</w> <w>asin</w> <w>tenchar</w> <w>na</w> gǽi <w>conglendais</w> <w>isin</w> <w>ursain</w>. <w>doleced</w> <w>Luchtine</w> <w>na</w> <w>crandu</w> <w>inandíaid</w> ⁊ <w>ba</w> <w>lór</w> <w>dianindsma</w>. <w>dobidgad</w> <w>Creidne</w> <w>ina</w> <w>semunda</w> <w>agobaib</w> <add>na</add> <w>tenchaire</w> ⁊ <w>ba</w> <w>lór</w> <w>dianindsma</w>. <w>Cein</w> <w>tra</w> <w>boi</w> <w>Goibniu</w> <w>ocon</w> <w>nísin</w> <w>lítear</w> <w>bine</w> <w>for</w> a <w>mhnái</w> <w>sium</w>. <w>atchess</w> <w>dosom</w> <w>annsin</w> <w>comba</w> <w>sæth</w> <w>lais</w> <w>inscél</w> ⁊ <w>édaig</w> <w>imbe</w>. <w>issed</w> <w>dosgni</w> <w>fris</w> .i. <w>boi</w> <w>crand</w> <w>inaláim</w> <w>intan</w> <w>atcúas</w> <w>do</w> <w>ascél</w> .i. <w>Neas</w> <w>aainm</w> ⁊ <w>is</w> <w>uime</w> <w>dognither</w> <w>an</w> <w>urnise</w> <w>criad</w> ⁊ <w>dichan</w> <w>brichtu</w> <w>din</w> <w>forsancrandsin</w> ⁊ <