INSERT INTO `reading` VALUES(16223, 'Sin', 1, 642, 'B.642', '41.11-13', '', '\n<w type="hw" lemma="sín 2">Sin</w> .i. <w>cach</w> <w>cruind</w> <w>unde</w> <w>sín</w> <w>maic</w> <w>Máin</w> .i. <w>epistil</w> <w>boi</w> <w>ima</w> <w>brágait</w> <w>fri</w> <w>forgeall</w> <w>fírinde</w> .i. <w>intan</w> <w>ba</w> <w>fír</w> <w>atberead</w> <w>ba</w> <w>fairsig</w> <w>dia</w> <w>bragait</w>. <w>intan</w> <w>ba</w> <w>gó</w> <w>ba</w> <w>cumac</w>. \n', NULL, 'p. 271b', 'sín 2');
