INSERT INTO `reading` VALUES(16235, 'Triath', 1, 654, 'B.654', '41.31-5', '', '\n<w type="hw" lemma="tríath 1">Triath</w> <w>din</w> <w>trede</w> <w>fordingair</w>. <w>triath</w> <w>rig</w> .i. <w>tír</w> ṡídaigther. <w>triath</w> <w>muir</w> .i. <w>tir</w> <w>uathathar</w>. <w>triath</w> <w>torcc</w> .i. <w>tír</w> <w>soodathar</w>. <w>deligther</w> <w>tra</w> <w>ina</w> <w>remennu</w>. <w>triath</w> <w>din</w> .i. <w>tréith</w> a <w>reimm</w>. <w>triath</w> <w>muir</w> .i. <w>trethan</w> a <w>reimm</w>. <corr>triath <w>torc</w> .i. <w>tréthe</w> a reimm</corr>. \n', NULL, 'p. 272a', 'tríath 1');
