INSERT INTO `reading` VALUES(16248, 'Temair', 1, 665, 'B.665', '42.7-11', '', '\n<w type="hw" lemma="temair">Temair</w> .i. <w>te</w> <w>múr</w>. <w>múr</w> <w>Téa</w> <w>ingine</w> Lúg<ex>dach</ex> <w>maic</w> <w>hItha</w> .i. g<ex>re</ex>c rotruaill<ex>ned</ex> <w>and</w>. <w>téo</w> <w>mora</w> i.e. <w>conspicio</w>. <w>teamúr</w> <w>didiu</w> ca<ex>ch</ex> <w>loch</w> <w>ba</w> hurgna{?} <w>décsiu</w> <w>iter</w> <w>mhag</w> ⁊ <w>tech</w>. <w>ut</w> <w>dicitur</w> <w>temair</w> <w>na</w> duath{?} .i. <w>grianan</w> ł <w>tulach</w>. <w>temair</w> <w>in</w> <w>tige</w> .i. <w>grianan</w>. \n', NULL, 'p. 272a', 'temair');
