INSERT INTO `reading` VALUES(16259, 'Tuilgein', 1, 676, 'B.676', '42.24-5', '', '\n<w type="hw" lemma="tuirigin">Tuilgein</w> .i. <w>tulighein</w> .i. <w>gein</w> <w>tolin</w>. <w>tolin</w> <w>ḟir</w> <w>quasi</w> <w>aicned</w> <w>conænaiger</w> <w>fri</w> <w>fír</w> <w>na</w> <w>screptra</w>. \n', NULL, 'p. 272a', 'tuirigin');
INSERT INTO `reading` VALUES(16260, 'Tuirgin', 1, 677, 'B.677', '42.26-45', '', '\n<w type="hw" lemma="tuirigin">Tuirgin</w> .i. <w>tur</w> <w>gina</w> .i. <w>tenga</w>. <w>aliter</w> tur<corr>gein</corr> <w>quasi</w> <w>gein</w> a <w>tuir</w> .i. <w>amail</w> <w>bís</w> <w>tuir</w> <w>már</w> <w>oc</w> <w>fulang</w> <w>thige</w> ⁊ <w>illamu</w> <w>esti</w> <w>síc</w> <w>issed</w> <w>atheag</w> <w>indoman</w> <w>cenntarach</w>. <w>assi</w> <w>tra</w> <w>in</w> <w>tuir</w> .i. <w>fírinde</w> <w>rechta</w> <w>aicnid</w>. <w>Ite</w> a <w>hillamu</w> <w>asin</w> <w>turid</w> .i. <w>ile</w> <w>chialla</w> ⁊ <w>ilchonaire</w> <w>imbrethemnais</w>. <w>tuirgin</w> .i. <w>rig</w> <w>amail</w> <w>atberar</w> i <w>nDuil</w> <w>Roscadaig</w>. <w>Nitulaid</w> <w>fri</w> <w>turigen</w> <w>tuiged</w> <w>artuli</w> <corr>tuigedar tuli?</corr> <w>mára</w> <w>muride</w> ⁊ araile{?}. <w>Turagein</w> .i. <w>torachtghen</w> .i. <w>gein</w> <w>doracht</w> .i. <w>doraid</w> <w>aiccned</w> <w>in</w> <w>araill</w> .i. <w>gein</w> <w>infíraicned</w> <w>ut</w> <w>dicitur</w> <w>Fachtna</w> <w>mac</w> <w>Senchada</w>. <w>Furim</w> <w>gein</w> <w>torachta</w> <w>doreit</w> <w>aicned</w> <w>noll</w> o <w>Ádam</w> <w>conimtheit</w> <w>tria</w> <w>cach</w> <w>naimsir</w> <w>nadamra</w> <w>codé</w> <w>bratha</w>. <w>berid</w> <w>aicned</w> <w>enbethu</w> <w>da</w> <w>cach</w> <w>dúil</w> <w>derb</w> <w>desin</w> <w>æn</w> <w>con</w> æ .i. <w>cusin</w> æṅduiṅe ṅdedinach <w>bess</w> <w>cobruinde</w> <w>bráthai</w>. <w>Turgen</w> .i. <w>toæraghen</w> .i. <w>gein</w> <add>næra .i. gein</add> <w>geiness</w> ⁊ a <w>dí</w> <w>choiss</w> <w>roime</w>. <w>Tobreid</w> <w>din</w> a <w>ture</w> .i. <w>geinsin</w> <w>do</w> <w>chosmailius</w> <w>brethi</w> .i. <w>canaid</w> <w>fássach</w> <w>fír</w> <w>naicned</w>. ⁊ <w>roscad</w> <w>filed</w> <w>do</w> <w>chosc</w> <w>na</w> <w>brethe</w> <w>indsin</w> <w>achend</w> <w>badeoid</w> .i. <w>in</w> <w>testemon</w> <w>canóine</w>. <w>inde</w> <w>dicitur</w> <w>Niní</w> <w>nach</w> <w>cen</w> <w>brethemnus</w> <w>berair</w> <w>natbi</w> <w>iarlégind</w> <w>leir</w> <w>lerigther</w> <w>nach</w> <w>fri</w> caṅoin <w>caid</w> <w>cumustar</w> <w>nách</w> <w>fri</w> <w>haspuc</w> <w>nuasal</w> <w>nastaigther</w>. <w>conad</w> <w>cáid</w> <w>cach</w> <w>ræt</w> <w>cocanóin</w> <w>comuaimm</w>. \n', NULL, 'p. 272a', 'tuirigin');
