INSERT INTO `reading` VALUES(16298, 'Úr', 7, 15, 'L.15', '23333-5', '', '\n               <w type="hw" lemma="úir">Úr</w>. <w>tréide</w> <w>fordingair</w>. <w>úr</w> <w>chetmus</w> .i. <w>talam</w> ⁊ <w>úr</w> <w>cech</w> <w>nuae</w>. <w>amal</w> <w>asmberar</w> <w>immb</w> <w>úr</w>. <w>Úr</w> <w>dano</w> <w>cech</w> n-<w>olc</w>. <w>inde</w> <w>dicitur</w> <w>isna</w> <w>Brethaib</w> <w>Nemed</w> <w>lán</w> <w>do</w> <w>síathach</w> <w>cach</w> n-<w>úr</w> .i. <w>cech</w> n-<w>olc</w> \n            ', NULL, 'p. 179b', 'úir');
