INSERT INTO `reading` VALUES(16306, 'IMbas forosnai', 11, 2, 'La.2', '156.2-17', NULL, '\n<w type="hw" lemma="imbas 1">IMbas forosnai</w> .i. <w>do</w> <w>ḟuarascaib</w> <w>sechiret</w> <w>bas</w> <w>maith</w> <w>lasin</w> <w>filid</w> ⁊ <w>bas</w> <w>adlacc</w> <w>dó</w> <w>do</w> <w>ḟaillsigud</w>. <w>Is</w> <w>amlaid</w> <w>ón</w> <w>didiu</w> <w>dogníther</w> <w>ón</w> .i. <w>concná</w> <w>in</w> <w>fili</w> <w>mír</w> <w>do</w> <w>charnu</w> <w>dirg</w> <w>muice</w> ł <w>chon</w> <w>no</w> <w>chaitt</w> ⁊ <w>dabir</w> <w>iarum</w> <w>forlicc</w> <w>iarcul</w> <w>na</w> <w>comlad</w> ⁊ <w>dichain</w> <w>dichetal</w> <w>fair</w> ⁊ <w>atopair</w> <w>do</w> <w>deib</w> <w>idol</w>, ⁊ <w>cotagair</w> <w>do</w>, ⁊ <w>nifargaib</w> <w>iarum</w> <w>arnabarach</w>, ⁊ <w>dicain</w> <w>iarum</w> <w>foradabas</w>, ⁊ <w>congair</w> <w>deo</w> <w>idol</w> <w>chuici</w> <w>arna</w> <w>tarmescatar</w> a <w>chotluth</w>, ⁊ <w>dobeir</w> a <w>da</w> <w>bois</w> <w>ima</w> <w>da</w> <w>leccoinn</w> ⁊ <w>contuili</w>, ⁊ <w>bithir</w> <w>oca</w> <w>horairi</w> <w>ar</w> <w>nach</w> <w>nimprá</w> ⁊ <w>connach</w> <w>tar</w> <w>mesca</w> <w>nech</w>, ⁊ <w>do</w> <w>adbenar</w> <w>do</w> <w>iarum</w> <w>aní</w> <w>arid</w> <w>mbói</w> <w>cocend</w> <w>no</w> <w>maithe</w> ł <w>adó</w> ł <w>atrí</w> <w>fut</w> <w>gardi</w> <w>cotmeissed</w> <w>occond</w> <w>audbairt</w>. <w>Et</w> <w>ideo</w> <w>imbas</w> <w>dicitur</w> .i. <w>bas</w> diṡiu ⁊ <w>bass</w> <w>anall</w> <w>ima</w> <w>cenn</w>. <w>Atrarpi</w> <w>Patraicc</w> <w>anisein</w> ⁊ a <w>tenm</w> <w>láida</w>, ⁊ <w>fortrorgell</w> <w>napanime</w> <w>na</w> <w>talman</w> <w>nach</w> <w>oen</w> <w>dodngéna</w>, <w>ar</w> <w>is</w> <w>diultud</w> <w>bathiss</w>. <cb n="fol. 79rb"/> <w>Dichetal</w> <w>do</w> <w>chendaib</w> <w>immorro</w> i <w>corus</w> <w>cherdæ</w> <w>for</w> <w>acbad</w> <w>son</w>, <w>ar</w> <w>iss</w> <w>oas</w> <w>fotera</w> <w>son</w>, ⁊ <w>ni</w> <w>hecen</w> <w>audpairt</w> <w>do</w> <w>demnaib</w> <w>occu</w