INSERT INTO `reading` VALUES(16317, 'Loch', 11, 13, 'La.13', '158.4-7', '', '\n<w type="hw" lemma="loch 2">Loch</w> <w>déde</w> <w>fordingair</w> .i. <w>loch</w> .i. <w>dubh</w>. <w>unde</w> <w>dicitur</w> <w>assoilgi</w> <w>laith</w> <w>loch</w> <w>bronna</w> .i. <w>dub</w> <w>bronna</w> .i. <w>cid</w> <w>dorche</w> <w>samud</w> <w>cáich</w> ⁊ <w>cid</w> <w>rúndu</w> <w>riam</w> ⁊ <w>iarum</w>, <w>do</w> <w>cruidi</w> a <w>rúna</w> <w>laith</w> <w>do</w> <w>ól</w>. <w>Loch</w> <w>dano</w> .i. <w>huili</w> <w>unde</w> <w>dicitur</w> <w>loch</w> <w>dub</w> .i. <w>huile</w> dub\n', NULL, 'fol. 79rc', 'loch 2');
