INSERT INTO `reading` VALUES(16340, 'Lethech', 11, 34, 'La.34', '160.4-31', '', '\n<w type="hw" lemma="leithech 1">Lethech</w> .i. <w>deide</w> <w>foringair</w> .i. <w>ainm</w> <w>do</w> <w>ceneliu</w> <w>eisc</w> <w>dianid</w> <w>ainm</w> .i. <w>ar</w> a <w>lethet</w> ⁊ <w>ar</w> a <w>tanadetaid</w>, <w>ar</w> <w>is</w> <w>mór</w> <w>lethet</w> <w>neich</w> <w>de</w> <w>bís</w> <w>in</w> <w>ociano</w>. <w>Ainm</w> <w>dano</w> <w>do</w> <w>losait</w> <w>arindí</w> <w>lethaidir</w> <w>bargin</w> <w>fuirri</w>, <w>amail</w> <w>isbert</w> <w>Cruiteni</w> <w>fechtas</w> <w>luid</w> <w>do</w> <w>thig</w> <w>araile</w> <w>éicis</w> ⁊ a <w>gilla</w> <w>leis</w> .i. <w>écsini</w> <w>side</w> <w>co</w> <w>menmain</w> <w>fithidrea</w>. <w>farrolaig</w> <w>didiu</w> <w>Cruiténi</w> <w>fadesin</w> <w>hi</w> <w>mmaig</w>. <w>leigis</w> a <w>gilla</w> <w>do</w> <w>hóigedecht</w> <w>do</w> <w>thig</w> <w>ind</w> <w>éicis</w>. <w>Tobreth</w> <w>didiu</w> <w>tarr</w> <w>tuirc</w> <w>dó</w> i <w>scabáil</w> ⁊ ro<cb n="fol. 79vb"/>bói <w>calleic</w> <w>int</w> <w>éices</w> <w>occ</w> <w>acallaim</w> <w>ind</w> <w>eicsine</w>, ⁊ <w>oc</w> <w>cur</w> <w>súla</w> <w>tar</w> a <w>frithgnam</w>. <w>Rorataigestar</w> <w>iarum</w> <w>int</w> <w>éices</w> <w>mórmenmain</w> <w>ind</w> <w>eicsine</w> ⁊ <w>laget</w> a <w>frithgnama</w>. <w>Intan</w> <w>didiu</w> <w>rombo</w> <w>bruithe</w> <w>in</w> <w>tairr</w> <w>asbert</w> <w>int</w> <w>éices</w> <w>fiad</w> <w>ind</w> <w>ecsiniu</w> .i. <w>Dofotha</w> <w>tairr</w> <w>tein</w> .i. <w>is</w> <w>míthig</w> a <w>thisceil</w> <w>dintein</w>, ⁊  <w>is</w> <w>ba</w> <w>co</w> <w>feissed</w> <w>son</w> <w>cia</w> <w>frecra</w> <w>doberad</w> <w>int</w> <w>éicsine</w> <w>dó</w>, <w>fobith</w> <w>rachualasom</w> <w>int</w> <w>éices</w> <w>oc</w> <w>gamaidim</w> <w>ala</w> <w>naile</w> <w>nairecc</w> <w>ninganta</w> <w>amal</w> <w>bidhe</w> <w>feisin</w> <w>aratissed</w> ⁊ <w>niro</w> <w>son</w> <w>immoro</w> <w>int</w> <w>eces</w>, <w>do</w> <w>promad