INSERT INTO `reading` VALUES(16342, 'Leos', 11, 35, 'La.35', '160.32-3', '', '\n<w type="hw" lemma="lés 1d">Leos</w> .i. <w>imdergad</w> <w>immandergthar</w> <w>duine</w> <w>iarna</w> <w>hair</w> <w>no</w> <w>iarna</w> hecṅug.\n', NULL, 'fol. 79vc', 'lés 1d');
INSERT INTO `reading` VALUES(16343, 'Lóes', 11, 36, 'La.36', '162.1-3', '', '\n<w type="hw" lemma="lés 1a">Lóes</w> .i. <w>suilse</w> <w>ut</w> <w>est</w> <w>in</w> <w>Dúil</w>. <w>Griniud</w> <w>lois</w> .i. <w>díbud</w> <w>suilsi</w> .i. <w>caindli</w>. <w>Item</w> <w>aigid</w> <w>ḟir</w> <w>imme</w> <w>lois</w> <w>luinethar</w> .i. <w>immatimchella</w> <w>suilse</w>.\n', NULL, 'fol. 79vc', 'lés 1a');
