INSERT INTO `reading` VALUES(16345, 'Modebroth', 11, 38, 'La.38', '162.5-7', '', '\n<w type="hw" lemma="debroth">Modebroth</w> <w>ol</w> <w>Patraicc</w>, <w>quod</w> <w>Scoti</w> <w>corrupte</w> <w>dicunt</w>. <w>síc</w> <w>autem</w> <w>dici</w> <w>debet</w> .i. <w>muin</w> <w>duiu</w> <w>braut</w>. a <w>muin</w> <w>didiu</w> <w>is</w> <w>meus</w>, <w>an</w> <w>duiu</w> <w>is</w> <w>deus</w>, <w>am</w> <w>braut</w> <w>is</w> <w>iudex</w>. \n', NULL, 'fol. 79vc', 'debroth');
INSERT INTO `reading` VALUES(16346, 'Marcc', 11, 39, 'La.39', '162.8-10', '', '\n<w type="hw" lemma="marc">Marcc</w> .i. <w>ech</w>. <w>marcach</w> .i. <w>eich</w> <w>imdai</w> <w>laiss</w>, <w>ut</w> <w>dicitur</w> <w>buasach</w> <w>in</w> <w>fer</w> <w>lasa</w> <w>mbit</w> <w>bái</w> <w>imdai</w>, <w>airmnech</w> <w>dano</w> <w>in</w> <w>fer</w> <w>techas</w> <w>arbur</w> <w>nimdai</w> 7rl. <w>Síc</w> <w>airgtech</w>, <w>coilcthech</w>. \n', NULL, 'fol. 79vc', 'marc');
