INSERT INTO `reading` VALUES(16355, 'Milgetan', 11, 48, 'La.48', '162.19-21', '', '\n<w type="hw" lemma="milgetan">Milgetan</w> .i. <w>Mol</w>-<w>chuiten</w> .i. <w>cuit</w> <w>Muil</w> <w>dorsada</w> <w>Temrach</w>. <w>Mol</w> <w>didiu</w> a <w>ainm</w> <w>side</w>, <w>deg</w> <w>in</w> <w>muil</w> <w>noferad</w> <w>forna</w> <w>dúinib</w> .i. <w>tait</w> <w>ass</w>, <w>tait</w> <w>ind</w>. <w>inde</w> <w>dicitur</w> <w>molach</w>. \n', NULL, 'fol. 80ra', 'milgetan');
INSERT INTO `reading` VALUES(16356, 'Melgg', 11, 49, 'La.49', '162.22a', ' .i. ás', '\n<w type="hw" lemma="melg 1">Melgg</w> <w>as</w>, <w>arindi</w> <w>mblegair</w>. <w>Melgg</w> <w>dano</w> .i. <w>bás</w>, <w>unde</w> <w>melg</w>-<w>tene</w> .i. <w>tene</w> <w>mbáis</w>. \n', NULL, 'fol. 80ra', 'melg 1');
INSERT INTO `reading` VALUES(16358, 'Morann', 11, 51, 'La.51', '162.24-9', '', '\n<w type="hw" lemma="Morann">Morann</w> .i. <w>morḟind</w>. <w>bahed</w> <w>insin</w> a <w>hainm</w> <w>dobert</w> a <w>mathair</w> <w>dó</w>, ⁊ <w>asbert</w> <w>robad</w> <w>bibdu</w> <w>báis</w> <w>nach</w> <w>eberad</w> <w>fris</w>. <w>Moc</w> <w>múin</w> <w>immorro</w> <w>issed</w> <w>ainm</w> <w>dobert</w> a <w>athar</w> <w>do</w> .i. <w>ba</w> <w>muin</w> <w>maith</w> <w>in</w> <w>mac</w>. ⁊ <w>ba</w> <w>bidbu</w> <w>báis</w> <w>nach</w> <w>eperad</w> <w>fris</w> <w>in</w> <w>ainm</w> <w>sin</w>. <w>Rolellatar</w> <w>iarum</w> a <w>dá</w> <w>nainm</w> <w>in</w> <w>fer</w> <w>in</w> <w>dún</w> <w>oenanma</w>. <w>Mac</w> <w>som</w> <w>Choirpri</w> <w>Chind</w> <w>chaitt</w> <w>immorro</w>.\n', NULL, 'fol. 80ra', 'Morann');
