INSERT INTO `reading` VALUES(16371, 'Mann', 11, 64, 'La.64', '164.12-17', '', '\n<w type="hw" lemma="mann 1">Mann</w> .i. <w>unge</w> .i. <w>unde</w> <w>Sencha</w> <w>dixit</w>, <w>Mó</w> <w>ailib</w> <w>imdergad</w> <w>Emnæ</w>. <w>Admiudur</w> <w>de</w> <w>secht</w> <w>cactu</w> <w>cichsite</w> <w>crisu</w>. <w>Secbt</w> <w>mugu</w> <w>moigfite</w> <w>morgnimu</w> <w>mugsaine</w>. <w>Secht</w> <w>manna</w> <w>óir</w> <w>forloiscthi</w> <w>frifialgnúis</w> <w>cona</w> <w>chaurathaib</w> <w>Conchobuir</w>. \n', NULL, 'fol. 80rb', 'mann 1');
INSERT INTO `reading` VALUES(16372, 'Munnu', 11, 65, 'La.65', '164.18-23', '', '\n<w type="hw" lemma="Munnu">Munnu</w> .i. <w>mó</w> <w>finnu</w> .i. <w>ainm</w> <w>buide</w> <w>Fintain</w> <w>enim</w> <w>dictus</w> <w>est</w> .i. <w>unde</w> <w>Moedóc</w> <w>Ferna</w> <w>dixit</w> <w>occ</w> <w>áir</w> <w>Munnu</w> <w>maic</w> <w>Tulchain</w>, A <w>chelén</w> <w>Dé</w> <w>chumachtaig</w>, a <w>maic</w> <w>Tulchein</w>, a bachlaich! <w>ruc</w> <w>mac</w> n-<w>annsae</w> <w>dia</w> <w>muintir</w>, <w>mathair</w> <w>rothuc</w>, a ḟintain! \n', NULL, 'fol. 80rb', 'Munnu');
