INSERT INTO `reading` VALUES(16994, 'Artt', 9, 26, 'Y.26', '26', NULL, '\r\n<w type="hw" lemma="ard 1">Artt</w> <w>trede</w> <w>fordingair</w> .i. <w>art</w> <w>uasal</w>, <w xml:lang="lat">unde</w> <w xml:lang="lat">dicitur</w> <w>art</w> <w>fine</w>. <w>art</w> .i. <w>dia</w>, <w xml:lang="lat">unde</w> <w xml:lang="lat">dicitur</w> <w>Eochaid</w> <w>Find</w> <w>Fuath</w> n-<w>Airt</w> .i. <w>fuath</w> <w>dea</w> <w>fair</w> <w>ar</w> a <w>chaime</w>. <w xml:lang="lat">Item</w> <w>Cuculainn</w> <w xml:lang="lat">post</w> <w xml:lang="lat">mortem</w> <w xml:lang="lat">dicire</w> <w xml:lang="lat">perhibetur</w> <w>domemaid</w> <w>Art</w> <w>uasal</w> .i. <w>dia</w> <w>uasal</w>. <w>art</w> <w>dono</w> <w>cloch</w> <w>no</w> <w>leac</w> <w>ligen</w>, <w xml:lang="lat">cuius</w> <w xml:lang="lat">diminutiuum</w> <w>artene</w> .i. <w>cloichene</w> .i. <w>ainm</w> <w>disbecad</w>, <w xml:lang="lat">unde</w> <w>Guaire</w> <w>Aidne</w> <w xml:lang="lat">dixit</w> <w>docealat</w> <w>mor</w> n-<w>amra</w> <w>ind</w> <w>airtene</w> <w>biti</w> <w>for</w> <w>lige</w> <w>Marcain</w> <w>maic</w> <w>Aedha</w> <w>maic</w> <w>Maircene</w>.\r\n', NULL, 'col. 4', 'ard 1');
INSERT INTO `reading` VALUES(16997, 'Arg', 9, 27, 'Y.27', '27', NULL, '\r\n<w type="hw" lemma="arg 1">Arg</w> <w>treidi</w> <w>fordingair</w>, <w>arcc</w> <w>baindea</w> <w xml:lang="lat">unde</w> <w xml:lang="lat">dicitur</w> <w>roarc</w> .i. <w>robannae</w> .i. <w>snige</w> <w>mor</w> <w>do</w> <w>flecchad</w>. <w>arg</w> <w>dano</w> .i. <w>laech</w>, <w xml:lang="lat">unde</w> <w xml:lang="lat">dicitur</w> <w>Argdae</w> .i. <w>laechdae</w>, <w xml:lang="lat">cuius</w> <w xml:lang="lat">uxor</w> <w>Arggen</w> .i. <w>gein</w> <w>in</w> <w>airg</w> <w>in</w> <w>laic</w> .i. <w>is</w> <w>gen</w> <w>don</w> <w>arg</w>, .i. <w>don</w> <w>laoch</w>, a <w>buith</w> <w>oca</w> ⁊ <w>is</w> <w>maith</w> <w>do</w>. <w>no</w> <w>arg</w>-<w>guin</w>, <w>arg</w> <w>laoch</w> ⁊ <w>cuiniu</w> <w>ben</w>. <w>arg</w> <w>dano</w> <w>urdairc</w>, <w xml:lang="lat">unde</w> <w xml:lang="lat">dicitur</w> <w>airchetal</w> .i. <w>argg</w>-<w>cetul</w> .i. <w>cetul</w> <w>urdairc</w> <w>ar</w> a <w>menci</w> <w>concanur</w>. <w>IS</w> <w>aire</w> <w>didu</w> <w>ni</w> <w>cetal</w> <w>loech</w> <w>asberar</w> <w>de</w>, <w>ar</w> <w>ni</w> <w>da</w> <w>laoch</w> <cb n="col. 5"/> <w>nama</w> <w>donither</w> <w>aircetal</w>.\r\n', NULL, 'col. 4', 'arg 1');
INSERT INTO `reading` VALUES(17000, 'Ab', 9, 28, 'Y.28', '28', '', '\r\n<w type="hw" lemma="ap 1">Ab</w> .i. <w xml:lang="lat">ab</w> <w xml:lang="lat">eo</w> <w xml:lang="lat">quod</w> <w xml:lang="lat">est</w> <w xml:lang="lat">abas.</w> ł <w xml:lang="lat">a</w> <w xml:lang="lat">nomine</w> <w xml:lang="lat">ebraeico</w> <w xml:lang="lat">quod</w> <w xml:lang="lat">est</w> <w xml:lang="lat">aba</w> .i. <w xml:lang="lat">pater</w>.\r\n', NULL, 'col. 5', 'ap 1');
