INSERT INTO `reading` VALUES(17004, 'Amrat', 9, 32, 'Y.32', '32', '', '\r\n<w type="hw" lemma="amrath 2">Amrat</w> .i. <w>nemrath</w> .i. <w>ni</w> <w>tabarr</w> <w>rat</w> <w>dar</w> a <w>eisi</w>, <w>uair</w> <w>is</w> <w>iar</w> <w>mbas</w> <w>duine</w> <w>dogniter</w>. <w xml:lang="lat">aliter</w> <w>bit</w> <w>amos</w> .i. <w>an</w> <w>am</w> <w>didiu</w>, <w>is</w> <w>ondi</w> <w>is</w> <w>amos</w> <w>ata</w>. <w>amrat</w> <w>didiu</w> <w>éc</w>-<w>rat</w> .i. <w>rat</w> <w>iar</w> n-<w>egaib</w> <w>dober</w> <w>munter</w> <w>inti</w> <w>dia</w> <w>ndentar</w>. <w xml:lang="lat">Sed</w> <w xml:lang="lat">uius</w> <w xml:lang="lat">postremo</w> <w xml:lang="lat">non</w> <w xml:lang="lat">tam</w> <w xml:lang="lat">laudo</w> .i. <w>ni</w> <w>is</w> <w>firindige</w> ⁊ <w>ni</w> <w>moluim</w> <w>in</w> <w>dedenac</w>.\r\n', NULL, 'col. 5', 'amrath 2');
INSERT INTO `reading` VALUES(17005, 'Aod', 9, 33, 'Y.33', '33', '', '\r\n<w type="hw" lemma="áed">Aod</w> .i. <w>tene</w>. <w>Is</w> <w>imaircide</w> <w>son</w> <w>cid</w> <w>tria</w> <w>delidin</w> <w>inn</w> <w>anma</w> <w>is</w> <w>aod</w> .i. <w>dea</w> .i. <w>bandéa</w>, <w xml:lang="lat">ipsa</w> <w xml:lang="lat">est</w> <w xml:lang="lat">Uesta</w> .i. <w>bandea</w> <w>tened</w>, <w xml:lang="lat">et</w> <w xml:lang="lat">quia</w> <w xml:lang="lat">Uestam</w> <w xml:lang="lat">illam</w> <w xml:lang="lat">deam</w> <w xml:lang="lat">esse</w> <w xml:lang="lat">ignis</w> <w xml:lang="lat">fabula</w> <w xml:lang="lat">fertur,</w> <w xml:lang="lat">Uesta</w> <w xml:lang="lat">ipsa</w> <w xml:lang="lat">ignis</w> <w xml:lang="lat">dicitur</w> .i. <w>aod</w>.\r\n', NULL, 'col. 5', 'áed');
