INSERT INTO `reading` VALUES(17010, 'Audacht', 9, 38, 'Y.38', '38', '', '\r\n<w type="hw" lemma="aidacht">Audacht</w> .i. <w>uath</w> <w>fri</w> <w>feacht</w> .i. <w>antan</w> <w>tete</w> <w>in</w> <w>duine</w> <w>fri</w> <w>fecht</w> n-<w>uatha</w> .i. <w>bais</w>.\r\n', NULL, 'col. 6', 'aidacht');
INSERT INTO `reading` VALUES(17011, 'Anamain', 9, 39, 'Y.39', '39', '', '\r\n<w type="hw" lemma="anamain 1">Anamain</w> .i. <w>ainm</w> <w>aircetail</w> .i. <w>án</w> a <w>somaoin</w> <w>ar</w> <w>met</w> a <w>lóig</w> ⁊ a <w>graid</w>, <w>ar</w> <w>is</w> <w>dan</w> <w>olloman</w>, <w xml:lang="lat">unde</w> <w xml:lang="lat">dicitur</w> <w>inloing</w> <w>ollam</w> <w>anamain</w>.\r\n', NULL, 'col. 6', 'anamain 1');
INSERT INTO `reading` VALUES(17012, 'Anrud', 9, 40, 'Y.40', '40', '', '\r\n<w type="hw" lemma="ánrad">Anrud</w> <w xml:lang="lat">nomen</w> <w xml:lang="lat">secundi</w> <w xml:lang="lat">gradus</w> <w xml:lang="lat">poetarum</w> .i. <w>srut</w> <w>an</w> <w>in</w> <w>chainmolta</w> <w>uad</w> <w>ocus</w> <w>sruth</w> <w>ina</w> <w>mmoine</w> <w>chuige</w> <w>tar</w> a n-<w>eisi</w>.\r\n', NULL, 'col. 6', 'ánrad');
INSERT INTO `reading` VALUES(17013, 'Anair', 9, 41, 'Y.41', '41', '', '\r\n<w type="hw" lemma="anair 1">Anair</w> .i. <w>ainm</w> n-<w>airceatail</w>, <w>is</w> é <w>dan</w> <w>dogni</w> <w>cli</w>. <w>anair</w> <w>dano</w> <w>forreith</w> <w>in</w> <w>ree</w> <w>so</w> .i. <w>aon</w> a <w>hiar</w> .i. a n-<w>aentarmfortcend</w> a <w>forcend</w>, <w>ocus</w> <w>is</w> <w>debricht</w> a <w>deach</w>, ⁊ <w>is</w> {?} .i. <w>tarmfortcendnib</w> ⁊ <w>eitsechtaib</w> <w>deochraiges</w> <w>fria</w> <w>nath</w> <w>debrechta</w>. <w xml:lang="lat">ailiter</w> <w>anair</w> .i. <w>an</w>-<w>aor</w> .i. <w>ni</w> <w>haor</w>, <w>acht</w> <w>is</w> <w>molad</w>. <w>Cid</w> <w>samluidh</w> <w>seon</w> <w>didiu</w> <w>do</w> <w>cach</w> <w>comurg</w> <w>molta</w>, <w>is</w> <w>dilsiu</w> <w>don</w> <w>alt</w> <w>aircetail</w> .i. <w>asiu</w>, .i. <w>ar</w> <w>is</w> <w>fuirmed</w> <w>filed</w> <w>romidair</w> <w>ina</w> <w>hanmand</w> <w>sa</w> <w>dona</w> <w>aircetluib</w> <w>do</w> ṡluind <w>na</w> n-<w>ilaltæ</w> ⁊ <w>dia</w> <w>ndechrugad</w>, <w>ni</w> <w>haicned</w> <w>romidir</w> <w>leo</w>.\r\n', NULL, 'col. 6', 'anair 1');
INSERT INTO `reading` VALUES(17014, 'Anfobracht', 9, 42, 'Y.42', '42', '', '\r\n<w type="hw" lemma="anfobracht">Anfobracht</w> .i. <w xml:lang="lat">nomen</w> <w>do</w> <w>duine</w> ṡerggas ⁊ <w>timairges</w> <w>galar</w> <w>conna</w> <w>bi</w> <w>beol</w> <w>inna</w> <w>churp</w>. <w>bracht</w> <w xml:lang="lat">enim</w> <w>beoil</w> <w xml:lang="lat">uocatur</w>.\r\n', NULL, 'col. 6', 'anfobracht');
INSERT INTO `reading` VALUES(17015, 'Adart', 9, 43, 'Y.43', '43', '', '\r\n<w type="hw" lemma="adart">Adart</w> <w xml:lang="lat">quasi</w> <w>ad</w>-<w>irt</w> .i. <w>adæ</w> <w>mbais</w>, <w>ar</w> <w>is</w> <w>bas</w> <w>dorimther</w> <w>codlud</w> ⁊ <w>is</w> <w>ainm</w> <w>irt</w> <w>do</w> <w>bas</w>. <w>is</w> <w>ainm</w> <w>bass</w> <w>do</w> ṡuan. <w>IS</w> <w>adæ</w> <w>didiu</w> <w>telcud</w> <w>fri</w> <w>hadart</w> ⁊ <w>is</w> <w>arde</w> <w>codalta</w>, <w xml:lang="lat">unde</w> <w xml:lang="lat">dicitur</w> <w>descaid</w> <w>cotalta</w> <w>freslige</w>. <w xml:lang="lat">ailiter</w> <w>adart</w> .i. <w>ad</w>-<w>ard</w>, <w>ar</w> <w>is</w> <w>ardi</w> <w xml:lang="lat">quam</w> <w>in</w> <w>imda</w> <w>archenæ</w>.\r\n', NULL, 'col. 6', 'adart');
INSERT INTO `reading` VALUES(17016, 'Ara', 9, 44, 'Y.44', '44', '', '\r\n<w type="hw" lemma="ara 2">Ara</w> .i. <w>ar</w>-<w>áui</w> .i. <w>fria</w> o <w>anair</w>. <w>are</w> .i. <w>re</w> <w>uachtarach</w> <cb n="col. 7"/> <w>in</w> <w>duine</w>. á <w>cech</w> n-<w>ardd</w> ⁊ <w>bí</w> <w>cech</w> n-<w>isel</w>.\r\n', NULL, 'col. 6', 'ara 2');
INSERT INTO `reading` VALUES(17017, 'Aithle', 9, 45, 'Y.45', '45', '', '\r\n<w type="hw" lemma="aithle">Aithle</w> .i. <w>ath</w>-<w>ḟolæ</w> .i. <w>is</w> <w>mesæ</w> <w>eid</w> <w>indas</w> <w>fola</w>.\r\n', NULL, 'col. 7', 'aithle');
INSERT INTO `reading` VALUES(17018, 'Arathar', 9, 46, 'Y.46', '46', '', '\r\n<w type="hw" lemma="arathar">Arathar</w> .i. <w xml:lang="lat">ab</w> <w xml:lang="lat">aratró</w> .i. <w>on</w> <w>trebad</w>.\r\n', NULL, 'col. 7', 'arathar');
INSERT INTO `reading` VALUES(17019, 'Axail', 9, 47, 'Y.47', '47', '', '\r\n<w type="hw" lemma="axal">Axail</w> .i. <w xml:lang="lat">ab</w> <w xml:lang="lat">auxilium</w> <add>.i. <w>on</w> <w>comuirli</w> <w>dobeir</w>-<w>sium</w> <w>do</w> cach</add> <w xml:lang="lat">quod</w> <w xml:lang="lat">hominibus</w> <w xml:lang="lat">praebent</w> .i. <w>on</w> <w>ḟurtacht</w> <w>dobeir</w>-<w>sium</w> <w>do</w> <w>chach</w>.\r\n', NULL, 'col. 7', 'axal');
INSERT INTO `reading` VALUES(17020, 'Ana', 9, 48, 'Y.48', '48', '', '\r\n<w type="hw" lemma="án 3">Ana</w> a .i. <w>staba</w> <w>beaca</w> <w>bitis</w> <w>for</w> <w>tiprataib</w> <w>isnaib</w> <w>canaibh</w> <w>dluthib</w>. <w xml:lang="lat">inde</w> <w xml:lang="lat">dicitur</w> <w>daimid</w> <w>ana</w> <w>for</w> <w>lindib</w>. ⁊ <w>ba</w> <w>do</w> <w>argud</w> <w>batir</w> <w>mincib</w>, <w>ut</w> <w>Mocu</w> <w>Cerdda</w> <w xml:lang="lat">dixit</w> <w>for</w> <w>Cnuc</w> <w>Raffand</w>, <w>ind</w> <w>rath</w> <w>hi</w> <w>forsndan</w>-<w>fil</w> i <w>mbith</w> <w>tipran</w> <w>fo</w> <w>ain</w> <w>gil</w>, <w>ba</w> <w>bind</w> <w>gair</w> <w>caille</w> <w>lonche</w> <w>im</w> <w>raith</w> <w>Fiachach</w> <w>maic</w> <w>Monche</w>, .i. <w xml:lang="lat">mater</w> <w xml:lang="lat">illius</w>. <w>fri</w> <w>hol</w> <w>tra</w> <w>do</w> <w>dainib</w> <w>scithaib</w> <w>esib</w> <w>dobertis</w> <w>na</w> <w>lestair</w>-<w>si</w> <w>forsna</w> <w>tibradaib</w> ⁊ <w>ba</w> o <w>rigaib</w> <w>dobertis</w> <w>forra</w> <w>do</w> <w>promad</w> a <w>cana</w>.\r\n', NULL, 'col. 7', 'án 3');
INSERT INTO `reading` VALUES(17021, 'Anam', 9, 49, 'Y.49', '49', '', '\r\n<w type="hw" lemma="ainim(m)">Anam</w> <w xml:lang="lat">ab</w> <w xml:lang="lat">anima</w> <w xml:lang="lat">dicitur</w> .i. <w>ona</w> <w>suailchib</w>.\r\n', NULL, 'col. 7', 'ainim(m)');
INSERT INTO `reading` VALUES(17022, 'Athgabail', 9, 50, 'Y.50', '50', '', '\r\n<w type="hw" lemma="athgabáil">Athgabail</w> <w>arindi</w> <w>atgaib</w> <w>cach</w> a <w>less</w> <w>treithe</w>. <w xml:lang="lat">ailiter</w> <w>gabal</w>, <w>na</w> <w>teora</w> <w>ba</w> <w>toisecha</w> <w>rogab</w> <w>Assal</w> <w>ar</w> <w>Mug</w> <w>mac</w> <w>Nuadhat</w>. <w>athgabail</w> .i. <w>na</w> <w>sé</w> <w>ba</w> <w>arnamarach</w> ⁊ <w>rl</w>. <w xml:lang="lat">lega</w> i <w>Senchus</w> <w>Már</w>.\r\n', NULL, 'col. 7', 'athgabáil');
INSERT INTO `reading` VALUES(17023, 'Aithech', 9, 51, 'Y.51', '51', '', '\r\n<w type="hw" lemma="aithech 2">Aithech</w> .i. <w>aith</w> ⁊ <w>oech</w> .i. <w>nama</w> <w>aith</w>. <w>aitech</w> <w>didiu</w> .i. <w>nama</w> <w>aith</w> .i. <w>ni</w> <w>hainm</w> <w>acht</w> <w>do</w> <w>deglaoch</w>.\r\n', NULL, 'col. 7', 'aithech 2');
INSERT INTO `reading` VALUES(17024, 'Aithches', 9, 52, 'Y.52', '52', '', '\r\n<w type="hw" lemma="aithches 1">Aithches</w> <w xml:lang="lat">uxor</w> <w xml:lang="lat">eius,</w> <w xml:lang="lat">quomodo</w> <w>laiches</w> <w xml:lang="lat">a</w> <w xml:lang="lat">laico</w> .i. <w>on</w> <w>tuata</w>.\r\n', NULL, 'col. 7', 'aithches 1');
INSERT INTO `reading` VALUES(17025, 'Ao', 9, 53, 'Y.53', '53', '', '\r\n<w type="hw" lemma="ó 3">Ao</w> <w xml:lang="lat">quasi</w> <w>au</w> <w xml:lang="lat">ab</w> <w xml:lang="lat">aure</w> .i. <w>on</w> <w>cluais</w>.\r\n', NULL, 'col. 7', 'ó 3');
INSERT INTO `reading` VALUES(17026, 'Aunasc', 9, 54, 'Y.54', '54', '', '\r\n<w type="hw" lemma="ó 3 (compd)">Aunasc</w> .i. <w>nasc</w> <w>aue</w> .i. <w>ornasc</w> <w>nobid</w> <w>im</w> <w>cluasaib</w> <w>na</w> <w>saorchland</w>.\r\n', NULL, 'col. 7', 'ó 3 (compd)');
INSERT INTO `reading` VALUES(17027, 'Aigen', 9, 55, 'Y.55', '55', '', '\r\n<w type="hw" lemma="aigen 1">Aigen</w> .i. <w>ogḟæn</w>, <w>amail</w> <w>bid</w> <w>lethnuge</w>.\r\n', NULL, 'col. 7', 'aigen 1');
INSERT INTO `reading` VALUES(17028, 'Aitend', 9, 56, 'Y.56', '56', '', '\r\n<w type="hw" lemma="aittenn">Aitend</w> .i. <w>aith</w>-<w>tend</w>, <w>sech</w> <w>is</w> <w>aith</w> <w>is</w> <w>tend</w>. <w xml:lang="lat">unde</w> <w>Mac</w> <w>Samain</w> <w>no</w> <w>Maolodrain</w> <w xml:lang="lat">dixit</w> <w>Ni</w> <w>bu</w> <w>inmuin</w> <w>fid</w> <w>fuirme</w> <w>sancan</w> <w>asas</w> <w>im</w> <w>Thuirbe</w>, <w>adomchumben</w> a <w>dule</w>, <w>nimanaicc</w> a <w>fidrube</w>.\r\n', NULL, 'col. 7', 'aittenn');
INSERT INTO `reading` VALUES(17029, 'Aurdúine', 9, 57, 'Y.57', '57', '', '\r\n<w type="hw" lemma="airdún">Aurdúine</w> .i. <w>ar</w> <w>doirsib</w> <w>na</w> <w>ndoine</w> <w>fognith</w> <cb n="col. 8"/> <w>lasin</w> <w>áes</w> <w>cerd</w>.\r\n', NULL, 'col. 7', 'airdún');
INSERT INTO `reading` VALUES(17030, 'Airber', 9, 58, 'Y.58', '58', '', '\r\n<w type="hw" lemma="airber 1">Airber</w> .i. <w>frit</w> <w>anair</w> <w>bere</w> .i. <w>eter</w> <w>do</w> <w>di</w> <w>laim</w> <w>ar</w> <w>is</w> <w>fort</w> <w>muin</w> <w>bere</w> <w>ere</w> <w>aile</w>.\r\n', NULL, 'col. 8', 'airber 1');
INSERT INTO `reading` VALUES(17031, 'Air-', 9, 59, 'Y.59', '59', '', '\r\n<w type="hw" lemma="air-">Air-</w> <w>cech</w> n-<w>airther</w>, <w xml:lang="lat">ut</w> <w xml:lang="lat">est</w> <w>Air</w>-<w>muma</w>. <w>ir</w>- <w>immoro</w> <w>cech</w> <w>as</w> <w>síre</w> <w>uait</w>, <w xml:lang="lat">ut</w> <w xml:lang="lat">est</w> <w>Ir</w>-<w>mum</w> .i. <w>Muma</w> <w>is</w> <w>síre</w> <w>uait</w> <w>noch</w> <w>as</w> <w>siside</w> <w>as</w> <w>Iarmuma</w>. <w xml:lang="lat">ut</w> <w xml:lang="lat">dicitur</w> <w>Ara</w> <w>airther</w>, <w>ar</w> <w>atat</w> <w>na</w> <w>teora</w> <w>hAirne</w> <w>and</w>. <w>aro</w> <w>airthir</w> <w>as</w> <w>nesam</w> <w>do</w> <w>Eirind</w>, <w>Ara</w> <w>irthir</w> <w>immorro</w> <w>as</w> <w>nesam</w> <w>don</w> <w>ocian</w> .i. <w>is</w> <w>sirem</w> o <w>Erind</w> <w>siar</w>, <w>sech</w> <w>is</w> <w>iside</w> <w>ind</w> <w>Aro</w> <w>iarthair</w>.\r\n', NULL, 'col. 8', 'air-');
INSERT INTO `reading` VALUES(17032, 'Ane', 9, 60, 'Y.60', '60', '', '\r\n<w type="hw" lemma="Áine">Ane</w> <w xml:lang="lat">de</w> <w xml:lang="lat">nomine</w> <w>Ane</w> <w>ingine</w> <w>Eogabail</w>.\r\n', NULL, 'col. 8', 'Áine');
INSERT INTO `reading` VALUES(17033, 'Abbartu', 9, 61, 'Y.61', '61', '', '\r\n<w type="hw" lemma="apartu">Abbartu</w> .i. <w>sechtmad</w> <w>furirith</w> <w>in</w> <w>duine</w> <w>gaibther</w> <w>isin</w> <w>apartain</w>, <w>is</w> <w>si</w> a <w>epert</w> <w>techto</w>. <w>is</w> <w>ar</w> a <w>epert</w> <w>didiu</w> <w>nama</w> <w>dober</w> <w>in</w> <w>duine</w> <w>diaraile</w> <w>sin</w>, <w>ni</w> <w>ar</w> <w>airilliud</w> <w>chenae</w>, <w>acht</w> <w>epert</w> <w>dó</w> <w>fria</w> <w>cele</w>, <w>notgaibim</w> i n-<w>apartain</w>. <w>ar</w> <w>chobele</w> <w>didiu</w> <w>doberar</w>.\r\n', NULL, 'col. 8', 'apartu');
INSERT INTO `reading` VALUES(17034, 'Ailgess', 9, 62, 'Y.62', '62', '', '\r\n<w type="hw" lemma="áilges">Ailgess</w> <w>dano</w> .i. <w>geis</w> <w>guide</w>, ⁊ <w>is</w> <w>ar</w> <w>ail</w> <w>didiu</w> <w>namma</w> <w>doberar</w> <w>in</w> <w>gude</w> <w>sin</w>, <w>ni</w> <w>har</w> a <w>molad</w>. <w>sechtmad</w> <w>dano</w> <w>loge</w> <w>enig</w> <w>indi</w> <w>cosa</w> <w>connegar</w> <w>ind</w> <w>algess</w>, <w>is</w> i <w>ind</w> <w>ailgess</w> <w>techa</w>. \r\n', NULL, 'col. 8', 'áilges');
INSERT INTO `reading` VALUES(17035, 'Athabæ', 9, 63, 'Y.63', '63', '', '\r\n<w type="hw" lemma="athaba">Athabæ</w> <w xml:lang="lat">quasi</w> <w>bath</w> i. <w>bas</w>.\r\n', NULL, 'col. 8', 'athaba');
INSERT INTO `reading` VALUES(17036, 'Aiminn', 9, 64, 'Y.64', '64', '', '\r\n<w type="hw" lemma="oíbind">Aiminn</w> <w xml:lang="lat">ab</w> <w xml:lang="lat">eo</w> <w xml:lang="lat">quod</w> <w xml:lang="lat">est</w> <w xml:lang="lat">amoenum</w> .i. <w>aibind</w>.\r\n', NULL, 'col. 8', 'oíbind');
INSERT INTO `reading` VALUES(17037, 'Airchinnech', 9, 65, 'Y.65', '65', '', '\r\n<w type="hw" lemma="airchinnech">Airchinnech</w> .i. <w>archendach</w>, <w xml:lang="grc">arcos</w> <w xml:lang="lat">grecos</w> <w xml:lang="lat">excelsus</w> <w xml:lang="lat">latine</w>. <w>airchinnech</w> <w>er</w>-<w>cend</w>-<w>óg</w>, <w>uasal</w>-<w>cend</w>-<w>comlan</w>.\r\n', NULL, 'col. 8', 'airchinnech');
INSERT INTO `reading` VALUES(17038, 'Ambue', 9, 66, 'Y.66', '66', '', '\r\n<w type="hw" lemma="ambuae">Ambue</w> .i. <w>nembunadach</w>, <w>bue</w> .i. <w>bunadach</w>.\r\n', NULL, 'col. 8', 'ambuae');
INSERT INTO `reading` VALUES(17039, 'Adæ', 9, 67, 'Y.67', '67', '', '\r\n<w type="hw" lemma="ada(e)">Adæ</w> .i. <w>ad</w>-<w>dee</w> i. <w>dir</w> <w>do</w> <w>Dia</w>.\r\n', NULL, 'col. 8', 'ada(e)');
INSERT INTO `reading` VALUES(17040, 'Altan', 9, 68, 'Y.68', '68', '', '\r\n<w type="hw" lemma="altan">Altan</w> .i. <w>ail</w> <w>teind</w> <w>mad</w> <w>dia</w> <w>tecma</w>. \r\n', NULL, 'col. 8', 'altan');
INSERT INTO `reading` VALUES(17041, 'Adann', 9, 69, 'Y.69', '69', '', '\r\n<w type="hw" lemma="adann">Adann</w> .i. <w>aen</w>-<w>itharna</w>, <w>ut</w> <w>Colman</w> <w>rnac</w> <w>Leneni</w> <w xml:lang="lat">dixit</w> <w>Luin</w> <w>oc</w> <w>elaib</w>, <w>unga</w> <w>oc</w> <w>dirnaib</w>, <w>crotha</w> <w>banathech</w> <w>oc</w> <w>crothuib</w> <w>rignaib</w>, <w>rige</w> <w>oc</w> <w>Domnall</w>, <w>dord</w> <w>oc</w> <w>aidbsi</w>, <w>adann</w> <w>oc</w> <w>caindil</w>, <w>colg</w> <w>oc</w> <w>mo</w> <w>cailg</w>-<w>si</w>. <w xml:lang="lat">Item</w> <w>Itharna</w> <w>mad</w> <w>dia</w> <w>tecma</w> i <w>llithadba</w>, <w>ar</w> <w>Dia</w> <w>ni</w> <w>rod</w>-<w>luathadna</w> <cb n="col. 9"/> <w>al</w>-<w>luathlabra</w> <w>nubarba</w>.\r\n', NULL, 'col. 8', 'adann');
INSERT INTO `reading` VALUES(17042, 'A', 9, 70, 'Y.70', '70', '', '\r\n<w type="hw" lemma="á 1">A</w> .i. <w>fen</w> <w>no</w> <w>carr</w> <w>no</w> <w>carpat</w>, <w>ut</w> <w>Fer</w> <w>Muman</w> <w xml:lang="lat">a</w> <w xml:lang="lat">quibusdam</w> <w xml:lang="lat">audiuit</w> <w xml:lang="lat">in</w> <w xml:lang="lat">aquilonali</w> <w xml:lang="lat">parte</w> .i. <w>mar</w> <w>do</w> <w>cualaid</w> <w>Fer</w> <w>Muman</w> <w>don</w> <w>taoib</w> <w>tuaidh</w> <w>de</w> o <w>dainib</w> <w>truaga</w> a <w>coine</w> <w>IN</w> <w>essar</w> <w>dam</w> <w>do</w> a. <w>Tó</w> <w>mena</w> <w>má</w> <w>mo</w> á. <w>Ara</w> <w>taire</w> <w>mo</w> á <w>mo</w> <w>Mani</w> <w>má</w> <w>do</w> á, <w>tó</w>.\r\n', NULL, 'col. 9', 'á 1');
