INSERT INTO `reading` VALUES(17117, 'Boge', 9, 142, 'Y.142', '142', '', '\r\n<w type="hw" lemma="bóige">Boge</w> <w>dano</w> <w>ainm</w> <w>do</w> <w>ballan</w> <w>beg</w> i <w>mbitis</w> <w>coic</w> uṅgi <cb n="col. 14"/> <w>oir</w>, <w>sech</w> <w>nobid</w> <w>fri</w> <w>hol</w> <w>sainlenna</w> <w>as</w>. <w>nobid</w> <w>dano</w> <w>fri</w> <w>geall</w> d’filedaib ⁊ d’ollamnaib. <w xml:lang="lat">inde</w> <w xml:lang="lat">dicitur</w> <w>isna</w> <w>Brethaib</w> <w>Nemed</w> <w>ballun</w> <w>baissi</w> <w>boige</w> <w>coic</w> n-uṅga.\r\n', NULL, 'col. 13', 'bóige');
