INSERT INTO `reading` VALUES(17125, 'Brigit', 9, 150, 'Y.150', '150', '', '\r\n<w type="hw" lemma="Brigit">Brigit</w> .i. <w>banfile</w> <w>ingen</w> <w>ingen</w> .i. <w>in</w> <w>Dagdae</w>. <w>isi</w> <w>insin</w> <w>Brigit</w> <w>be</w> n-<w>exe</w> i. <w>bandea</w> <w>no</w> <w>adratis</w> <w>filid</w>, <w>ar</w> <w>ba</w> <w>romor</w> ⁊ <w>ba</w> <w>roán</w> a <w>frithgnam</w>. <w xml:lang="lat">ideo</w> <w xml:lang="lat">eum</w> <w xml:lang="lat">deum</w> <w xml:lang="lat">uocant</w> <w xml:lang="lat">poetarum,</w> <w xml:lang="lat">cuius</w> <w xml:lang="lat">sorores</w> <w xml:lang="lat">erant</w> <w>Brigit</w> <w>be</w> <w>legis</w> <cb n="col. 15"/> ⁊ <w>Brigit</w> <w>be</w> <w>Goibne</w> <w>ingena</w> <w>in</w> <w>Dagda</w>, <w xml:lang="lat">de</w> <w xml:lang="lat">quarum</w> <w xml:lang="lat">nominibus</w> <w xml:lang="lat">pene</w> <w xml:lang="lat">omnes</w> <w xml:lang="lat">Hibernenses</w> <w xml:lang="lat">dea</w> <w xml:lang="lat">Brigit</w> <w xml:lang="lat">uocabatur</w>.\r\n', NULL, 'col. 14', 'Brigit');
