INSERT INTO `reading` VALUES(17133, 'Bradan', 9, 158, 'YAdd.158', '158', '', '\r\n<w type="hw" lemma="bratán">Bradan</w> .i. <w>bir</w>-<w>fud</w>-<w>en</w> .i. <w>en</w> <w>bia</w> <w>ar</w> <w>fad</w> <w>in</w> <w>usci</w>, <w xml:lang="lat">quia</w> <w>fid</w> <w>bir</w> .i. <w>uisce</w>, <w xml:lang="lat">ut</w> <w xml:lang="lat">dicitur</w> <w>biror</w> ⁊ <w>inbir</w> ⁊ <w>tobur</w>.\r\n', 'YAdd', 'col. 15', 'bratán');
