INSERT INTO `reading` VALUES(17135, 'Brath', 9, 160, 'YAdd.160', '160', '', '\r\n<w type="hw" lemma="bráth">Brath</w> .i. <w>bruth</w> <w>ar</w> a thęs. <w>no</w> <w>bruud</w> <w>cech</w> <w>réta</w> <w>doní</w>. ł <w xml:lang="lat">e</w> <w xml:lang="lat">bratio</w> .i. <w>mind</w> <w>doberthe</w> <w>for</w> <w>cend</w> <w>miled</w> <w>iar</w> <w>mbuaid</w> <w>cosgair</w>, <w>sic</w> <w>brath</w> a <w>forba</w> <w>gnima</w> <w>no</w> <w>cosgair</w> <w>gach</w> <w>duine</w> <w>ticfa</w>. \r\n', 'YAdd', 'col. 15', 'bráth');
