INSERT INTO `reading` VALUES(17142, 'Ballan', 9, 167, 'YAdd.167', '167', '', '\r\n<w type="hw" lemma="ballán">Ballan</w> .i. <w>bill</w>-<w>ian</w> .i. <w>lestar</w> <w>ḟir</w> <w>truaig</w>. <w xml:lang="lat">aliter</w>, <w>ballan</w> .i. <w xml:lang="grc">balloinis</w> <w>isin</w> <w>greic</w>, <w xml:lang="lat">glandis</w> <w>isin</w> <w>latin</w> .i. <w>dircu</w>. <w>ballan</w> <w>didiu</w> .i. <w>fuath</w> <w>dercon</w> <w>biss</w> <w>fair</w>. <w xml:lang="lat">aliter</w>, <w>bell</w>-<w>ian</w> .i. <w>beil</w> <w>mele</w>, <w xml:lang="lat">ut</w> <w xml:lang="lat">dicitur</w> a ł <w>beill</w> <w>dogní</w> <w>in</w> <w>fer</w> <w>sa</w>, .i. a ł <w>troich</w>. <w>ballan</w> <w>didiu</w> <w>ian</w> <w>duine</w> <w>beill</w> .i. <w>duine</w> <w>troigh</w>.\r\n', 'YAdd', 'col. 15', 'ballán');
