INSERT INTO `reading` VALUES(17179, 'Corbmac', 9, 204, 'Y.204', '204', '', '\r\n<w type="hw" lemma="Cormac">Corbmac</w> .i. <w>corb</w> .i. <w>carpat</w>. <w>Cormbmac</w> <w>didiu</w> <w>mac</w> <w>carpait</w>. <w>for</w> <w>Cormbac</w> <w>Gelta</w> <w>Gaoth</w> <w>de</w> <w>Laignib</w> <w>toisiuch</w> <w>tucad</w>, <w>ar</w> <w>is</w> a <w>carpat</w> <w>rogenair</w>. <w>IS</w> <w>he</w> <w>didiu</w> <w>ordagraiffe</w> <w>coir</w> <w>in</w> <w>anma</w> <w>sa</w> .i. <w>coraib</w> .b. <w>isin</w> <w>dialt</w> <w>toisech</w> <w xml:lang="lat">non</w> <w>Cormac</w> <w xml:lang="lat">sine</w> .b.\r\n', NULL, 'col. 17', 'Cormac');
