INSERT INTO `reading` VALUES(17181, 'Cathal', 9, 206, 'Y.206', '206', '', '\r\n<w type="hw" lemma="Cathal">Cathal</w> <w xml:lang="lat">nomen</w> <w xml:lang="lat">britones</w> .i. <w>combrec</w> <w>in</w> <w>sin</w> .i. <w xml:lang="cym">Catell</w>. <w>cat</w> <w>didiu</w> <w>isin</w> <w>chombreic</w> <w>is</w> <w>cath</w> <w xml:lang="lat">in</w> <w xml:lang="lat">scotica</w>. a n-<w>ell</w> <w>is</w> <w>ail</w>. <w>Catal</w> <w>didiu</w> <w>ail</w> <w>catha</w> <w>in</w> <w>sein</w>.\r\n', NULL, 'col. 17', 'Cathal');
