INSERT INTO `reading` VALUES(17185, 'Clithar set', 9, 209, 'Y.209', '209', '', '\r\n<w type="hw" lemma="clithar">Clithar set</w>. <w xml:lang="lat">alii</w> <w xml:lang="lat">dicunt</w> <w>co</w> <w>mbad</w> <w>ainm</w> <w>do</w> <w>boin</w> <w>in</w> <w>laig</w> .i. <w>arindi</w> <w>doceil</w> a <w>lloeg</w> n-<w>inde</w>. <add><w xml:lang="lat">quod</w> <w xml:lang="lat">non</w> <w xml:lang="lat">est</w> <w xml:lang="lat">uerum,</w> <w xml:lang="lat">sed</w> <w xml:lang="lat">uerius</w></add> <w>cletar</w> <w>set</w> .i. <w>ri</w>-<w>set</w>, <w>ar</w> <w>is</w> <w>ainm</w> <w>do</w> <w>rig</w> <w>isin</w> <w>Duil</w> <w>Feda</w> <w>Mair</w> <w>clithar</w>, ⁊ <w>is</w> <w>edad</w> <w>nutreit</w>. <w>set</w> <w>gabla</w> ⁊ <w>dano</w> <w>as</w> é <w>as</w> <w>laigheam</w> <w>and</w> .i. <w>dartait</w> <w>firend</w> ⁊ <w>colpac</w> <w>bonend</w>, <w>no</w> <w>colpdac</w> <w>firend</w> ⁊ <w>dartaid</w> <w>boinend</w>. <w>samuisc</w> <w>in</w> <w>sed</w> <w>tanaisi</w>. <w>lulgach</w> <w>no</w> <w>dam</w> <w>timchill</w> <w>aratair</w> <w>in</w> <w>tess</w> <w>set</w>, ⁊ <w>is</w> e <w>sin</w> <w>in</w> <w>set</w>, ⁊ <w>is</w> é <w>cruth</w> <w>asrenaigther</w> i <w>mBrath</w> <w>Cai</w>, <w>cach</w> <w>tris</w> <w>set</w> <w>sét</w> <w>gabla</w>, <w>samaisc</w> <w>alaili</w>, <w>lulgach</w> <w>no</w> <w>dam</w> <w>timchill</w> <w>arathair</w> <w>araile</w>. <w>impud</w> <w>foraib</w> <w>beus</w> <w>co</w> <w>rría</w> <w>cend</w> <w>ria</w> <w>herci</w>, ⁊ <w>it</w> <w>he</w> <w>sin</w> <w>na</w> <w>seoit</w> <w>acobair</w> <w>itbeir</w> a <w>cain</w> <w>Patraic</w>, <w>ar</w> <w>it</w> <w>lethe</w> <w>unge</w> a <w>seoit</w> <w>ade</w>.\r\n', NULL, 'col. 17', 'clithar');
INSERT INTO `reading` VALUES(17186, 'Cercend', 9, 210, 'Y.210', '210', '', '\r\n<w type="hw" lemma="cercend">Cercend</w> .i. <w>cuairt</w> <w>aimsire</w> .i. <w xml:lang="lat">a</w> <w xml:lang="lat">circinos</w>, <w>on</w> <w>gabalrind</w>.\r\n', NULL, 'col. 17', 'cercend');
INSERT INTO `reading` VALUES(17187, 'Cruimther', 9, 211, 'Y.211', '211', '', '\r\n<w type="hw" lemma="cruimther">Cruimther</w> .i. <w>goidelg</w> <w>indi</w> <w>as</w> <w xml:lang="lat">prespiter</w>. <w xml:lang="cym">premther</w> <w>didiu</w> a <w>combrec</w> <w>sidie</w>. <w>prem</w> <w>iaram</w> <w>isin</w> <w>chombreic</w> <w>is</w> <w>cruim</w> <w>isi</w> <w>gaidilg</w>. <w>ni</w> <w>tintud</w> <w>coir</w> <w>dondi</w> <w>as</w> <w>prespiter</w> <w>anni</w> <w>andi</w> <w>is</w> <w>cruimther</w>. <w>is</w> <w>tintud</w> <w>coir</w> <w>dondi</w> <w>as</w> <w>premter</w> <w>indní</w> <w>as</w> <w>cruimther</w>. <w>in</w> <w>Bretain</w> <w>didiu</w> <w>robadar</w> i <w>comaitecht</w> <w>Patric</w> <cb n="col. 18"/> <w>occon</w> <w>procept</w>, <w>it</w> e <w>dorintaiset</w> ⁊ <w>is</w> <w>anni</w> <w>ani</w> <w>is</w> <w>premter</w> <w>dorintaiset</w>. <w>is</w> <w>fair</w> <w>iarom</w> <w>roluset</w> <w>legnidhe</w> <w>na</w> <w>mBretan</w> <w>anni</w> <w>sin</w> <w>amail</w> <w>is</w> <w>lomm</w> <w>in</w> <w>cruim</w> ⁊ <w>rl</w>., <w xml:lang="lat">sic</w> <w xml:lang="lat">debet</w> <w xml:lang="lat">prespeterum</w> .i. <w>bas</w> <w>lomm</w> o <w>phecad</w> ⁊ <w>bas</w> <w>iminocht</w> ó <w>domhan</w> ⁊ <w>rl</w>. <w xml:lang="lat">secundum</w> <w xml:lang="lat">qui</w> <w xml:lang="lat">dixit</w> <w xml:lang="lat">ego</w> <w xml:lang="lat">sum</w> <w xml:lang="lat">uermis</w> <w xml:lang="lat">et</w> <w xml:lang="lat">non</w> <w xml:lang="lat">homo</w> .i. <w>ataim</w>-<w>si</w> <w>conad</w> <w>cruim</w> <w>me</w> ⁊ <w>nach</w> <w>duine</w>.\r\n', NULL, 'col. 17', 'cruimther');
INSERT INTO `reading` VALUES(17188, 'Cloch', 9, 213, 'Y.213', '213', '', '\r\n<w type="hw" lemma="cloch">Cloch</w>, <w>tri</w> <w>anmann</w> <w>lé</w> .i. <w>onn</w> a <w>iarmberla</w>, <w>cloch</w> a <w>gnathberla</w>, <w>cloech</w> a <w>berla</w> n-<w>airberta</w> <w>ar</w> <w>inni</w> <w>chloes</w> <w>cach</w> <w>raod</w>. \r\n', NULL, 'col. 18', 'cloch');
