INSERT INTO `reading` VALUES(17298, 'Coire Brecain', 9, 324, 'Y.323', '323', '', '\r\n<w type="hw" lemma="Coire Brecain">Coire Brecain</w> .i. <w>saobhcoire</w> <w>mor</w> <w>fuil</w> <w>eter</w> <w>Erind</w> ⁊ <w>Albain</w> a <w>leth</w> <w>fothuaid</w> .i. <w>comruc</w> <w>na</w> n-<w>ilmuire</w>, <w>in</w> <w>muir</w> <w>timcell</w> <w>nErenn</w> <w>aníarthair</w> ⁊ <w>in</w> <w>muir</w> <w>timcell</w> <w>nAlban</w> <w>anairtuaidh</w> ⁊ a <w>mmuir</w> <w>andeass</w> <w>eter</w> <w>Eirinn</w> ⁊ <w>Albain</w>. <w>foscerd</w> <w>iarom</w> <w>imonsech</w> <w>fo</w> <w>cossmailess</w> <w>luathrinde</w> ⁊ <w>docuiredar</w> <w>cach</w> <w>ai</w> i <w>tuaim</w> <w>alaile</w> <w>amail</w> <w>orceil</w> <w>tairechtae</w> ⁊ <w>suigthe</w> <w>sis</w> i <w>fudomhoin</w> <w>co</w> <w>mbi</w> a <w>coire</w> <w>obele</w> <w>nosuigfedh</w> <w>cid</w> <w>Erind</w>, <w>focherad</w> <w>ind</w> <w>for</w> <w>aonchoi</w>. <w>sceid</w> <w xml:lang="lat">iterum</w> <w>in</w> <w>loimm</w> <w>sin</w> <w>suas</w> ⁊ <w>rocluinter</w> a <w>torandbrucht</w> ⁊ a <w>breisimnech</w> ⁊ a <w>esgal</w> <w>iter</w> <w>nellaib</w> <w>fo</w> <w>cosmuiless</w> <w>ngaluigedar</w> <w>coire</w> <w>mbis</w> <w>for</w> t<ex>h</ex>ein. <w>Brecan</w> <w>didiu</w> <w>cendaige</w> <w>án</w> <w>do</w> <w>hUibb</w> <w>Neill</w>, <w>coica</w> <w>curach</w> <w>do</w> <w>ac</w> <w>cendach</w> <w>iter</w> <w>Eireind</w> ⁊ <w>Albain</w>. <w>dochuiredar</w> <w>iaram</w> <w>forsain</w> <w>choire</w> niṡin, ⁊ <w>rotasluigit</w> <w>uile</w> <w>imale</w> ⁊ <w>ni</w> <w>terna</w> <w>cidh</w> <w>sciula</w> <w>orcne</w> <w>as</w>. <w>Brecan</w> <w>didiu</w> <w>mac</w> <w>Maine</w> <w>maic</w> <w>Neill</w>, <w>adeir</w> <w>libair</w> n-<w>aill</w> <w>doragad</w> <w>andsin</w> <w>coeca</w> <w>curach</w> <w>ag</w> <w>comcendach</w> <w>iter</w> <w>Eirind</w> <w>is</w> <w>Albain</w> <w>co</w> <w>rothuitset</w> a n-<w>ainfecht</w> <w>isin</w> <w>choire</w> <w>sin</w>, <w>co</w> <w>na</w> <w>terno</w> <w>cid</w> <w>sceola</w> <w>oircne</w> <w>as</w> ⁊ <w>ni</w> <w>fes</w> a n-<w>oidhid</w> <w>co</w> <w>rainic</w> <w>Lugaid</w> <w>dalleices</w> <w>co</w> <w>Bennchur</w>. <w>dochuaid</w> <w>didiu</w> a <w>muinnter</w> <w>ide</w> a <w>tracht</w> <w>Inbir</w> <w>Bice</w>, <w>co</w> <w>fuarutar</w> <w>clogond</w> <w>lom</w> <w>bric</w> n-<w>and</w> ⁊ <w>dobertadur</w> <w>leo</w> <w>co</w> <w>Lugaid</w>. <w xml:lang="lat">interrogauerunt</w> <w xml:lang="lat">eam,</w> <w xml:lang="lat">cuius</w> <w xml:lang="lat">esset</w> <w xml:lang="lat">et</w> <w xml:lang="lat">ille</w> <w xml:lang="lat">eis</w> <w xml:lang="lat">dixit</w> .i. <w>rofiarfaigetar</w> <cb n="col. 25"/> a <w>muinter</w> <w>cia</w> <w>he</w> ⁊ <w>adubairt</w> <w>friu</w> <w>tabraid</w> <w>cend</w> <w>na</w> <w>fleisci</w> <w>led</w> <w>fair</w>. <w>doronad</w> <w>son</w> <w>dano</w> <w>et</w> <w xml:lang="lat">dixit</w> <w>Lugaid</w> <w>dobais</w> <w>do</w> <w>trethan</w> <w>ardatmba</w> <w>Brecan</w> <w>usce</w> <w>no</w> <w>chaire</w>. <w>cend</w> <w>orci</w> <w>Brecain</w> <w>ind</w> <w>so</w>, ⁊ <w>is</w> bęc <w>do</w> <w>mor</w> <w>indso</w>, <w>or</w> <w>se</w>, <w>ar</w> <w>robaideadh</w> <w>Brecan</w> <w>cona</w> <w>muinntir</w> <w>uile</w> <w>isin</w> <w>coire</w> n-<w>ucat</w>.\r\n', NULL, 'col. 24', 'Coire Brecain');
INSERT INTO `reading` VALUES(17299, 'Cumal', 9, 325, 'Y.324', '324', '', '\r\n<w type="hw" lemma="cumal 1">Cumal</w> .i. <w>cum</w> <w>mola</w> .i. <w>ben</w> <w>bis</w> <w>fri</w> <w>bleith</w> <w>mbron</w>, <w>ar</w> <w>is</w> e <w>mod</w> <w>frisa</w> <w>mbitis</w> <w>cumala</w> <w>doera</w> <w>rinisiu</w> <w>dorontais</w> <w>muilind</w>.\r\n', NULL, 'col. 25', 'cumal 1');
INSERT INTO `reading` VALUES(17300, 'Crępscuil', 9, 326, 'Y.325', '325', '', '\r\n<w type="hw" lemma="crepuscul">Crępscuil</w> .i. <w>crepscuil</w>, <w xml:lang="lat">ab</w> <w xml:lang="lat">eo</w> <w xml:lang="lat">quod</w> <w xml:lang="lat">est</w> <w xml:lang="lat">crepusculum,</w> <w xml:lang="lat">id</w> <w xml:lang="lat">est</w> <w xml:lang="lat">dubia</w> <w xml:lang="lat">lux</w> .i. <w xml:lang="lat">nomen</w> <w>do</w> <w>espartain</w>, <w xml:lang="lat">ut</w> <w xml:lang="lat">dixit</w> <w>Colman</w> <w>mac</w> <w>Lenene</w> <w>rop</w> <w>tanaisi</w> <w>triuin</w> crępscuil <w>cerd</w> <w>promtha</w> <w>Petair</w> <w>apstail</w>.\r\n', NULL, 'col. 25', 'crepuscul');
INSERT INTO `reading` VALUES(17301, 'Cotud', 9, 327, 'Y.326', '326', '', '\r\n<w type="hw" lemma="cotut">Cotud</w> .i. <w>cech</w> <w>secda</w>, <w xml:lang="lat">ab</w> <w xml:lang="lat">eo</w> <w xml:lang="lat">quod</w> <w xml:lang="lat">est</w> <w xml:lang="lat">cotis</w> .i. <w>líe</w> .i. <w>airnem</w> <w>frisa</w> <w>melaiter</w> <w>erna</w>.\r\n', NULL, 'col. 25', 'cotut');
INSERT INTO `reading` VALUES(17302, 'Cuisil', 9, 328, 'Y.327', '327', '', '\r\n<w type="hw" lemma="cuisil">Cuisil</w> .i. <w>combrecc</w> <w>in</w> <w>sin</w> ⁊ <w>is</w> <w>latin</w> <w>rotruailned</w> i <w>suidiu</w>, <w xml:lang="lat">quasi</w> <w>consil</w> <w xml:lang="lat">ab</w> <w xml:lang="lat">eo</w> <w xml:lang="lat">quod</w> <w xml:lang="lat">est</w> <w xml:lang="lat">consilium</w>. <w xml:lang="lat">inde</w> <w xml:lang="lat">dicitur</w> <w>is</w> <w>as</w> <w>do</w> <w>chuisil</w> <w>doronad</w>.\r\n', NULL, 'col. 25', 'cuisil');
INSERT INTO `reading` VALUES(17303, 'Cuaille', 9, 329, 'YAdd.328', '328', '', '\r\n<w type="hw" lemma="cúaille">Cuaille</w> .i. <w>de</w> <w>an</w> <w>cual</w>, <w>no</w> <w>caoile</w> <w xml:lang="lat">quam</w> <w xml:lang="lat">alia</w>.\r\n', 'YAdd', 'col. 25', 'cúaille');
INSERT INTO `reading` VALUES(17304, 'Cumtuch', 9, 330, 'YAdd.329', '329', '', '\r\n<w type="hw" lemma="cumtach">Cumtuch</w> .i. <w>cum</w> <w>thoga</w> <w>bis</w> .i. <w>co</w> <w>lend</w>.\r\n', 'YAdd', 'col. 25', 'cumtach');
INSERT INTO `reading` VALUES(17305, 'Comos', 9, 331, 'YAdd.330', '330', '', '\r\n<w type="hw" lemma="commus">Comos</w> .i. <w xml:lang="lat">compos</w> .i. <w xml:lang="lat">potense</w> <w>no</w> <w>commes</w> <w>leis</w> <w>for</w> <w>cach</w>, <w>no</w> <w>commesrugud</w> <w>coda</w> <w>doib</w>.\r\n', 'YAdd', 'col. 25', 'commus');
INSERT INTO `reading` VALUES(17306, 'Cuirrech', 9, 332, 'YAdd.331', '331', '', '\r\n<w type="hw" lemma="cuirrech">Cuirrech</w> <w>immorro</w> <w>do</w> <w>rad</w> <w>fri</w> <w>seiscend</w> .i. <w>corra</w> <w>recait</w> <w>ind</w>.\r\n', 'YAdd', 'col. 25', 'cuirrech');
INSERT INTO `reading` VALUES(17307, 'Cuirrech', 9, 333, 'YAdd.332', '332', '', '\r\n<w type="hw" lemma="cuirrech">Cuirrech</w> <w xml:lang="lat">a</w> <w xml:lang="lat">cursa</w> .i. <w>reid</w> <w>he</w>.\r\n', 'YAdd', 'col. 25', 'cuirrech');
INSERT INTO `reading` VALUES(17308, 'Cuing', 9, 334, 'YAdd.333', '333', '', '\r\n<w type="hw" lemma="cuing">Cuing</w> .i. <w>on</w> <w>congbail</w> <w>dobir</w> <w>for</w> <w>na</w> <w>damhaib</w>.\r\n', 'YAdd', 'col. 25', 'cuing');
INSERT INTO `reading` VALUES(17309, 'Cadan', 9, 335, 'YAdd.334', '334', '', '\r\n<w type="hw" lemma="cadan">Cadan</w> .i. <w>cae</w> a <w>dun</w> <w>no</w> a <w>inad</w> .i. <w>adbai</w>, <w xml:lang="lat">quia</w> <w xml:lang="lat">non</w> <w xml:lang="lat">apud</w> <w xml:lang="lat">nos</w> <w xml:lang="lat">semper</w> <w xml:lang="lat">manet</w>. <w>no</w> <w>caid</w> a <w>faind</w> .i. a <w>cluim</w>.\r\n', 'YAdd', 'col. 25', 'cadan');
INSERT INTO `reading` VALUES(17310, 'Cendais', 9, 336, 'YAdd.335', '335', '', '\r\n<w type="hw" lemma="cennais">Cendais</w> .i. <w>fosaid</w> <w>on</w> <w>cind</w> é.\r\n', 'YAdd', 'col. 25', 'cennais');
INSERT INTO `reading` VALUES(17311, 'Corrthair', 9, 337, 'YAdd.336', '336', '', '\r\n<w type="hw" lemma="cor(r)thar">Corrthair</w> .i. <w>cuirther</w> <w>fri</w> <w>hedach</w> i, <w>no</w> <w>coraigter</w>, <w>no</w> <w>co</w> <w>hor</w> .i. <w>co</w> <w>himel</w> <w>as</w> <w>dir</w> a <w>breith</w> ⁊ <w>cor</w>-<w>dir</w> <w>innsin</w> a <w>taithmeach</w>.\r\n', 'YAdd', 'col. 25', 'cor(r)thar');
INSERT INTO `reading` VALUES(17312, 'Carr', 9, 338, 'YAdd.337', '337', '', '\r\n<w type="hw" lemma="carr 1">Carr</w> .i. <w>carn</w> <w>donither</w> <w>fair</w>, ⁊ <w>dichned</w> <w>derid</w> <w>fuil</w> <w>ann</w>.\r\n', 'YAdd', 'col. 25', 'carr 1');
INSERT INTO `reading` VALUES(17313, 'Cuithe', 9, 339, 'YAdd.338', '338', NULL, '\r\n<w type="hw" lemma="cuithe">Cuithe</w> .i. <w>cua</w> ⁊ <w>te</w>, <w xml:lang="lat">ut</w> <w xml:lang="lat">dicitur</w> <w>cuad</w> <w>coi</w>-<w>fid</w> .i. <w>fid</w> <w>cua</w> <w>co</w> <w>cae</w> <w>fas</w> <w>and</w>. <cb n="col. 26"/>\r\n', 'YAdd', 'col. 25', 'cuithe');
INSERT INTO `reading` VALUES(17314, 'Caill', 9, 340, 'YAdd.339', '339', '', '\r\n<w type="hw" lemma="caill 1">Caill</w> <w xml:lang="lat">a</w> <w xml:lang="lat">caille</w> i.e. <w xml:lang="lat">semita</w> <w xml:lang="lat">terrarum</w>.\r\n', 'YAdd', 'col. 26', 'caill 1');
INSERT INTO `reading` VALUES(17315, 'Cruach', 9, 341, 'YAdd.340', '340', '?', '\r\n<w type="hw" lemma="crúach 1">Cruach</w> .i. <w>coir</w> a <w>uach</w> .i. a <w>uactar</w>, ⁊ <w>is</w> <w>ed</w> <w>cid</w> a <w>ichtar</w>. <w>no</w> <w>coir</w> <w>fuaigter</w> í. <w>no</w> <w>carac</w> <w>ar</w> a <w>tabair</w> <w>do</w> <w>crrnaib</w> <w>cuiccthe</w>.\r\n', 'YAdd', 'col. 26', 'crúach 1');
INSERT INTO `reading` VALUES(17316, 'Colcaid', 9, 342, 'YAdd.341', '341', '', '\r\n<w type="hw" lemma="colcaid">Colcaid</w> i. <w>cail</w>-<w>caid</w> .i. <w>coimed</w> <w>cadusa</w> i, <w>ar</w> <w>is</w> <w>la</w> <w>huaislib</w> <w>bis</w>. \r\n', 'YAdd', 'col. 26', 'colcaid');
INSERT INTO `reading` VALUES(17317, 'Cluim', 9, 343, 'YAdd.342', '342', '', '\r\n<w type="hw" lemma="clúm">Cluim</w> .i. <w>caol</w>-<w>seim</w> .i. <w>ceile</w> <w>in</w> <w>sroin</w> <w>ima</w> <w>mbi</w>.\r\n', 'YAdd', 'col. 26', 'clúm');
INSERT INTO `reading` VALUES(17318, 'Caolan', 9, 344, 'YAdd.343', '343', '', '\r\n<w type="hw" lemma="cáelán">Caolan</w> .i. <w>aon</w> <w>is</w> <w>caile</w> <w>isin</w> <w>curp</w> e.\r\n', 'YAdd', 'col. 26', 'cáelán');
INSERT INTO `reading` VALUES(17319, 'Cual', 9, 345, 'YAdd.344', '344', '', '\r\n<w type="hw" lemma="cúal">Cual</w> .i. <w>ona</w> <w>cuaillib</w> <w>bis</w> <w>inte</w> <w>asberur</w>. ł <w xml:lang="lat">quasi</w> <w>gual</w> .i. <w>on</w> <w>gualuind</w>, <w>ar</w> <w>is</w> <w>fuirre</w> <w>bis</w> a <w>truma</w>. ł <w xml:lang="lat">quasi</w> <w>caol</w> <w xml:lang="lat">a</w> <w xml:lang="lat">calon</w> <w xml:lang="lat">latine</w>. \r\n', 'YAdd', 'col. 26', 'cúal');
INSERT INTO `reading` VALUES(17320, 'Contracht', 9, 346, 'YAdd.345', '345', '', '\r\n<w type="hw" lemma="contracht">Contracht</w> .i. <w xml:lang="lat">a</w> <w xml:lang="lat">contractio</w> .i. <w>com</w>-<w>droch</w> .i. <w>malam</w> .i. <w>comolc</w>.\r\n', 'YAdd', 'col. 26', 'contracht');
INSERT INTO `reading` VALUES(17321, 'Cogad', 9, 347, 'YAdd.346', '346', '', '\r\n<w type="hw" lemma="cocad">Cogad</w> .i. <w>com</w>-<w>cat</w>.\r\n', 'YAdd', 'col. 26', 'cocad');
INSERT INTO `reading` VALUES(17322, 'Cullach', 9, 348, 'YAdd.347', '347', '', '\r\n<w type="hw" lemma="cullach">Cullach</w> .i. <w>colach</w> .i. <w>ar</w> <w>met</w> a <w>chuil</w> .i. <w>bi</w> <w>la</w> <w>mathair</w> ⁊ <w>la</w> <w>siair</w>.\r\n', 'YAdd', 'col. 26', 'cullach');
INSERT INTO `reading` VALUES(17323, 'Cnu', 9, 349, 'YAdd.348', '348', '', '\r\n<w type="hw" lemma="cnú">Cnu</w> .i. <w>cainiu</w> .i. <w>millsi</w> <w>oldati</w> <w>na</w> <w>toraid</w> <w>aile</w>.\r\n', 'YAdd', 'col. 26', 'cnú');
INSERT INTO `reading` VALUES(17324, 'Col', 9, 350, 'YAdd.349', '349', '', '\r\n<w type="hw" lemma="col">Col</w> <w xml:lang="lat">a</w> <w xml:lang="lat">nomine</w> <w xml:lang="lat">caligo</w>.\r\n', 'YAdd', 'col. 26', 'col');
INSERT INTO `reading` VALUES(17325, 'Crinda', 9, 351, 'YAdd.350', '350', '', '\r\n<w type="hw" lemma="crínna">Crinda</w> <w xml:lang="lat">a</w> <w xml:lang="lat">nomine</w> <w xml:lang="lat">greco</w> <w xml:lang="lat">a</w> <w xml:lang="grc">crimenono</w> .i. <w xml:lang="lat">iudice</w>.\r\n', 'YAdd', 'col. 26', 'crínna');
