INSERT INTO `reading` VALUES(17328, 'Cuad', 9, 354, 'YAdd.353', '353', '', '\r\n<w type="hw" lemma="cúad">Cuad</w> <w xml:lang="lat">a</w> <w xml:lang="grc">cuas</w> i.e. <w xml:lang="lat">uacus</w>\r\n', 'YAdd', 'col. 26', 'cúad');
INSERT INTO `reading` VALUES(17329, 'Calpda', 9, 355, 'YAdd.354', '354', '', '\r\n<w type="hw" lemma="colpthae">Calpda</w> .i. <w xml:lang="grc">cal-poda</w> i.e. <w xml:lang="lat">bonus</w> <w xml:lang="lat">pes</w> ł <w xml:lang="lat">pedess</w>. \r\n', 'YAdd', 'col. 26', 'colpthae');
