INSERT INTO `reading` VALUES(17333, 'Comad', 9, 359, 'YAdd.358', '358', '', '\r\n<w type="hw" lemma="commaid">Comad</w> <w xml:lang="lat">a</w> <w xml:lang="lat">uerbo</w> <w xml:lang="lat">comedo</w>.\r\n', 'YAdd', 'col. 26', 'commaid');
