INSERT INTO `reading` VALUES(17401, 'Dobur', 9, 425, 'Y.424', '424', '', '\r\n<w type="hw" lemma="dobur 1">Dobur</w> <w>dede</w> <w>fordingair</w>. <w>dobur</w> <w>cetamus</w> <w>usci</w>, <w xml:lang="lat">unde</w> <w xml:lang="lat">dicitur</w> <w>dobarcú</w> .i. <w>cú</w> <w>uisci</w>. <w>dobar</w> <w>dana</w> <w>cach</w> <w>ndorche</w> .i. <w>cech</w> <w>inglan</w> .i. <w>do</w> <w>fo</w> <w>diultad</w> ⁊ <w>púr</w> <w>onní</w> <w>is</w> <w xml:lang="lat">púrus</w> <w>glan</w>. <w>dobur</w> <w>didiu</w> .i. <w>di</w>-<w>phur</w> .i. <w>ingle</w>.\r\n', NULL, 'col. 29', 'dobur 1');
