INSERT INTO `reading` VALUES(17422, 'Duar-fine', 9, 446, 'Y.445', '445', '', '\r\n<w type="hw" lemma="dúar (cmpd)">Duar-fine</w> <w>didiu</w> <w>ainm</w> d’filethaib .i. <w>fine</w> <w>duar</w> .i. <w>fine</w> <w>foccul</w>. <w>duairfine</w> .i. <w>fine</w> <w>bis</w> <w>fri</w> <w>horangud</w> <w>foccal</w>. <w>duar</w> <w>didiu</w> <w>is</w> <w>ainm</w> <w>do</w> <w>rann</w>, <w xml:lang="lat">ut</w> <w xml:lang="lat">est</w> <w>cia</w> <w>duar</w> <w>donesa</w> <w>nath</w> .i. <w>rann</w> <w>is</w> <w>airegda</w> <w>don</w> <w>molad</w> <w>no</w> <w>is</w> <w>airderdæ</w>.\r\n', NULL, 'col. 30', 'dúar (cmpd)');
INSERT INTO `reading` VALUES(17423, 'Diancecht', 9, 447, 'Y.446', '446', '', '\r\n<w type="hw" lemma="Díancécht">Diancecht</w> .i. <w>ainm</w> <w>do</w> ṡuid <w>leigis</w> <w>Erend</w> .i. <w>dia</w> <w>na</w> <w>cecht</w> .i. <w>na</w> <w>cumachta</w>. <w>Dian</w>-<w>cecht</w> .i. <w>cecht</w> <cb n="col. 31"/> <w>cumachta</w>, <w xml:lang="lat">unde</w> <w xml:lang="lat">dicitur</w> <w>Neide</w> <w>mac</w> <w>Adnæ</w> <w>cechtsam</w> <w>dercca</w> <w>aithscnemaim</w> <w>ailcne</w> .i. <w>cumachtaigsium</w>. <w>ailcne</w> .i. <w>scellec</w> <w>becc</w> <w>romebhaid</w> <w>don</w> <w>ailig</w> <w>condabi</w> <w>friaa</w> <w>suil</w>-<w>sium</w>, <w>condi</w> <w>coech</w>. <w>imrubairt</w> a <w>chumachta</w> <w>foir</w>. <w xml:lang="lat">non</w> <w xml:lang="lat">ut</w> <w xml:lang="lat">imperiti</w> <w xml:lang="lat">dicunt</w> <w>cechtsom</w> .i. <w>cæchsam</w> ⁊ <w>rl</w>.\r\n', NULL, 'col. 30', 'Díancécht');
INSERT INTO `reading` VALUES(17424, 'Deach', 9, 448, 'Y.447', '447', '', '\r\n<w type="hw" lemma="deach">Deach</w> <w>de</w>-<w>fuach</w> .i. <w>de</w>-<w>focul</w>. <w>fuach</w> .i. <w>focul</w>. <w>comrac</w> <w>didiu</w> <w>diailt</w> <w>fri</w> <w>dialt</w>. <w>is</w> e <w>deach</w> <w>is</w> <w>laigem</w> <w>ar</w> <w>ci</w> <w>asberthar</w> <w>deach</w> <w>din</w> <w>dialt</w> <w>ni</w> <w>hairisa</w> <w>on</w>, <w>acht</w> <w>is</w> <w>aire</w> <w>ismberar</w> <w>deach</w> <w>de</w>, <w>fobithin</w> <w>is</w> <w>fotha</w> <w>ndeich</w>. ⁊ <w>is</w> <w>ass</w> <w>forberat</w> <w>co</w> <w>forcend</w> <w>mbrechta</w> i <w>mbiat</w> <w>ocht</w> <w>ndiailt</w>, <w>amail</w> <w>asberar</w> <w>lasin</w> <w>laitneoir</w> <w xml:lang="lat">unus</w> <w xml:lang="lat">non</w> <w xml:lang="lat">est</w> <w xml:lang="lat">numerus,</w> <w xml:lang="lat">sed</w> <w xml:lang="lat">ab</w> <w xml:lang="lat">eo</w> <w xml:lang="lat">crescunt</w> <w xml:lang="lat">numeri</w> .i. <w>ni</w> <w>numir</w> a <w>haon</w>, <w>acht</w> <w>is</w> <w>uadh</w> <w>ḟasait</w> <w>na</w> <w>numrecha</w>. <w>ocht</w> <w>ndeich</w> <w>tra</w> <w>atrimet</w> <w>filidh</w> <w>na</w> <w>Góidilce</w>, ⁊ <w>is</w> <w>cosin</w> <w>ndialt</w> <w>son</w> .i. <w>arinni</w> <w>nat</w> <w>fil</w> <w>alt</w> <w>and</w> ⁊ <w>nad</w> <w>rornaiter</w>. <w>recomarc</w> <w>in</w> <w>deach</w> <w>tanaisi</w> .i. <w>re</w>-<w>chomrugad</w> <w>fri</w> <w>araill</w> <w>no</w> <w>re</w> <w>do</w> <w>comrug</w> <w>frie</w> n-<w>aill</w> .i. <w>dialt</w> <w>fri</w> <w>dialt</w>, <w xml:lang="lat">ut</w> <w xml:lang="lat">est</w> <w>Corbmac</w>. <w>iarcomarc</w> .i. <w>ainm</w> <w>in</w> <w>tress</w> <w>deich</w> .i. <w>iar</w>-<w>comrucugud</w> <w>iarsin</w> <w>comruc</w> <w>toisech</w>, <w>ut</w> <w>Corbmacan</w>. <w>files</w> .i. <w>ainm</w> <w>an</w> <w>cethrama</w> <w>deich</w> .i. <w>arindi</w> <w>filles</w> .i. <w>ce</w> <w>doberthar</w> a <w>cethair</w> <w>immon</w> <w>crand</w> <w>anuas</w>, <w>no</w> <w>im</w>