w xml:lang="lat">ut</w> <w xml:lang="lat">est</w> <w>fianamailecharadard</w>. <w>bricht</w> <w>arindi</w> <w>brightar</w>, <w>ocht</w> <w>sillaba</w> <w>ann</w>, <w>ar</w> <w>is</w> <w>de</w> <w>gniter</w> <w>nath</w>. <w>is</w> e <w>deach</w> <w>is</w> <w>airegdamh</w> <w>dib</w> <w>indi</w> o n-<w>ellagar</w> <w>nath</w>, <w>ar</w> <w>ni</w> <w>hellaing</w> <w>nad</w> <w>ellaing</w> <w>nath</w>. <w>ocht</w> n-<w>aisli</w> <w>didiu</w> <w>fil</w> o <w>inn</w> <w>in</w> <w>meoir</w> <w>co</w> n-<w>athgabail</w> <w>maothain</w> <w>na</w> <w>himdæ</w>. <w>ocht</w> <w>ndialt</w> <w>dano</w> <w>fil</w> i <w>mbricht</w>, <w xml:lang="lat">ut</w> <w xml:lang="lat">est</w> <w>fianamailecharadardæ</w>.\r\n', NULL, 'col. 31', 'deach');
