INSERT INTO `reading` VALUES(17477, 'Deach', 9, 501, 'YAdd.500', '500', '', '\r\n<w type="hw" lemma="deach">Deach</w> .i. <w>de</w>-<w>fuach</w> .i. <w>comrnu</w> <w>da</w> <w>sillab</w> <w>conristar</w> <w>and</w>, <w>conad</w> <w>deach</w> <w>ainm</w> <w>gach</w> <w>sillaibe</w> <w>iarsin</w>.\r\n', 'YAdd', 'col. 34', 'deach');
INSERT INTO `reading` VALUES(17478, 'Duis', 9, 502, 'YAdd.501', '501', '', '\r\n<w type="hw" lemma="dúis">Duis</w> .i. <w xml:lang="grc">dusma</w> <w xml:lang="lat">grece,</w> <w xml:lang="lat">mirabilis</w> <w xml:lang="lat">latine</w>.\r\n', 'YAdd', 'col. 34', 'dúis');
INSERT INTO `reading` VALUES(17479, 'Eamuin', 9, 503, 'Y.502', '502', '', '\r\n<w type="hw" lemma="Emain">Eamuin</w> .i. <w>eo</w>-<w>main</w> .i. <w>eo</w> <w>rind</w> .i. <w>muin</w> <w>braighe</w> <w>no</w> <w>muinel</w>. <w>Emain</w> <w>didiu</w> <w>rind</w> <add>.i. delg</add> <w>dar</w> <w>muin</w>, <w>ar</w> <w>is</w> <w>amlaid</w> <w>torrimter</w> <w>toraind</w> <w>in</w> <w>lis</w> <w>don</w> <w>mnái</w>. o <w>robai</w> <w>ina</w> <w>suidhe</w> <w>oc</w> <w>ascaid</w> a <w>bruit</w> <w>doben</w> a <w>dealg</w> <w>asa</w> <w>brat</w>, <w>dosroraind</w> <w>impe</w> <w>imacuairt</w> <w>cona</w> <w>deilg</w>. <w>sia</w> <w>iarom</w> <w>rosiacht</w> a <w>dealg</w> <w>naithe</w> <w>sair</w> a <w>belaib</w> <w>oldas</w> <w>dar</w> a <w>hais</w> <w>siar</w>. <w>is</w> <w>aire</w> <w>is</w> <w>cloen</w> <w>ind</w> <w>less</w>. <w>no</w> <w>em</w> <w xml:lang="lat">ab</w> <w xml:lang="lat">ema</w> i.e. <w xml:lang="lat">sanguine,</w> <w xml:lang="lat">quia</w> <w xml:lang="lat">ema</w> <w xml:lang="lat">sanguiness</w>, <w>uin</w> i.e. <w xml:lang="lat">unus,</w> <w xml:lang="lat">quia</w> <w xml:lang="lat">sanguis</w> <w xml:lang="lat">unius</w> <w xml:lang="lat">ho<ex>min</ex>is</w> <w xml:lang="lat">in</w> <w xml:lang="lat">tempore</w> <w xml:lang="lat">conditionis</w> <w xml:lang="lat">eius</w>.\r\n', NULL, 'col. 34', 'Emain');
INSERT INTO `reading` VALUES(17480, 'Emon', 9, 504, 'Y.503', '503', '', '\r\n<w type="hw" lemma="emon 1">Emon</w> .i. é <w>dano</w> <w>fo</w> <w>diultad</w>. <w>emon</w> <w>iarom</w> é-<w>áen</w> .i. <w>ni</w> <w>oen</w> <w>acht</w> <w>is</w> <w>da</w> <w>lelab</w> <w>geiniter</w> <w>and</w>, <w>ocus</w> <w>rosuidigset</w> <w>iarom</w> <w>ind</w> <w>filid</w> <w>muin</w> <w>ar</w> <w>medon</w> <w>and</w> <w>do</w> <w>imgabail</w> <w>meanaigthe</w> <add place="infralinear">r</add>, <w>ar</w> <w>rob</w> <w>alle</w> <w>leo</w> <w>emoen</w> <w>no</w> <w>emon</w> <w>oldas</w> <w>éoen</w>. <w xml:lang="lat">aliter</w>, <w>emon</w> .i. é ⁊ <w>mon</w>. a <w>mmon</w> <w>didiu</w> <w>is</w> <w>dindí</w> <w>is</w> <w xml:lang="grc">monus</w> <w>isin</w> <w>greic</w>. a <w xml:lang="grc">monos</w> <w>is</w> <w xml:lang="lat">unus</w> <w>isin</w> <w>latin</w>. <cb n="col. 35"/> <w>emon</w> <w>dono</w> <w xml:lang="lat">non</w> <w xml:lang="lat">unus</w> <w xml:lang="lat">sed</w> <w xml:lang="lat">duo</w> .i. <w>ni</w> <w>hoen</w>-<w>ni</w>, <w>acht</w> <w>da</w> ni\r\n', NULL, 'col. 34', 'emon 1');
INSERT INTO `reading` VALUES(17481, 'Ecmacht', 9, 505, 'Y.504', '504', '', '\r\n<w type="hw" lemma="écmacht">Ecmacht</w> .i. <w>ecumachta</w> .i. é- <w>fo</w> <w>diultad</w> .i. <w>ni</w> <w>fuil</w> <w>cumachta</w>.\r\n', NULL, 'col. 35', 'écmacht');
