INSERT INTO `reading` VALUES(17491, 'Esem', 9, 515, 'Y.514', '514', '', '\r\n<w type="hw" lemma="es(s)em">Esem</w> .i. <w>ess</w> .i. <w>dam</w> ⁊ <w>saim</w> <w>corait</w>. <w>is</w> <w>corait</w> <w>iarom</w> <w>int</w> <w>essem</w> <w>oc</w> <w>tuidmiu</w> <w>na</w> <w>cuingiu</w> <w>dona</w> <w>damaib</w>.\r\n', NULL, 'col. 35', 'es(s)em');
