INSERT INTO `reading` VALUES(17495, 'Edam', 9, 519, 'Y.518', '518', '', '\r\n<w type="hw" lemma="edam">Edam</w> .i. <w>airbirt</w> <w>bith</w> .i. <w>edo</w>. <w>edom</w> <w>didiu</w> <w>dind</w> <w>airbirt</w> <w>bith</w> ⁊ <w>din</w> <w>menbugud</w> <w>menbaigthe</w> <w>cach</w> <w>tuara</w> <w>chathes</w> <w>duine</w>. <w>ni</w> <w>egam</w> <w xml:lang="lat">ut</w> <w xml:lang="lat">imperiti</w> <w xml:lang="lat">dicunt</w>.\r\n', NULL, 'col. 35', 'edam');
