INSERT INTO `reading` VALUES(17510, 'Enechruice', 9, 533, 'Y.532', '532', '', '\r\n<w type="hw" lemma="enechrucce">Enechruice</w> .i. <w>enech</w>-<w>rú</w>-<w>cian</w> .i. <w>cian</w> o <w>inchaib</w> <w>adchither</w> a <w>rú</w> .i. a <w>imdergad</w>, <w>amail</w> <w>rongab</w> <w>mac</w> <w>do</w> <w>mathar</w>, <w>mac</w> <w>do</w> <w>sethar</w>, <w>cele</w> <w>fæsme</w>, <w>cele</w> <w>taistil</w>. <w>ni</w> <w>nad</w> <w>bitái</w> <w>dilis</w>, <w>sechtmad</w> <w>loge</w> <w>enig</w> <w>caich</w> <w>iarna</w> <w>míadh</w>, <w>is</w> <w>ed</w> <w>bis</w> <w>de</w>.\r\n', NULL, 'col. 36', 'enechrucce');
