INSERT INTO `reading` VALUES(17552, 'Emon', 9, 575, 'YAdd.574', '574', '', '\r\n<w type="hw" lemma="emon 1">Emon</w> <w xml:lang="lat">ab</w> <w xml:lang="lat">ema</w> ⁊ <w xml:lang="lat">uno</w>. <w>emon</w> <w>didiu</w> <w xml:lang="lat">unius</w> <w xml:lang="lat">sanguinis</w>. ł <w xml:lang="grc">emon</w> <w xml:lang="lat">grece</w> <w xml:lang="lat">nostris</w> <w xml:lang="lat">interpretatur</w> <w xml:lang="lat">non</w> <w xml:lang="lat">unus</w>. ł emon<w xml:lang="grc"> ema</w> <w xml:lang="lat">grece</w> <w xml:lang="lat">iuga</w> <w xml:lang="lat">manum</w>, <w>ar</w> <w>is</w> <w>dis</w> <w>doib</w> a <w>cuingg</w>. <w>emon</w> <w>airchidal</w>, <w>ar</w> <w>it</w> <w>cosmaili</w> a <w>ndi</w> <w>lethcomarc</w>, <w xml:lang="lat">unde</w> <w>anemuin</w> <w xml:lang="lat">dicitur</w> .i. <w>ni</w> <w>hemuin</w> <w>acht</w> <w>is</w> cethairre<add>a</add>ch.\r\n', 'YAdd', 'col. 38', 'emon 1');
INSERT INTO `reading` VALUES(17554, 'Flaith', 9, 576, 'Y.575', '575', '', '\r\n<w type="hw" lemma="flaith 1">Flaith</w> .i. <w>fo</w>-<w>laith</w>. <w>laith</w> .i. <w>cuirm</w>. <w>bith</w> <w>dano</w> <w>laith</w> .i. <w>ass</w>, <w xml:lang="lat">ut</w> <w xml:lang="lat">est</w> <w>isin</w> tṡenchus <w>Mar</w> <w>laith</w> <w>finn</w> <w>for</w> <w>telraig</w> .i. <w>ass</w> <w>na</w> <w>mbó</w> <w>for</w> <w>talmain</w>.\r\n', NULL, 'col. 38', 'flaith 1');
INSERT INTO `reading` VALUES(17555, 'Fine', 9, 577, 'Y.576', '576', '', '\r\n<w type="hw" lemma="fíne">Fine</w> .i. <w>on</w> <w>finemuin</w>, <w xml:lang="lat">ab</w> <w xml:lang="lat">eo</w> <w xml:lang="lat">quod</w> <w xml:lang="lat">est</w> <w xml:lang="lat">uinia</w>, <w>ar</w> <w>is</w> <w>gnath</w> <w>ind</w> ú <w>consain</w> <w>lasin</w> <w>laitneóir</w> <w>is</w> <w>fern</w> frisindle<add>astar</add> <w>lasin</w> <w>nGaoidel</w>. <w xml:lang="lat">ut</w> <w xml:lang="lat">est</w> <w>uir</w> .i. <w>fer</w>, <w>uita</w> .i. <w>fit</w>, <w>uirtus</w> .i. <w>firt</w>, <w xml:lang="lat">quamuis</w> <w xml:lang="lat">hoc</w> <w xml:lang="lat">non</w> <w xml:lang="lat">per</w> <w xml:lang="lat">singula</w> <w xml:lang="lat">currat</w>.\r\n', NULL, 'col. 38', 'fíne');
