INSERT INTO `reading` VALUES(17563, 'Ferb', 9, 585, 'Y.584', '584', '', '\r\n<w type="hw" lemma="ferb(b) 1">Ferb</w> <w>dano</w> <w>treide</w> fordiṅgair. <w>ferb</w> i <w>bó</w> <w>cetamus</w>, <w xml:lang="lat">ut</w> <w xml:lang="lat">est</w> <w>isin</w> <w>tSenchus</w> <w>Mar</w> <w>teora</w> <w>ferbba</w> <add>.i. finna</add>. <w>ferb</w> .i. <w>bolg</w> <w>docuirethar</w> <w>in</w> <w>duine</w> <w>for</w> a <w>gruadaibh</w> <w>iar</w> n-<w>áir</w> <w>no</w> <w>iar</w> <w>ngúbreith</w> <w>gel</w> <w>fir</w> <w>ferba</w> <w>nad</w> <w>forbrethar</w> <cb n="col. 39"/> <w>fer</w> <w>iarnninchaib</w>. <w>fearb</w> <w>dano</w> <w>briathar</w>, <w xml:lang="lat">ut</w> <w xml:lang="lat">est</w> <w>rofes</w> <w>is</w> <w>fass</w> <w>feinechas</w> i <w>coinnilg</w> <w>ferb</w> <w>nDe</w>. \r\n', NULL, 'col. 38', 'ferb(b) 1');
INSERT INTO `reading` VALUES(17566, 'Fir', 9, 586, 'Y.585', '585', '', '\r\n<w type="hw" lemma="fír 1">Fir</w> .i. <w>find</w>, <w xml:lang="lat">ut</w> <w xml:lang="lat">est</w> <w>Fachtna</w> <w>mac</w> <w>Sencha</w> <w>fortomidiur</w> <w>tri</w> <w>dirna</w> <w>do</w> <w>argat</w> <w>arræ</w> <w>ar</w> <w>teoræ</w> <w>ferbai</w> <w>firæ</w> <w>fon</w> <w>oen</w> n-<w>erc</w> n-<w>ecuscc</w> <w>iter</w> <w>laithi</w> <w>Lugba</w> <w>lí</w> <w>sulai</w> <w>sochar</w>. <w>ba</w> <w>hed</w> <w>didiu</w> <w>ecosc</w> <w>na</w> n-<w>erc</w> <w>nIuchnæ</w> <w>Echdi</w> <w>Echbeoil</w> a <w>hAlpin</w> <w>dodoacht</w> <w>Curi</w> <w>for</w> <w>Ultaib</w> .i. <w>bae</w> <w>findæ</w> <w>aúdergæ</w>. <w>doticdis</w> <w>didiu</w> <w>na</w> <w>bai</w> <w>sin</w> <w>Echdi</w> <w>Echbeil</w> <w>for</w> <w>ingeilt</w> a <w>hAird</w> <w>Echdai</w> <w>Echbeil</w> a <w>hAlbsi</w> a <w>crich</w> <w>Dal</w> <w>Riattoi</w> <w>co</w> <w>mbitis</w> i <w>Semniu</w> <w>Ulad</w>. <w>toroxal</w> <w>iarom</w> <w>Cori</w> <w>ar</w> <w>Ultaib</w> ⁊ <w>rl</w>.\r\n', NULL, 'col. 39', 'fír 1');
INSERT INTO `reading` VALUES(17567, 'Firend', 9, 587, 'Y.586', '586', '', '\r\n<w type="hw" lemma="ferenn">Firend</w> .i. <w>id</w> <w>bis</w> <w>im</w> <w>colpa</w> <w>niad</w> <w xml:lang="lat">in</w> <w xml:lang="lat">cuius</w> <w xml:lang="lat">uicem</w> <w>crechtirid</w> <w>id</w> <w>crechdha</w> <w>im</w> <w>colpa</w> <w>fer</w>. <w>amail</w> <w>nobit</w> <w>indili</w> <w>comadais</w> <w>caich</w> <w>is</w> <w>di</w> <w>didiu</w> <w>dognitis</w> <w>na</w> <w>ferniu</w>. <w xml:lang="lat">uerbi</w> <w xml:lang="lat">gracia</w> <w>ferind</w> <w>oir</w> <w>im</w> <w>cois</w> <w>rig</w>. <w>ferend</w> <w>ainm</w> <w>do</w> <w>chriss</w> <w>bis</w> <w>im</w> <w>duine</w>, <w xml:lang="lat">ut</w> <w xml:lang="lat">dicitur</w> <w>tacmaic</w> <w>snechta</w> <w>ferna</w> <w>fer</w>.\r\n', NULL, 'col. 39', 'ferenn');
INSERT INTO `reading` VALUES(17568, 'Fochloc', 9, 588, 'Y.587', '587', '', '\r\n<w type="hw" lemma="fochloc">Fochloc</w> <w xml:lang="lat">nomen</w> <w>graid</w> <w>filed</w>. <w>ar</w> a <w>cosmailius</w> <w>fri</w> <w>cois</w> <w>fochlacain</w> <w>asberr</w> .i. <w>da</w> <w>duillinn</w> <w>fair</w> <w>in</w> <w>cedbliadhain</w>. <w>dís</w> <w>dano</w> <w>damh</w> <w>fochlacáin</w> <w>for</w> <w>tuaith</w>.\r\n', NULL, 'col. 39', 'fochloc');
