INSERT INTO `reading` VALUES(17571, 'Foilmen', 9, 591, 'Y.590', '590', '', '\r\n<w type="hw" lemma="foilmen">Foilmen</w> .i. <w xml:lang="lat">nomen</w> <w>do</w> <w>aithli</w> <w>bruit</w>, <w xml:lang="lat">quasi</w> <w>fo</w>-<w>lumman</w>.\r\n', NULL, 'col. 39', 'foilmen');
INSERT INTO `reading` VALUES(17572, 'Fochnod', 9, 592, 'Y.591', '591', '', '\r\n<w type="hw" lemma="fochnod">Fochnod</w> .i. <w>fo</w>-<w>chondud</w>, <w>lasamain</w> <w>dobeir</w> <w>for</w> <w>teinid</w>. <w>is</w> <w>aimind</w> <w>iarom</w> <w>geltine</w> <w>in</w> <w>crinach</w> <w>sin</w>. <w xml:lang="lat">inde</w> <w xml:lang="lat">dicitur</w> <w>gilithir</w> <w>geltine</w> <w>giliu</w> <w>fochunad</w>, <w>noch</w> <w>is</w> <w>lasair</w> <w>son</w>. <w xml:lang="lat">inde</w> <w xml:lang="lat">dictum</w> <w xml:lang="lat">est</w>, <w>grian</w> <w>in</w> <w>gaim</w> <w>geltine</w>.\r\n', NULL, 'col. 39', 'fochnod');
