INSERT INTO `reading` VALUES(17577, 'Fual', 9, 597, 'Y.596', '596', '', '\r\n<w type="hw" lemma="fúal 1b">Fual</w> <w xml:lang="lat">quasi</w> <w>bual</w> .i. <w>uisce</w>, <w xml:lang="lat">inde</w> <w xml:lang="lat">dicitur</w> <w>dochuadar</w> <w>ar</w> n-<w>asa</w> i <w>fual</w> .i. a <w>mbual</w>.\r\n', NULL, 'col. 39', 'fúal 1b');
INSERT INTO `reading` VALUES(17578, 'Fothrucad', 9, 598, 'Y.597', '597', '', '\r\n<w type="hw" lemma="fothrucud">Fothrucad</w> <w xml:lang="lat">quasi</w> <w>othrucad</w>, <w>ar</w> <w>is</w> <cb n="col. 40"/> d’othraib .i. d’oes <w>lobair</w> <w>is</w> <w>mencem</w>. <w xml:lang="lat">sed</w> <w xml:lang="lat">melius</w> <w>fotruicit</w> .i. <w>intan</w> <w>adnaim</w> <w>duine</w> a <w>chosa</w> ⁊ a <w>lama</w> <w>indlat</w> <w>innsin</w> .i. <w>inlót</w>, <w xml:lang="lat">lotum</w> .i. diunag<add>ch</add> n-<w>ind</w>. <w>fothrucad</w> .i. <w>fo</w>-<w>throicit</w>, <w>troichit</w> .i. <w>coip</w>, .i. <w>in</w> <w>corp</w> <w>uile</w> <w>fou</w>. \r\n', NULL, 'col. 39', 'fothrucud');
INSERT INTO `reading` VALUES(17579, 'Foi', 9, 599, 'Y.598', '598', '', '\r\n<w type="hw" lemma="Foí">Foi</w> .i. <w>Cnamchaill</w>. <w xml:lang="lat">inde</w> <w xml:lang="lat">dixit</w> <w>Gruibne</w> <w>fili</w> <w>fri</w> <w>Corc</w> <w>rnac</w> <w>Luigdech</w> <w>in</w> <w>fes</w> <w>fo</w> <w>Foi</w> .i. <w>ba</w> <w>fesach</w> <w>Cnamchaille</w>. <w xml:lang="lat">item</w> <w>Mug</w> <w>Roith</w> <w xml:lang="lat">peribet</w> <w xml:lang="lat">quod</w> <w>Roth</w> <w>Fail</w> <w xml:lang="lat">perueniet</w>, <w xml:lang="lat">dicens</w> <w>co</w> <w>ri</w> <w>Durlas</w> <w>finn</w> <w>iar</w> <w>foi</w> .i. <w>iar</w> <w>Cnamchaill</w>.\r\n', NULL, 'col. 40', 'Foí');
INSERT INTO `reading` VALUES(17580, 'Felmac', 9, 600, 'Y.599', '599', '', '\r\n<w type="hw" lemma="felmac">Felmac</w> .i. <w>mac</w> <w>uad</w>, <w>fel</w> .i. <w>ái</w>, <w>fele</w> .i. <w>ecess</w>, <w xml:lang="lat">unde</w> <w xml:lang="lat">dicitur</w> <w>filidecht</w> .i. <w>ecsi</w>.\r\n', NULL, 'col. 40', 'felmac');
INSERT INTO `reading` VALUES(17581, 'Fili', 9, 601, 'Y.600', '600', '', '\r\n<w type="hw" lemma="fili">Fili</w> .i. <w>fi</w> a n-<w>aoras</w> ⁊ <w>li</w> a <w>mmolas</w> ⁊ <w>brecht</w> a <w>fuacras</w> <w>in</w> <w>file</w>.\r\n', NULL, 'col. 40', 'fili');
INSERT INTO `reading` VALUES(17582, 'Fogamar', 9, 602, 'Y.601', '601', '', '\r\n<w type="hw" lemma="fogamar">Fogamar</w> .i. <w>don</w> <w>mis</w> <w>dedenaig</w> <w>rohainmniged</w> .i. <w xml:lang="lat">quasi</w> <w>fogaimiur</w> .i. <w>fota</w> <w>mis</w> <w>ngaim</w>.\r\n', NULL, 'col. 40', 'fogamar');
