INSERT INTO `reading` VALUES(17584, 'Femen', 9, 604, 'Y.603', '603', '', '\r\n<w type="hw" lemma="Femen">Femen</w> .i. <w>Fe</w> ⁊ <w>Men</w> .i. <w>da</w> <w>ri</w> <w>damraithe</w> <w>Erend</w>. <w>isin</w> <w>maigin</w> <w>sin</w> <w>robadar</w>, <w>is</w> <w>de</w> <w>isberar</w>. <w>Cirbæ</w> <w xml:lang="lat">nomen</w> <w>in</w> <w>baile</w> a <w>mbitis</w> <w>ac</w> <w>cognam</w> a <w>cire</w>.\r\n', NULL, 'col. 40', 'Femen');
