INSERT INTO `reading` VALUES(17586, 'Fair', 9, 606, 'Y.605', '605', '', '\r\n<w type="hw" lemma="fáir">Fair</w> .i. <w>turgbail</w> <w>na</w> <w>gréine</w> i <w>matain</w>, <w xml:lang="lat">ab</w> <w xml:lang="lat">eo</w> <w xml:lang="lat">quod</w> <w xml:lang="lat">est</w> <w xml:lang="lat">iubar</w> .i. <w>dellradh</w>, <w xml:lang="lat">undi</w> <w xml:lang="lat">dixit</w> <w>Colum</w> <w>Cille</w> <w>dia</w> <w>lim</w> <w>fri</w> <w>fuin</w>, <w>dia</w> <w>lim</w> <w>fri</w> <w>fair</w> .i. <w>fri</w> <w>turcbail</w>. <w>fri</w> <w>fuin</w> i <w>fri</w> folach{?}.\r\n', NULL, 'col. 40', 'fáir');
INSERT INTO `reading` VALUES(17587, 'Fe', 9, 607, 'Y.606', '606', '', '\r\n<w type="hw" lemma="fé 1">Fe</w> <w xml:lang="lat">ab</w> <w xml:lang="lat">eo</w> <w xml:lang="lat">quod</w> <w xml:lang="lat">est</w> <w xml:lang="lat">uae</w>. <w>ar</w> <w>is</w> <w>gnath</w> <w>fernd</w> <w>do</w> <w>frestol</w> <w>na</w> .u. <w>consaine</w> <w>la</w> <w>Goedelæ</w>. <w xml:lang="lat">aliter</w>, <w>forrugeine</w> <w>la</w> <w>Gaidelai</w> <w>flesc</w> <w>idaith</w> <w>domitte</w> <w>frissna</w> <w>collnai</w> ⁊ <w>frisinadnadcula</w> i n-<w>adnaictis</w>, <w>ocus</w> <w>nobith</w> <w>in</w> <w>fleiscc</w> <w>sin</w> <w>dogress</w> <w>is</w> <w>relgib</w> <w>ina</w> <w>ngeinti</w> <w>frisna</w> <w>adnaclai</w>. <w>ocus</w> <w>ba</w> <w>huath</w> <w>fri</w> <w>cach</w> a <w>gabail</w> <w>inda</w> <w>lam</w>, <w>ocus</w> <w>gach</w> <w>ret</w> <w>ba</w> <w>adetchidhe</w> <w>la</w> <w>cach</w> <w>dobentai</w> <w>frie</w>. <w>no</w> <w>dobertis</w> <w>trie</w> <w>ogbam</w> <w>indti</w> <w xml:lang="lat">unde</w> <w xml:lang="lat">in</w> <w xml:lang="lat">prouerbium</w> <cb n="col. 41"/> <w xml:lang="lat">uenit</w> <w>fe</w> <w>fris</w>, <w>amail</w> <w>is</w> n-<w>adetcide</w> <w>in</w> <w>flesc</w> <w xml:lang="lat">cui</w> <w xml:lang="lat">nomen</w> <w>fe</w>, <w xml:lang="lat">sic</w> <w xml:lang="lat">et</w> <w xml:lang="lat">alia</w> <w xml:lang="lat">ress</w> <w xml:lang="lat">cui</w> <w xml:lang="lat">comparatur</w>. <w>huaire</w> <w>tra</w> <w>ba</w> <w>die</w> <w>edath</w> <w>nobith</w> <w>in</w> <w>flesc</w>, <w>ocus</w> <w>ba</w> <w>hadeitchide</w>, <w>is</w> <w>aire</w> <w>isbeir</w> <w>Morann</w> <w>isin</w> <w>Briatharogum</w> <w>ærchaid</w> <w>fid</w> <w>edath</w> .i. <w>ind</w> <w>aor</w> <w>rolil</w> <w>in</w> <w>flesc</w> <w>cui</w> <w xml:lang="lat">nomen</w> <w>est</w> <w>fe</w>, <w xml:lang="lat">ut</w> <w xml:lang="lat">dicitur</w> <w>Dirsan</w> <w>bith</w> a <w>mbethaid</w> <w>dam</w> d’eis <w>rig</w> <w>Gaoideal</w> <w>ocus</w> <w>Gall</w> <w>Ere</w>