INSERT INTO `reading` VALUES(17588, 'Fithchill', 9, 608, 'Y.607', '607', '', '\r\n<w type="hw" lemma="fidchell">Fithchill</w> .i. <w>fath</w>-<w>ciall</w> .i. <w>fath</w> ⁊ <w>ciall</w> <w>occ</w> a <w>imbirt</w>. <w>no</w> <w>feith</w> ⁊ <w>ciall</w>. <w>no</w> <w>fuath</w>-<w>cell</w> .i. <w>fuath</w> <w>cille</w> .i. <w>is</w> <w>cethrachair</w> <w>cetumus</w> <w>ind</w> <w>fitchill</w> ⁊ <w>it</w> <w>dirge</w> a <w>tithe</w>, <w>ocus</w> <w>find</w> <w>ocus</w> <w>dub</w> <w>fuirre</w>, <w>is</w> <w>ainmuinter</w> <w>cachlafechtus</w> <w>beus</w> <w>beress</w> a <w>tochell</w>. <w xml:lang="lat">sic</w> <w xml:lang="lat">æclesiæ</w> <w xml:lang="lat">per</w> <w xml:lang="lat">singala,</w> <w xml:lang="lat">per</w> <w xml:lang="lat">quatuor</w> <w xml:lang="lat">terra</w> <w xml:lang="lat">partess</w> <w xml:lang="lat">.iiii.</w> <w xml:lang="lat">euangelis</w> <w xml:lang="lat">pasta</w> <add>.i. <w>is</w> <w>marsin</w> <w>an</w> <w>eclais</w> <w>ic</w> <w>sassad</w> <w>cethri</w> <w>rann</w> <w>sundradach</w> <w>in</w> <w>betha</w> o soscelaib</add>. <w>is</w> <w>diriuch</w> <w>immessaib</w> <w>lasna</w> <w>tíí</w> <w>na</w> <w>screpra</w> .i. <w>nigri</w> <add>.i. dub</add> ⁊ <w>albi</w> <add>.i. gel</add> .i. <w xml:lang="lat">boni</w> <w xml:lang="lat">et</w> <w xml:lang="lat">malii</w> <w xml:lang="lat">abitant</w> <w xml:lang="lat">in</w> <w xml:lang="lat">æclesiæ</w>.\r\n', NULL, 'col. 41', 'fidchell');
