INSERT INTO `reading` VALUES(17590, 'Folassa', 9, 610, 'Y.609', '609', '', '\r\n<w type="hw" lemma="folassa">Folassa</w> .i. <w>arindi</w> <w>folloing</w> <w>coiss</w> <w>in</w> <w>duine</w>. <w xml:lang="lat">aliter</w> <w>fol</w> <w xml:lang="lat">quasi</w> <w>sól</w>, <w xml:lang="lat">id</w> <w xml:lang="lat">est</w> <w xml:lang="lat">ab</w> <w xml:lang="lat">eo</w> <w xml:lang="lat">quod</w> <w xml:lang="lat">est</w> <w xml:lang="lat">solus</w> <w xml:lang="lat">latine</w> .i. <w>fol</w> <w>cendfocrus</w> .i. .f. <w>pro</w> .s., <w>fol</w> <w xml:lang="lat">quasi</w> <w>sol</w> .i. <w>bondbach</w>, <w>no</w> <w>coma</w> <w>bonnbrach</w> <w>ba</w> <w>coir</w> <w>and</w> .i. <w>eter</w> <w>bonn</w> ⁊ <w>bruach</w> <w>bis</w>. \r\n', NULL, 'col. 41', 'folassa');
