INSERT INTO `reading` VALUES(17654, 'Gaimrith', 9, 674, 'Y.673', '673', '', '\r\n<w type="hw" lemma="gemred">Gaimrith</w> <w xml:lang="lat">quasi</w> <w>gaim</w>-<w>rith</w>, <w xml:lang="lat">unde</w> <w xml:lang="lat">dicitur</w> <w>Colman</w> <w>mac</w> <w>hui</w> <w>Cluasaigh</w> <w>hi</w> <w>marbhnaidh</w> <w>Cuimine</w> <w>Fotæ</w> <w>Hua</w> <w>Corpre</w>, <w>hua</w> <w>Cuirc</w>, <w>ba</w> <w>sái</w>, <w>ba</w> <w>hán</w>, <w>bá</w> <w>hordric</w>, <w>dirsan</w> <w>marban</w> <w>im</w>-<w>mí</w> <w>gamh</w>, <w>ní</w> <w>liach</w>, <w>ni</w> d’eccaib <w>iaramh</w>, .i. <w>for</w> <w>nemh</w> <w>rainic</w>. <add place="margin-bottom">misi iolland</add><cb n="col. 44"/>\r\n', NULL, 'col. 43', 'gemred');
INSERT INTO `reading` VALUES(17655, 'Gelestar', 9, 675, 'Y.674', '674', '', '\r\n<w type="hw" lemma="gelester">Gelestar</w> <w>ainm</w> <w>do</w> <w>áth</w> <w>usque</w> a<add>ł im</add> <w>mbi</w> <w>cethra</w> <w>for</w> <w>uibhel</w>, ⁊ <w>doepethar</w> <w>gulbain</w> <w>do</w> <w>cech</w> <w>ferand</w> immid<add>i</add>mbi, ⁊ <w>dognither</w> <w>cuairt</w> d’imbe <w>nimbe</w>, <w>mad</w> <w>iter</w> <w>comaidhcib</w> <w>beth</w> <w>int</w> <w>ath</w>, <w>arna</w> <w>comblaisset</w> <w>na</w> <w>bai</w> <w>in</w> <w>gurta</w>. <w>an</w> <w>immon</w> <w>sech</w> <w>sin</w> <w>iarom</w> <w>dogniat</w> <w>na</w> <w>bai</w> <w>isind</w> <w>ath</w>, <w>is</w> <w>do</w> <w>is</w> <w xml:lang="lat">nomen</w> <w>gelestar</w>, <w>ocus</w> <w>dlegar</w> <w>bothar</w> <w>do</w> <w>cech</w> <w>comaigtiuch</w> <w>adochum</w> <w>cid</w> <w>tir</w> <w>cen</w> <w>beula</w> <w>bess</w> <w>lais</w>. \r\n', NULL, 'col. 44', 'gelester');
INSERT INTO `reading` VALUES(17656, 'Gabar', 9, 676, 'Y.675', '675', '', '\r\n<w type="hw" lemma="gabor 1">Gabar</w> <w>tria</w> <w>ailm</w> <w xml:lang="lat">quasi</w> <w xml:lang="lat">caper</w> <w>rotruailled</w> <w>and</w>. <w>gobar</w> <w>immorro</w> <w>tre</w> <w>ond</w>, <w>don</w> <w>eoch</w> <w>is</w> <w xml:lang="lat">nomen</w> <w>side</w>, ⁊ <w>is</w> <w>combrecc</w> <w>rotruailled</w> <w>ann</w> .i. <w xml:lang="cym">goor</w> <w>gach</w> <w>solus</w> a <w>suidi</w>, <w xml:lang="lat">unde</w> <w xml:lang="lat">dicitur</w> <w>goar</w> <w>don</w> <w>eoch</w> <w>gil</w> ⁊ <w>rl</w>. <w>cid</w> <w>cia</w> <w>dath</w> <w>aile</w> <w>bess</w> <w>forsind</w> <w>euch</w>, <w>dia</w> <w>mbe</w> <w>bec</w> <w>do</w> <w>ghil</w> <w>and</w>, <w>is</w> <w>goor</w> a <w xml:lang="lat">nomen</w> <w>ar</w> <w>is</w> <w>asan</w> <w>dath</w> <w>is</w> <w>airegdæ</w> <w>bess</w> <w>and</w> <w xml:lang="lat">nominatur</w>. <w>rotuill</w> <w>in</w> <w>fili</w> <w>gaidhelach</w> .b. <w>fris</w> <w>ar</w> <w>tucait</w> <w>mbindessa</w>, <w>ar</w> <w>rop</w> <w>aille</w> <w>leo</w> <w>gobar</w> <w xml:lang="lat">quam</w> <w>goor</w>, <w xml:lang="lat">unde</w> <w>gobar</w> <w xml:lang="lat">nomenantur</w>.\r\n', NULL, 'col. 44', 'gabor 1');
INSERT INTO `reading` VALUES(17659, 'Gilldæ', 9, 677, 'Y.676', '676', '', '\r\n<w type="hw" lemma="gilla c">Gilldæ</w> .i. <w>is</w> <w>fri</w> <w>gil</w> <w>is</w> <w>cosmail</w>. <w>is</w> e <w>didiu</w> a <w>bes</w> <w>aide</w> .i. <w>tossugad</w>. <w>iss</w> e <w>dono</w> <w>bessad</w> <w>in</w> <w>gilla</w> <w>tosugud</w> <w>forcetail</w> <w>do</w> <w>tengaid</w> a <w>fithidire</w>, <w xml:lang="lat">unde</w> <w xml:lang="lat">dicitur</w> <w>isna</w> <w>Brethaib</w> <w>Nemeth</w> <w>doglen</w> <w>gil</w> <w>tengaid</w>. \r\n', NULL, 'col. 44', 'gilla c');
