INSERT INTO `reading` VALUES(17666, 'Gall', 9, 684, 'Y.683', '683', '', '\r\n<w type="hw" lemma="gall 1a">Gall</w> i.e. <w>corthe</w> <w>cloiche</w>, <w xml:lang="lat">ut</w> <w xml:lang="lat">est</w> <w>nis</w> <w>comathaig</w> <w>comathar</w> <w>selba</w> <w>co</w> <w>cobrannaib</w> <w>gall</w>. <w>gall</w> <w>cetharda</w> <w>fordingair</w> .i. <w>gall</w> <w>cluichi</w> <w>cetimus</w>, <w xml:lang="lat">ut</w> <w xml:lang="lat">prediximus</w>. <w>is</w> <w>aire</w> <w>asberar</w> <w>gall</w> <w>de</w> <w>suidiu</w>, <w>fobith</w> <w>is</w> <w>Gaill</w> <w>ceta</w>-<w>rosaithset</w> ł <w>rosuidigset</w> i <w>nEre</w>. <w>Gaill</w> .i. <w>Frainc</w>. <w>Gaill</w> <w>dano</w> <w>ainm</w> <w>do</w> <w>sainclandaib</w> <w>no</w> <w>do</w> <w>særclandaib</w> <w>Franc</w> .i. <w xml:lang="lat">tres</w> <w xml:lang="lat">Gallie</w>, ⁊ <w>is</w> <w xml:lang="lat">candoire</w> <w xml:lang="lat">corporis</w> <w>rohainmniged</w> <w>doib</w>. <w xml:lang="lat">gall</w> <w xml:lang="lat">enim</w> <w xml:lang="lat">greco,</w> <w xml:lang="lat">lac</w> <w xml:lang="lat">latine</w> <w xml:lang="lat">dicitur,</w> <w xml:lang="lat">inde</w> <w xml:lang="lat">Galliae</w> .i. <w>indastai</w>. <w xml:lang="lat">síc</w> <w>dono</w> <w>gall</w> <w>is</w> <w>ainm</w> <w>do</w> <w>ela</w>. <w xml:lang="lat">inde</w> <w>Fer</w> <w>Muman</w> <w xml:lang="lat">dixit</w> <w>cochall</w> <w>coss</w> <w>ngall</w>, <w>gaimin</w> <w>brain</w>. <w>gall</w> <w>dono</w> <w>ainm</w> <w>do</w> <w>chailiuch</w> <w>dindi</w> <w>is</w> <w xml:lang="lat">gallus</w>, ⁊ <w>is</w> <w xml:lang="lat">a</w> <w xml:lang="lat">galia</w> <w xml:lang="lat">capitis</w> <w>rohainmniged</w> .i. a <w>cathbarr</w> a <w>cind</w>.\r\n', NULL, 'col. 44', 'gall 1a');
