INSERT INTO `reading` VALUES(17724, 'Itharnnæ', 9, 736, 'Y.735', '735', '', '\r\n<w type="hw" lemma="ítharnae">Itharnnæ</w> .i. <w>ith</w> ⁊ <w>feorna</w> .i. <w>semend</w>, <w>ar</w> <w>it</w> <w>glaine</w>, ⁊ <w>ith</w> <w>na</w> <w>cethra</w> <w>noteged</w> <w>isna</w> <w>cainnle</w> <w xml:lang="lat">apud</w> <w xml:lang="lat">ueteress</w>. <w xml:lang="lat">aliter</w> <w>ith</w> ⁊ <w>ornnae</w> .i. <w>orn</w> <w>orgain</w> .i. <w>orcuin</w> <w>itha</w>.\r\n', NULL, 'col. 50', 'ítharnae');
