INSERT INTO `reading` VALUES(17745, 'Imbass forosnae', 9, 757, 'Y.756', '756', '', '\r\n<w type="hw" lemma="imbas 1">Imbass forosnae</w> .i. <w>dofuarascaib</w> <w>secip</w> <w>ret</w> <w>bas</w> <w>maith</w> <w>lasin</w> <w>filid</w> ⁊ <w>bes</w> <w>adlaic</w> <w>dó</w> d’foillsiugad. <w>is</w> <w>amlaid</w> <w>didiu</w> <w>dognither</w> <w>on</w> .i. <w>concna</w> <w>in</w> <w>file</w> <w>mir</w> <w>do</w> <w>carna</w> <w>dirg</w> <w>muice</w> <w>no</w> <w>con</w> <w>no</w> <w>cait</w> <w>ocus</w> <w>dobir</w> .i. <w>iarom</w> <w>for</w> <w>lic</w> <w>iar</w> <w>cul</w> <w>na</w> <w>comlad</w> ⁊ <w>dichain</w> <w>dichetal</w> <w>fair</w> ⁊ <w>adodpair</w> <w>do</w> <w>deib</w> <w>idal</w> ⁊ <w>cotigair</w> <w>dó</w> ⁊ <w>ni</w> <w>fagaib</w> <w>iarnabaroch</w>, ⁊ <w>dochain</w> <w>iarom</w> <w>for</w> a <w>di</w> <w>bois</w> ⁊ <w>congair</w> <w>deo</w> <w>idal</w> <w>cuige</w> <w>arna</w> <w>tarmascthar</w> a <w>codlud</w> ⁊ <w>dobeir</w> a <w>di</w> <w>bois</w> <w>ima</w> <w>di</w> <w>lecain</w> ⁊ <w>contuli</w> ⁊ <w>bithir</w> <w>og</w> a <w>foraire</w> <w>ar</w> <w>nachn</w>-<w>imparræ</w> ⁊ <w>nach</w> <w>toirmescae</w> <w>neach</w>, <w>agas</w> <w>doadbanar</w> <w>do</w> <w>iarom</w> <w>anni</w> <w>aradmbí</w> <w>co</w> <w>cend</w> <w>nómaide</w> <w>no</w> a <cb n="col. 52"/> <w>duo</w> <w>no</w> a <w>tri</w>, <w>fut</w> <w>ngair</w> <w>conmessad</w> <w>ocind</w> <w>audbairt</w>. <w xml:lang="lat">et</w> <w xml:lang="lat">ideo</w> <w>imbas</w> <w xml:lang="lat">dicitur</w> .i. <w>bas</w> <w>disiu</w> ⁊ <w>bass</w> <w>anall</w> <w>im</w> a <w>agaid</w> <w>no</w> <w>im</w> a <w>cend</w>. <w>atrorbe</w> <w>Patraic</w> <w>anisin</w>, ⁊ <w>an</w> <w>teinm</w> <w>laoda</w> ⁊ <w>fotroirgell</w> a <w>briathar</w> <w>na</w> <w>bad</w> <w>nimhe</w> <w>na</w> <w>talman</w> <w>nach</w> <w>aon</w> <w>dogenai</w>, <w>ar</w> <w>is</w> <w>diultad</w> <w>bathis</w>. <w>dicetal</w> <w>docennaib</w> <w>immorro</w> <w>fodracbad</w> <w>son</w> i <w>corus</w> <w>cerdæ</w>, <w>ar</