INSERT INTO `reading` VALUES(17785, 'Lugnasad', 9, 797, 'Y.796', '796', '', '\r\n<w type="hw" lemma="Lugnasad">Lugnasad</w> .i. <w>nasad</w> <w>Loga</w> <w>maic</w> <w>Ethlend</w> .i. <w>aonach</w> ł <w>fertha</w> <w>lais</w> <w>im</w> <w>taite</w> <w>foghmair</w> <w>in</w> <w>gach</w> <w>bliadhain</w> <w>im</w> <w>thoidecht</w> <w>Lugnasad</w>. <w>Cluiche</w> ł <w>aonach</w> <w>is</w> <w>do</w> <w>is</w> <w>ainm</w> <w>nasad</w>. \r\n', NULL, 'col. 53', 'Lugnasad');
INSERT INTO `reading` VALUES(17786, 'Lelup', 9, 798, 'Y.797', '797', '', '\r\n<w type="hw" lemma="lelap">Lelup</w> .i. <w>lu</w> <w>lep</w> .i. <w>lu</w> <w>cach</w> <w>mbecc</w> ł <w>lenab</w> .i. <w xml:lang="lat">lenis</w> <w xml:lang="lat">abati</w> .i. <w xml:lang="lat">patri</w> <w xml:lang="lat">et</w> <w xml:lang="lat">matri</w> .i. <w>iarsindi</w> <w>lenas</w> <w xml:lang="lat">abatim</w> ⁊ <w xml:lang="lat">matrem</w>. <w xml:lang="lat">aliter</w> <w>lelup</w> .i. <w>lu</w> <w>pell</w> .i. <w>lu</w> <w>gach</w> <w>mbeg</w> <w>pell</w> <w>ondi</w> <w>is</w> <w>pellis</w> .i. <w>maoth</w>.\r\n', NULL, 'col. 53', 'lelap');
INSERT INTO `reading` VALUES(17787, 'Les mac', 9, 799, 'Y.798', '798', '', '\r\n<w type="hw" lemma="les (cmpd)">Les mac</w> .i. <w>lis</w> <w>mac</w> .i. <w>arindi</w> <w>dofuissim</w> <w>don</w> <w>fiur</w> <w>no</w> <w>don</w> <w>mnai</w> <w>inti</w> <w>is</w> <w>les</w> <w>mac</w> <w>do</w> <w>nechtar</w> <w>de</w>. <cb n="col. 54"/> <w>Sic</w> <w>lesathair</w> ⁊ <w>lesmathair</w>. <w>Lis</w> <w>didiu</w> <w xml:lang="lat">quasi</w> <w>lís</w> .i. <w>imargail</w> <w>no</w> <w>debaid</w>.\r\n', NULL, 'col. 53', 'les (cmpd)');
INSERT INTO `reading` VALUES(17788, 'Legam', 9, 800, 'Y.799', '799', '', '\r\n<w type="hw" lemma="legam">Legam</w> .i. <w>ligem</w> .i. <w>don</w> <w>lige</w> <w>ligess</w> <w>int</w> <w>etagh</w> ł <w>ligh</w> <w>aith</w> .i. <w>aith</w> <w>fri</w> <w>ligha</w>. <w>Ni</w> <w>aire</w> <w>em</w> <w>nat</w> <w>fosad</w> <w>som</w> <w>fri</w> <w>cech</w> n-<w>etag</w> <w>ceni</w> <w>betis</w> <w>liga</w> <w>nime</w>, <w>acht</w> <w>as</w> <w>menciu</w> <w>ara</w> <w>ciallathar</w> ⁊ <w>fossaimther</w> a n-<w>etach</w> <w>liga</w> <w xml:lang="lat">quam</w> <w xml:lang="lat">ailiud</w> <w xml:lang="lat">uesstimentum</w>.\r\n', NULL, 'col. 54', 'legam');
