INSERT INTO `reading` VALUES(17792, 'Loch', 9, 804, 'Y.803', '803', '', '\r\n<w type="hw" lemma="loch 1">Loch</w> <w>dede</w> <w>fordangair</w>. <w>loch</w> .i. <w>dubh</w> <w xml:lang="lat">ut</w> <w xml:lang="lat">dicitur</w> <w>asoilge</w> <w>laith</w> <w>loch</w> <w>bronda</w> .i. <w>dub</w> <w>brondae</w>, <w>cia</w> <w>dorche</w> <w>samad</w> <w>caich</w> ⁊ <w>cid</w> <w>rundae</w> <w>riam</w> ⁊ <w>iarom</w>, <w>docruide</w> a <w>runa</w> <w>laith</w> <w>dol</w>. <w>Loch</w> <w>dino</w> .i. <w>uile</w> <w xml:lang="lat">unde</w> <w xml:lang="lat">dicitur</w> <w>lochdub</w> .i. <w>uiledub</w>.\r\n', NULL, 'col. 54', 'loch 1');
