INSERT INTO `reading` VALUES(17841, 'Lotar', 9, 850, 'YAdd.849', '849', '', '\r\n<w type="hw" lemma="lothar 1">Lotar</w> i <w>mbi</w> <w>brachles</w> .i. <w>tinol</w>, <w>ar</w> <w>tinol</w> <w>na</w> <w>lendand</w> <w>cuici</w> <w xml:lang="lat">ut</w> <w xml:lang="lat">dicitur</w> <w>lotar</w> <add>.i. comtinol</add> <w>nat</w> <w>fuair</w> <w>ar</w> <w>dib</w> <w>rigaibh</w> <w>rath</w>.\r\n', 'YAdd', 'col. 57', 'lothar 1');
INSERT INTO `reading` VALUES(17842, 'Modebroth', 9, 851, 'Y.850', '850', '', '\r\n<w type="hw" lemma="debroth">Modebroth</w> <add>.i. luide</add>, <w>ol</w> <w>Patraic</w> <add>mo <w>de</w> <w>brot</w> .i. <w>mo</w> <w>Dia</w> <w>brata</w>, <w>ol</w> Patraic</add>, <w xml:lang="lat">quod</w> <w xml:lang="lat">Scoti</w> <w xml:lang="lat">corrupti</w> <w xml:lang="lat">dicunt</w> <add>.i. <w>is</w> <w>truaillech</w> <w>aderaid</w> <w>na</w> <w>Scoitica</w> hé</add>; <w xml:lang="lat">sic</w> <w xml:lang="lat">autem</w> <w xml:lang="lat">dici</w> <w xml:lang="lat">debæt</w> <add> .i. <w>mar</w> <w>so</w> <w>is</w> <w>dligedh</w> a radha</add>, <w>muin</w> <w>Duiu</w> <w>braut</w> <add> .i. <w>mui</w> <w>Duiu</w> braut</add>, a <w>mmuin</w> <w>didiu</w> <w xml:lang="lat">is</w> <w xml:lang="lat">meus</w>, a <w>nDuiu</w> <w>is</w> <w>ed</w> <w xml:lang="lat">Deus</w>, <w>in</w> <w>braut</w> <w>is</w> <w xml:lang="lat">iudex</w> <add>.i. brethem</add>\r\n', NULL, 'col. 57', 'debroth');
INSERT INTO `reading` VALUES(17843, 'Marc', 9, 852, 'Y.851', '851', '', '\r\n<w type="hw" lemma="marc">Marc</w> i. <w>each</w>. <w>marcagh</w> <w>didiu</w> .i. <w>eich</w> <w>imdæ</w> <w>lais</w>, <w xml:lang="lat">ut</w> <w xml:lang="lat">dicitur</w> <w>buasac</w> <w>in</w> <w>fer</w> <w>lasa</w> <w>mbit</w> <w>ba</w> <w>imdæ</w>. <w>airmnec</w> <w>dono</w> <w>in</w> <w>fer</w> <w>lasa</w> <w>mbit</w> <w>arbuir</w> <w>imdæ</w>. <w>sic</w> <w>airgtech</w>, <w>coilctec</w>. \r\n', NULL, 'col. 57', 'marc');
