INSERT INTO `reading` VALUES(17855, 'Morand', 9, 864, 'Y.863', '863', '', '\r\n<w type="hw" lemma="Morann">Morand</w> .i. <w>mor</w>-<w>find</w>. <w>ba</w> <w>hed</w> <w>indsin</w> <w>ainm</w> <w>dobert</w> a <w>mathair</w> <w>do</w>, ⁊ <w>isbert</w> <w>roba</w> <w>bidba</w> <w>bais</w> <w>nacitn</w>-<w>epred</w> <w>fris</w> <w>int</w> <w>ainm</w> <w>sin</w>. <w>Mac</w> <w>Main</w> <w>immorro</w> <w>dobert</w> a <w>athair</w> <w>do</w> .i. <w>ba</w> <w>muin</w> <w>mait</w> <w>in</w> <w>mac</w> <w>sin</w>, ⁊ <w>ba</w> <w>bidba</w> <w>bais</w> <w>nach</w> <w>eperet</w> <w>ris</w> <w>ind</w> t-<w>ainm</w> <w>sin</w>. <w>roleltar</w> <w>iarom</w> <w>in</w> <w>da</w> <w>ainm</w> <w>in</w> <w>fer</w> <w>sa</w> i <w>ndun</w> <w>ænanma</w>. <w>Mac</w> <w>sim</w> <w>Coirpri</w> <w>Cindcait</w> <w>immorro</w>.\r\n', NULL, 'col. 58', 'Morann');
