INSERT INTO `reading` VALUES(17866, 'Muilend', 9, 875, 'Y.874', '874', '', '\r\n<w type="hw" lemma="muilend">Muilend</w> .i. <w>mol</w> ⁊ .i. <w>ond</w> <w>cloc</w>, <w>ar</w> <w>iss</w> <w>ed</w> <w>dede</w> <w>is</w> <w>muilend</w> <w>immuillend</w>. <w>no</w> <w>mol</w>-<w>onn</w> .i. <w>mó</w> a <w>ail</w> .i. <w>mó</w> a <w>chlocha</w> <w xml:lang="lat">quam</w> <w>cloca</w> <w>bron</w>. <w>muilind</w> .i. <w>mel</w> ⁊ <w>lind</w>, <cb n="col. 59"/> <w>ar</w> <w>is</w> <w>for</w> <w>linn</w> <w>meless</w>.\r\n', NULL, 'col. 58', 'muilend');
INSERT INTO `reading` VALUES(17867, 'Merdrech', 9, 876, 'Y.875', '875', '', '\r\n<w type="hw" lemma="meirdrech">Merdrech</w> <w xml:lang="lat">ab</w> <w xml:lang="lat">eo</w> <w xml:lang="lat">quod</w> <w xml:lang="lat">est</w> <w xml:lang="lat">meretrix</w>, <w xml:lang="lat">merendo</w> <w xml:lang="lat">pretium</w> <w xml:lang="lat">stupri</w> .i. <w>dligid</w> <w>si</w> <w>fiach</w> a <w>saothair</w>. <w>merdrech</w> .i. <w>mer</w> <w>drech</w>. <w>mer</w> .i. <w>druith</w>, <w>drech</w> .i. <w>baoth</w>. <w>merdrech</w> <w>didiu</w> <w>ben</w> <w>druith</w> <w>baoth</w>, <w xml:lang="lat">ut</w> <w xml:lang="lat">dicitur</w> <w>druith</w> <w>gach</w> <w>mer</w>, <w>mianach</w> <w>gach</w> <w>baoth</w>.\r\n', NULL, 'col. 59', 'meirdrech');
