INSERT INTO `reading` VALUES(17870, 'Mundu', 9, 879, 'Y.878', '878', '', '\r\n<w type="hw" lemma="Munnu">Mundu</w> .i. <w>mo</w> a <w>finda</w> .i. <w>ainm</w> <w>baide</w>. <w>Fintan</w> <w xml:lang="lat">enim</w> <w xml:lang="lat">dictus</w> <w xml:lang="lat">est,</w> <w xml:lang="lat">unde</w> <w>Maodoc</w> <w>Ferna</w> <w xml:lang="lat">dixit</w> <w>oc</w> <w>áir</w> <w>Munda</w> <w>maic</w> <w>Tulchain</w> A <w>chelen</w> <w>De</w> <w>chumachtaig</w>, a <w>mic</w> <w>Tulchain</w>, a <w>bachluid</w>, <w>ruc</w> <w>mac</w> n-<w>annsa</w> <w>die</w> <w>muintir</w> <w>mathair</w> <w>rot</w>-<w>uc</w>, a <w>Fintain</w>.\r\n', NULL, 'col. 59', 'Munnu');
