INSERT INTO `reading` VALUES(17966, 'Nairne', 9, 973, 'Y.972', '972', '', '\r\n<w type="hw" lemma="nairne 1">Nairne</w> .i. <w>glain</w>. <w>no</w> <w>nairne</w> <w>amad</w> <w>bid</w> <w>naire</w> <w>nobeth</w> <w>and</w> .i. <w>senberla</w> <w>didiu</w> <w>in</w> <w>naire</w> n-i <w>sin</w>. <w>is</w> <w>inand</w> ⁊ <w>isbertha</w> <w>egin</w>. <w>IS</w> <w>gnathberla</w> <w>eisem</w> <w>tra</w> <w>cidh</w> <w>indiu</w> <w>la</w> <w>hIrmumhain</w> <w xml:lang="lat">maxime</w>, <w xml:lang="lat">unde</w> <w xml:lang="lat">dicitur</w> <w>in</w> <w>fil</w> <w>ní</w> <w>bas</w> <w>toich</w> <w>duit</w>. <w>fil</w> <w>eigin</w>, <w>ol</w> <w>intí</w> <w>dia</w> n-<w>imchomarcar</w> .i. <w>nairne</w>.\r\n', NULL, 'col. 65', 'nairne 1');
