INSERT INTO `reading` VALUES(18063, 'Pellec', 9, 1067, 'YAdd.1066', '1066', '', '\r\n<w type="hw" lemma="pellec 1">Pellec</w> .i. <w>bél</w>-<w>ecc</w> .i. <w>ec</w> <w>ina</w> <w>bél</w>. <w>no</w> <w>pellet</w> .i. <w>pell</w>-<w>set</w> .i. <w>seta</w> <w>pellis</w> <w>impi</w> .i. a <w>croicend</w>.\r\n', 'YAdd', 'col. 76', 'pellec 1');
