INSERT INTO `reading` VALUES(18068, 'Partchuine', 9, 1071, 'YAdd.1070', '1070', '', '\r\n<w type="hw" lemma="portchaine">Partchuine</w> .i. <w xml:lang="lat">partem</w> <w xml:lang="lat">canis</w> <w xml:lang="lat">habens</w>. <w>no</w> <w xml:lang="lat">a</w> <w xml:lang="lat">part</w> <w>gontar</w> <w>hí</w>. <w>no</w> <w xml:lang="lat">a</w> <w xml:lang="lat">parta</w> <w xml:lang="lat">communi</w>.\r\n', 'YAdd', 'col. 76', 'portchaine');
