INSERT INTO `reading` VALUES(18073, 'Poll', 9, 1076, 'YAdd.1075', '1075', '', '\r\n<w type="hw" lemma="poll">Poll</w> <w xml:lang="lat">quasi</w> <w>toll</w>, ⁊ <w>cendfochrass</w> <w>tossaigh</w> <w>uil</w> <w>ann</w>.\r\n', 'YAdd', 'col. 76', 'poll');
INSERT INTO `reading` VALUES(18074, 'Penning', 9, 1077, 'YAdd.1076', '1076', '', '\r\n<w type="hw" lemma="penning">Penning</w> <w xml:lang="lat">quasi</w> <w>pan</w>-<w>ung</w> .i. <w xml:lang="lat">pars</w> <w xml:lang="lat">in</w> <w xml:lang="lat">uncio</w>. <w>no</w> <w>bend</w>-<w>ing</w> .i. a n-<w>ingnais</w> a <w>bend</w> <w>bíss</w> .i. <w>cruind</w>.\r\n', 'YAdd', 'col. 76', 'penning');
INSERT INTO `reading` VALUES(18075, 'Pol', 9, 1078, 'YAdd.1077', '1077', NULL, '\r\n<w type="hw" lemma="Pól">Pol</w> <w xml:lang="lat">quasi</w> <w>Paulo</w>. <cb n="col. 77"/>\r\n', 'YAdd', 'col. 76', 'Pól');
INSERT INTO `reading` VALUES(18076, 'Rechtaire', 9, 1079, 'Y.1078', '1078', '', '\r\n<w type="hw" lemma="rechtaire">Rechtaire</w> .i. <w xml:lang="lat">rector</w> <w xml:lang="lat">a</w> <w xml:lang="lat">rege</w>.\r\n', NULL, 'col. 77', 'rechtaire');
INSERT INTO `reading` VALUES(18077, 'Ross', 9, 1080, 'Y.1079', '1079', '', '\r\n<w type="hw" lemma="ros 1">Ross</w> .i. <w>trede</w> <w>fordingair</w> .i. <w>ros</w> <w>fidbuide</w>, <w>ros</w> <w>lin</w> ⁊ <w>ros</w> <w>uisce</w>. <w>sain</w> <w>didiu</w> <w>accuis</w> <w>as</w> <w>rohainmniged</w> <w>cach</w> <w>ae</w>. <w>ross</w> <w>fidbaide</w> <w>cetamna</w> .i. <w>reoi</w>-<w>oss</w>. <w>ros</w> <w>lin</w> <w>dano</w> .i. <w>ro</w>-<w>ass</w>. <w>ros</w> <w>uisoe</w> <w>dano</w> .i. <w>rofos</w> <w>on</w>, <w>ar</w> <w>ni</w> <w>bi</w> <w>acht</w> <w>for</w> <w>marbuisce</w>.\r\n', NULL, 'col. 77', 'ros 1');
INSERT INTO `reading` VALUES(18080, 'Remm', 9, 1081, 'Y.1080', '1080', '', '\r\n<w type="hw" lemma="réim(m) 1">Remm</w> <w xml:lang="lat">nomen</w> <w>do</w> <w>fuirseoir</w> <w>fobith</w> <w>cach</w> <w>riastardæ</w> <w>dobeir</w> <w>for</w> a <w>agaid</w>.\r\n', NULL, 'col. 77', 'réim(m) 1');
INSERT INTO `reading` VALUES(18081, 'Rinntaid', 9, 1082, 'Y.1081', '1081', '', '\r\n<w type="hw" lemma="rindaid 1">Rinntaid</w> .i. <w xml:lang="lat">nomen</w> <w>do</w> <w>fir</w> <w>aorchaid</w> <w>rindass</w> <w>cach</w> n-<w>aghaid</w>.\r\n', NULL, 'col. 77', 'rindaid 1');
INSERT INTO `reading` VALUES(18082, 'Rout', 9, 1083, 'Y.1082', '1082', '', '\r\n<w type="hw" lemma="rót 1">Rout</w> .i. <w>roro</w>-ṡet .i. <w>mo</w> <w>oldas</w> <w>set</w>, <w xml:lang="lat">semita</w> <w>son</w> <w xml:lang="lat">unius</w> <w xml:lang="lat">animalis</w>. <w>atat</w> <w>tra</w> <w>ilanmand</w> <w>for</w> <w>na</w> <w>conaraib</w> .i. <w>set</w> ⁊ <w>rout</w> ⁊ <w>ramat</w> ⁊ <w>slighe</w> ⁊ <w>lamrotæ</w> ⁊ <w>tuagrotæ</w> ⁊ <w>bothur</w>. <w>Set</w> <w>cétamus</w> <w xml:lang="lat">ut</w> <w xml:lang="lat">predictus</w>. <w>Rout</w> .i. <w>da</w> <w>cubat</w> <w>carpat</w> ⁊ <w>da</w> <w>onechdae</w> <w>imme</w>. <w>doronath</w> <w>fri</w> <w>hechroeta</w> <w>no</w> <w>fri</w> <w>hecraite</w> <w>mennota</w> <w>ar</w> <w>medon</w>. <w>Ramut</w> .i. <w>mo</w> <w>oldas</w> <w>rout</w> .i. <w>aurscor</w> <w>bis</w> <w>ann</w> <w>ar</w> <w>dun</w> <w>rig</w>. <w>cach</w> <w>comaithech</w> <w>asa</w> <w>tir</w> <w>dotroich</w>, <w>dlegar</w> <w>de</w> a <w>glanad</w>. <w>Slige</w> <w>dano</w>, <w>doscuet</w> <w>carpait</w> <w>sech</w> <w>alaile</w>. <w>dorronad</w> <w>fri</w> <w>himcomrac</w> <w>da</w> <w>charpat</w> .i. <w>carpat</w> <w>rig</w> ⁊ <w>carpit</w> <w>espuic</w> <w>ar</w> a <w>ndig</w> <w>cechtar</w> <w>dib</w> <w>sech</w> <w>araile</w>. <w>Lamrotæ</w> .i. <w>eter</w> <w>da</w> <w>slighe</w> .i. <w>slighe</w> <w>dar</w> <w>tuaiscert</w> <w>mennotæ</w>, <w>alaile</w> <w>tar</w> a <w>descert</w>. <w>fri</w> <w>lesa</w> <w>fri</w> <w>cui</w> <w>doronad</w>. <w>Tuagrottæ</w>, <w>fochren</w> <w>fer</w> <w>trebar</w> <w>conair</w> <w>do</w> <w>ascnam</w> <w>raotæ</w> <w>no</w> <w>sleibe</w>. <w>is</w> <w>si</w> <w>iarom</w> a <w>fochreicc</w>, <w>anam</w> <w>cach</w> <w>dine</w> <w>no</w> <w>cach</w> <w>mil</w> <w>immidret</w> <w>cach</w> <w>alablia</w> <cb n="col. 78"/> <w>Bothar</w>, <w>talla</w> <w>da</w> <w>boin</w> <w>fair</w> .i. <w>alanai</w> <w>for</w> <w>fot</w>, <w>alaile</w> fortarrsnǽ, <w>ara</w> <w>talla</w> a <w>lloigu</w> ⁊ a <w>ngamna</w> <w>ina</w> <w>farrad</w>, <w>ar</w> <w>mad</w> <w>ina</w> <w>ndiaig</w> <w>beit</w> <w>iurthass</w> <w>in</w> <w>bo</w> <w>bias</w> <w>dia</w> <w>eis</w>. <w>Atat</w> <w>tri</w> <w>glanta</w> <w>do</w> <w>cech</w> æ, <w>teora</w> <w>haimsera</w> a <w>nglanaiter</w>, <w>teora</w> <w>tucaite</w> <w>ara</w> <w>nglanaiter</w> <w>aimsir</w> <w>echruathair</w>, <w>aimsir</w> <w>chua</w>, <w>aimsir</w> <w>chocthæ</w>. <w>it</w> <w>eat</w> a <w>tri</w> <w>glanta</w> .i. <w>glanad</w> a <w>feda</w> ⁊ a <w>huisce</w> ⁊ a <w>coclaid</w>. <w>it</w> <w>he</w> <w>achuis</w> <w>ar</w> a <w>nglanaiter</w> .i. <w>arna</w> <w>heilnet</w> a <w>cairpthiu</w> <w>oc</w> <w>dal</w> <w>for</w> <w>cai</w> ⁊ <w>arna</w> <w>huilled</w> <w>echradæ</w> <w>oc</w> <w>techt</w> <w>do</w> <w>oenach</w>. a <w>coclaid</w> <w>arna</w> <w>esarlaither</w> <w>nech</w> <w>fair</w> <w>oc</w> <w>techt</w> <w>fo</w> <w>tressæ</w>. \r\n', NULL, 'col. 77', 'rót 1');
INSERT INTO `reading` VALUES(18083, 'Reo', 9, 1084, 'Y.1083', '1083', '', '\r\n<w type="hw" lemma="reód">Reo</w> .i. <w>grec</w> .i. <w xml:lang="grc">reo</w> <w xml:lang="lat">enim</w> <w xml:lang="lat">greco</w> <w xml:lang="lat">gelu</w> <w xml:lang="lat">interpretatur</w>.\r\n', NULL, 'col. 78', 'reód');
INSERT INTO `reading` VALUES(18084, 'Rincne', 9, 1085, 'Y.1084', '1084', '', '\r\n<w type="hw" lemma="rincne 1">Rincne</w> <w xml:lang="lat">quasi</w> <w xml:lang="lat">quinqui</w>. <w xml:lang="lat">unde</w> <w xml:lang="lat">dicitur</w> <w>Ferchess</w> <w>mac</w> <w>Mosecis</w> <w xml:lang="lat">dixit</w> <w>intan</w> <w>boi</w> <w>Find</w> <w>ua</w> <w>Baiscui</w> <w>oc</w> <w>airim</w> <w>cach</w> <w>coicir</w> <w>ar</w> n-<w>uair</w> <w>do</w> <w>sluag</w> <w>Luigdech</w> <w>maic</w> <w>Macniadh</w> <w>do</w> <w>chuinchidh</w> <w>ind</w> <w>fennedo</w> .i. <w>Ferchis</w>. <w>adacht</w> <w>Ferchess</w> <w>tren</w> <w>foa</w> <w>chnamæ</w> <w>sech</w> <w>find</w> ⁊ <w>dollieicci</w> <w>in</w> <w>slig</w> <w>for</w> <w>Lugaid</w> <w>conidromarb</w> ⁊ <w>asbert</w> <w>occa</w> <w>rincne</w> <w xml:lang="lat">quasi</w> <w>carincue</w> <w>rus</w> <w>rig</w> .i. <w>ar</w> <w>ba</w> <w>heth</w> <w>atbeired</w> <w>Find</w> <w>beus</w> o’trimed <w>cach</w> <w>coicer</w> a <w>uair</w>. <w>rincni</w> <w xml:lang="lat">quasi</w> <w xml:lang="lat">quinque</w>.\r\n', NULL, 'col. 78', 'rincne 1');
INSERT INTO `reading` VALUES(18085, 'Robuth', 9, 1086, 'Y.1085', '1085', '', '\r\n<w type="hw" lemma="robud">Robuth</w> <w xml:lang="lat">quasi</w> <w>rem</w>-<w>fuath</w>. <w>no</w> <w>robudh</w> <w>dino</w> .i. <w>rembuptadh</w> <w>bios</w>.\r\n', NULL, 'col. 78', 'robud');
