INSERT INTO `reading` VALUES(18088, 'Ruct', 9, 1089, 'Y.1088', '1088', '', '\r\n<w type="hw" lemma="rucht 1">Ruct</w> .i. <w>inar</w> , <w xml:lang="lat">unde</w> <w xml:lang="lat">dixit</w> <w>Ferqertni</w> <w>deich</w> <w>ructa</w> <w>dergæ</w>. \r\n', NULL, 'col. 78', 'rucht 1');
INSERT INTO `reading` VALUES(18089, 'Rudrud', 9, 1090, 'Y.1089', '1089', '', '\r\n<w type="hw" lemma="rudrad 1">Rudrud</w> .i. <w>ro</w>-<w>duradh</w>.\r\n', NULL, 'col. 78', 'rudrad 1');
INSERT INTO `reading` VALUES(18090, 'Ruam', 9, 1091, 'Y.1090', '1090', '', '\r\n<w type="hw" lemma="rúam 1">Ruam</w> <w xml:lang="lat">quasi</w> <w>rom</w> <w xml:lang="lat">a</w> <w xml:lang="lat">Romæ</w>.\r\n', NULL, 'col. 78', 'rúam 1');
INSERT INTO `reading` VALUES(18091, 'Ranc', 9, 1092, 'Y.1091', '1091', '', '\r\n<w type="hw" lemma="ranc 1">Ranc</w> <w>iss</w> <w>ed</w> <w>is</w> <w>seisind</w> <w>cenél</w> <w>na</w> <w>mæili</w>. <w>Ranc</w> <w>didiu</w>, <w>it</w> e <w>na</w> <w>huisin</w> <w>arda</w>. <w>Rach</w> <w>dna</w> <w>is</w> e <w>rout</w> <w>na</w> <w>maile</w> <w>otha</w> <w>ind</w> <w>etan</w> <w>na</w> <w>maile</w> <w>corricci</w> <w>in</w> <w>mullach</w>. <w>Romaile</w> .i. <w>eter</w> <w>in</w> <w>da</w> n-o <w>uili</w>. <w>Sal</w> <w>tria</w> <w>hassæ</w> .i. <w>as</w> a <w>firmullag</w> <w>moeltar</w> <w>side</w>, <w>co</w> <w>mmbi</w> a <w>caisi</w> <w>buidi</w> a <w>mullach</w> <w>amail</w> <w>sail</w> <w>duine</w> <w>tria</w> <w>assa</w>. <w>Bugereth</w> <w>dano</w>, <w>mael</w> a <w>cend</w> <w>uile</w> i <w>ssuidiu</w> <w>co</w> <w>mmbi</w> <w>glelomm</w>. <w>IMspelip</w> <w>dano</w> .i. <w>bid</w> <w>folt</w> <w>cechtar</w> <w>na</w> <w>da</w> <w>lethcend</w> ⁊ <w>bia</w> <w>imrot</w> <w>reid</w> <w>otha</w> <w>ind</w> <w>etan</w> <w>corrici</w> <w>in</w> <w>clais</w> <w>in</w> <w>da</w> <w>chuladh</w>. <w>it</w> <w>he</w> <w>tra</w> <w>in</w> <w>sin</w> <w>se</w> <w>ciniela</w> <w>na</w> <w>maili</w>.\r\n', NULL, 'col. 78', 'ranc 1');
INSERT INTO `reading` VALUES(18092, 'Rigan', 9, 1093, 'Y.1092', '1092', NULL, '\r\n<w type="hw" lemma="rígan">Rigan</w> <w xml:lang="lat">a</w> <w xml:lang="lat">regina</w>, ł <w xml:lang="lat">apud</w> <w xml:lang="lat">Scottass</w> <w>rig</w>, <w>rigan</w> <w>uaidi</w>. <cb n="col. 79"/>\r\n', NULL, 'col. 78', 'rígan');
