INSERT INTO `reading` VALUES(18095, 'Roscad', 9, 1096, 'Y.1095', '1095', '', '\r\n<w type="hw" lemma="roscad">Roscad</w> .i. <w>ro</w>-<w>indsciged</w> .i. <w>dodeochaidh</w> <w>inn</w>-<w>ord</w> n-<w>indsci</w>. <w>scath</w> .i. <w>indsce</w>.\r\n', NULL, 'col. 79', 'roscad');
INSERT INTO `reading` VALUES(18096, 'Relic', 9, 1097, 'Y.1096', '1096', '', '\r\n<w type="hw" lemma="reilic">Relic</w> .i. <w xml:lang="lat">a</w> <w xml:lang="lat">reliquis</w> <w xml:lang="lat">sanctorum</w>. <w>relic</w> <w>dano</w> .i. <w>rell</w> a <w>hec</w>, ł <w>hic</w>, ł <w>hocc</w>.\r\n', NULL, 'col. 79', 'reilic');
INSERT INTO `reading` VALUES(18097, 'Rop', 9, 1098, 'Y.1097', '1097', '', '\r\n<w type="hw" lemma="robb 1">Rop</w> ⁊ <w>Rap</w>. <w>Rop</w> <w>didiu</w> <w>nach</w> n-<w>anmann</w> <w>gonas</w>, <w>ut</w> <w>sant</w> <w>uacae</w>. <w>Rap</w> <w>immorro</w> <w>nach</w> n-<w>anmann</w> <w>dosrenga</w> <w>chugæ</w>, <w xml:lang="lat">ut</w> <w xml:lang="lat">sunt</w> <w xml:lang="lat">sues,</w> <w xml:lang="lat">sed</w> <w xml:lang="lat">tamen</w> <w xml:lang="lat">uicisimi</w> <w xml:lang="lat">comuniter</w> <w xml:lang="lat">dicuntur</w>. <w>Rap</w> <w>didiu</w> <w xml:lang="lat">ab</w> <w xml:lang="lat">eo</w> <w xml:lang="lat">quod</w> <w xml:lang="lat">est</w> <w xml:lang="lat">rapio</w>. <w>Rop</w> <w xml:lang="lat">ab</w> <w xml:lang="lat">eo</w> <w xml:lang="lat">quod</w> <w xml:lang="lat">est</w> <w xml:lang="lat">robustus</w>. \r\n', NULL, 'col. 79', 'robb 1');
