INSERT INTO `reading` VALUES(18196, 'Sethar', 9, 1198, 'YAdd.1196', '1196', 'PN; after T in YBL', '\r\n<w type="hw" lemma="Sethar">Sethar</w> <w xml:lang="lat">nomen</w> <w>do</w> <w>Dia</w>, <w xml:lang="lat">unde</w> <w xml:lang="lat">est</w> <w>isin</w> <w>tris</w> <w>tiganail</w> <w>Morainn</w> <w>maic</w> <w>Múin</w> <w>laind</w> <w>lais</w> <w>sethar</w> <w>sorar</w> .i. <w>lais</w> <w>ar</w> <w>siur</w> <w>anar</w> <w>ndainib</w> <w>la</w> <w>Dia</w> ⁊ <w>berid</w> <w>mac</w> <w>ndo</w> ⁊ <w>rl</w>. ⁊ <w>bid</w> <w>aonta</w> <w>do</w> <w>fri</w> <w>Dia</w> ⁊ <w>dosngegha</w> <w>ar</w> a <w>genus</w> ⁊ a <w>naibe</w> ⁊ a <w>feile</w> ⁊ <w>rl</w>. <w>ata</w> <w>dono</w> <w xml:lang="lat">nomen</w> <w>coibnesto</w> <w>don</w> <w>anmaim</w> <w>si</w> <w>isin</w> <w>Duil</w> <w>Feda</w> <w>Mair</w> .i. <w>sithothar</w> <w>cech</w> <w>tren</w>.\r\n', 'YAdd', 'col. 82', 'Sethar');
