INSERT INTO `reading` VALUES(18200, 'Toisc', 9, 1202, 'Y.1201', '1201', '', '\r\n<w type="hw" lemma="toisc">Toisc</w> .i. <w xml:lang="lat">uoluntas</w> <w xml:lang="lat">hominis</w>. <w>nach</w> <w>ni</w> <w>iarom</w> <w>is</w> <w>adlaic</w> ⁊ <w>is</w> <w>laind</w> <w>la</w> <w>duine</w> <w>is</w> <w>ed</w> <w>isbeir</w> <w>is</w> <w>toisc</w> <add>.i. <w>is</w> <w>tol</w> dam</add>.\r\n', NULL, 'col. 82', 'toisc');
INSERT INTO `reading` VALUES(18201, 'Triath', 9, 1203, 'Y.1202', '1202', '', '\r\n<w type="hw" lemma="tríath 1">Triath</w> <w>tra</w> <w>treidi</w> <w>fordingair</w> .i. <w>triath</w> <w>ri</w>, <w>triath</w> <w>muir</w>, <w>triath</w> <w>torc</w>. <w>deiligther</w> <w>didiu</w> <w>ina</w> <w>remmenaib</w> .i. <w>triath</w> <w>ri</w> <w>didiu</w>, <w>treith</w> a <w>reim</w>, <w>triath</w> <w>muir</w> .i. <w>trethan</w> a <w>reim</w>, <w>triath</w> <w>torc</w> .i. <w>tréithi</w> a <w>reim</w>. <w>triath</w> .i. <w>ri</w>, <w>tir</w>-<w>sith</w> a <w>taithmech</w>. <w>triath</w> .i. <w>muir</w>, <w>tir</w>-<w>uath</w> a <w>taithmech</w>. <w>triath</w> .i. <w>torc</w>, <w>tir</w>-<w>sod</w> a <w>taithmech</w>.\r\n', NULL, 'col. 82', 'tríath 1');
