INSERT INTO `reading` VALUES(18213, 'Temair', 9, 1213, 'Y.1212', '1212', '', '\r\n<w type="hw" lemma="temair">Temair</w> .i. <w>te</w>-<w>mur</w> .i. <w>mur</w> <w>tea</w> i<ex>ngin</ex>e <cb n="col. 83"/> <w>luigdech</w> <w>maic</w> <w>ithæ</w>. <w>Temair</w> .i. <w>grec</w> rotruaill<ex>ed</ex> <w>and</w> .i. <w xml:lang="grc">teomoro</w> <w xml:lang="lat">id</w> <w xml:lang="lat">est</w> <w xml:lang="lat">conspicio</w>. <w>Temair</w> <w>didiu</w> <w>cech</w> <w>locc</w> <w>as</w> <w>mbi</w> <w>aurgnam</w> <w>deicsi</w> <w>iter</w> <w>mag</w> ⁊ tech{?}, <w xml:lang="lat">ut</w> <w xml:lang="lat">dicitur</w> <w>temair</w> <w>na</w> <w>tuaithe</w> ⁊ <w>temair</w> <w>in</w> <w>tighe</w>.\r\n', NULL, 'col. 82', 'temair');
