INSERT INTO `reading` VALUES(18225, 'Tuirigin', 9, 1225, 'Y.1224', '1224', '', '\r\n<w type="hw" lemma="tuirigin">Tuirigin</w> .i. <w>tuili</w>-<w>gen</w> .i. <w>gein</w> <w>tolin</w> .i. <w>tolin</w> a <w>fir</w> <w>asind</w> <w>aicniud</w> <w>co</w> n-<w>oenaigedar</w> <w>fri</w> <w>fir</w> <w>na</w> <w>screptra</w>. <w xml:lang="lat">ailiter</w> <w>tuirigin</w> .i. <w>tuir</w> <w>in</w> <w>gena</w> <w>is</w> e <w>do</w> <w>tenga</w>. <w xml:lang="lat">aliter</w> <w>tuirigin</w> <w xml:lang="lat">quasi</w> <w>gein</w> a <w>tuir</w> .i. <w>amail</w> <w>bis</w> <w>tair</w> <w>már</w> <w>oc</w> <w>fulang</w> <w>tige</w> ⁊ <w>illama</w> <w>esti</w>, <w>sic</w> <w>is</w> <w>ed</w> <w>in</w> <w>teg</w> <w>in</w> <w>domun</w> <w>centurach</w>, <w>isi</w> <w>immorro</w> <w>in</w> <w>tuir</w> <w>firinde</w> <w>rechta</w> <w>aicuid</w>. <w>it</w> e <w>na</w> <w>illama</w> <w>asin</w> <w>tuirid</w> .i. <w>ilchiallæ</w> ⁊ <w>ilchonaire</w> <w>in</w> <w>brethemnuis</w>. <w xml:lang="lat">aliter</w> <w>tuingiu</w> <add>.i. ri</add> <w>amail</w> <w>asberar</w> <w>isin</w> <w>Duil</w> <w>Roscadaig</w> <w>ni</w> <w>tulach</w> .i. <w>fri</w> <w>tuirigin</w> <w>tuigethar</w> <w>tuile</w> <w>mar</w> <w>muirne</w>. <w xml:lang="lat">aliter</w> <w>tuirigin</w> .i. <w>torracht</w>-<w>gein</w> .i. <w>gein</w> <w>tonacht</w> <w>torroich</w> <w>as</w> <w>gach</w> <w>aigniud</w> i n-<w>alaill</w> .i. <w>gein</w> <w>in</w> <w>firaicnid</w>, <w>ut</w> <w>Fachtai</w> <w>mac</w> <w>Senchai</w> <w xml:lang="lat">dixit</w> <w>fuirem</w> <w>gein</w> <w>torrachta</w> <w>doreith</w> <w>aicued</w> n-<w>oll</w> o <w>Adam</w> <w>co</w> n-<w>imteit</w> <w>tre</w> <w>gach</w> n-<w>aimsir</w> n-<w>adamra</w> <w>co</w> <w>betha</w> <w>bruth</w>. <w>berid</w> <w>aicued</w> <w>enbethæ</w> <w>di</w> <w>cach</w> <w>duil</w> <w>derb</w> <w>deisin</w> <w>oen</w> <w>connoe</w> .i. <w>coss</w> <w>in</w> <w>duine</w> <w>ndedenaig</w> <w>bias</w> <w>co</w> <w>bruindi</w> <w>brathæ</w>. <w xml:lang="lat">aliter</w> <w>tuiregin</w> .i. <w>toaerægein</w> <add>.i. <w>gein</w> naræ</add> .i. <w>gein</w> <w>ngenethar</w> ⁊ a <w>da</w> <w>chois</w> <w>riam</w> ⁊ a <w>chend</w> <w>fadeoid</w>. <w>dobeir</w> <w>didiu</w> <w>in</w> <w>tuirigin</w> <w>sin</w> a <w>chosmailis</w> <w>brethe</w> <w>emnaide</w> .i. <w>canaid</w> <w>in</w> <w>breithem</w> <w>fassach</w> <w>firaicnid</w> ⁊ <w>roscadh</w> <w>filed</w>, <w>da</w> <w>cois</w> <w>ina</w> <w>brethe</w> <w>in</w> <w>sin</w>, a <w>cend</w> <w>fadeoig</w> .i. <w>in</w> <w>testemain</w> <w>canoine</w>. <w xml:lang="lat">unde</w> <w xml:lang="lat">dicitur</w> <cb n="col. 84"/> <w>ni</w> <w>ni</w> <w>nach</w> <w>breth</w> <w>berar</w> <w>na</w> <w>bidh</w> <w>fri</w> <w>leigend</w> <w>leir</w> <w>leirigther</w>, <w>na</w> <w>bi</w> <w>fri</w> <w>canoin</w> <w>caid</w> <w>cumthastar</w>, <w>nad</w> <w>fri</w> <w>hapstal</w> n-<w>uasal</w> n-<w>astaigther</w>, <w>nad</w> <w>fri</w> <w>Spirat</w> <w>Noem</w> <w>nertaigther</w>, <w>ar</w> <w>is</w> <w>cad</w> <w>cach</w> <w>ret</w> <w>co</w> <w>canoine</w> <w>comuaim</w>.\r\n', NULL, 'col. 83', 'tuirigin');
