INSERT INTO `reading` VALUES(18227, 'Turud', 9, 1227, 'Y.1226', '1226', '', '\r\n<w type="hw" lemma="turad 1">Turud</w> .i. <w>tur</w>-<w>suth</w> .i. <w>tur</w> <w>cech</w> <w>tirim</w> ⁊ <w>suth</w> <w>sin</w>. turṡuth <w>didiu</w> .i. <w>sin</w> <w>tirim</w>.\r\n', NULL, 'col. 84', 'turad 1');
INSERT INTO `reading` VALUES(18228, 'Torc', 9, 1228, 'Y.1227', '1227', '', '\r\n<w type="hw" lemma="torc 1">Torc</w> .i. <w>craide</w>. <w xml:lang="lat">unde</w> <w>Etan</w> <w>ingen</w> <w>Diancecht</w> <w xml:lang="lat">dixit</w> i <w>fondam</w> <w>mo</w> <w>thuirc</w> .i. i <w>fogluasacht</w> <w>mo</w> <w>chride</w>.\r\n', NULL, 'col. 84', 'torc 1');
INSERT INTO `reading` VALUES(18229, 'Trefocul', 9, 1229, 'Y.1228', '1228', '', '\r\n<w type="hw" lemma="trefhocal">Trefocul</w> .i. <w>tri</w> <w>focla</w> <w>bite</w> <w>inde</w> .i. <w>da</w> <w>focul</w> <w>do</w> <w>molad</w> <w>do</w> <w>brith</w> <w>for</w> <w>cula</w> <w>ind</w> <w>imdergthæ</w> <w>dofarci</w> <w>in</w> <w>tris</w> <w>focul</w> .i. <w>focul</w> <w>ind</w> <w>imdergthæ</w> ⁊ <w>aire</w>.\r\n', NULL, 'col. 84', 'trefhocal');
INSERT INTO `reading` VALUES(18230, 'Turthaid', 9, 1230, 'Y.1229', '1229', '', '\r\n<w type="hw" lemma="turtugud 1">Turthaid</w> .i. <w>taurrachtid</w> .i. <w xml:lang="lat">uerbia</w> <w xml:lang="lat">gratia</w>, <w>focheirdi</w> <w>erchor</w> <w>uait</w> <w>do</w> <w>ermaisin</w> <w>nach</w> <w>retæ</w>. <w>docuirethar</w> <w>obonn</w> <w>anmannæ</w> <w>ar</w> a <w>chind</w> ⁊ <w>gonta</w> <w>no</w> <w>benta</w> <w>no</w> <w>marbthæ</w> a <w>rrec</w> <w>don</w> <w>turacht</w> <w>sin</w>, <w>iarom</w> <w>asberar</w> <w>turthait</w>.\r\n', NULL, 'col. 84', 'turtugud 1');
INSERT INTO `reading` VALUES(18231, 'Tigradus', 9, 1231, 'Y.1230', '1230', '', '\r\n<w type="hw" lemma="tiugradus">Tigradus</w> .i. <w>tig</w>-<w>urradus</w> .i. <w>tigba</w> <w>gach</w> <w>ndedenach</w>. <w>is</w> e <w>didiu</w> <w>is</w> <w>tigba</w> ⁊ <w>is</w> <w>tigurradus</w> .i. <w>inti</w> <w>scarus</w> <w>frisin</w> <w>máin</w> <w>no</w> <w>frisin</w> <w>aon</w> <w>fadeoid</w>.\r\n', NULL, 'col. 84', 'tiugradus');
INSERT INTO `reading` VALUES(18232, 'Tuigen', 9, 1232, 'Y.1231', '1231', '', '\r\n<w type="hw" lemma="tuigen">Tuigen</w> <w xml:lang="lat">quasi</w> <w>togen</w> .i. <w xml:lang="lat">a</w> <w xml:lang="lat">toga</w>. <w xml:lang="lat">toga</w> <w xml:lang="lat">enim</w> <w xml:lang="lat">genus</w> <w xml:lang="lat">est</w> <w xml:lang="lat">precioti</w> <w xml:lang="lat">uestis</w>. <w xml:lang="lat">aliter</w> <w>tuighen</w> .i. <w>tuge</w> <w>en</w> <w>ar</w> <w>is</w> <w>do</w> <w>chroicnib</w> <w>en</w> <w>finn</w> ⁊ <w>ildathach</w> <w>dognither</w> <w>in</w> <w>tuigen</w> <w>filed</w> o a <w>chris</w> <w>sis</w>, ⁊ <w>do</w> <w>braigdib</w> <w>cailech</w> <w>loichen</w> ⁊ <w>dia</w> <w>cuircib</w> o <w>cris</w> <w>suas</w> <w>co</w> <w>mbraigit</w>.\r\n', NULL, 'col. 84', 'tuigen');
INSERT INTO `reading` VALUES(18233, 'Tap', 9, 1233, 'Y.1232', '1232', '', '\r\n<w type="hw" lemma="tap 1">Tap</w> .i. <w>obann</w> <w>no</w> <w>bidg</w> <w xml:lang="lat">ut</w> <w xml:lang="lat">dicitur</w> <w>ni</w> <w>beir</w> <w>tap</w> <w>tigradus</w> <w>is</w> <w>aiti</w> <w>araciallathar</w> <w>tassic</w> <w>an</w> <w>opund</w>.\r\n', NULL, 'col. 84', 'tap 1');
INSERT INTO `reading` VALUES(18234, 'Tamlachta', 9, 1234, 'Y.1233', '1233', '', '\r\n<w type="hw" lemma="Tamlachta(e)">Tamlachta</w> .i. <w>tamlechta</w> .i. <w>tam</w> <w>roselaig</w> <w>na</w> <w>daine</w> <w>isin</w> <w>maigin</w> <w>sin</w> .i. <w>duinebad</w> <w>mor</w>. <w>doteigtis</w> <w>na</w> <w>tuatha</w> <w>im</w>-<w>muigib</w> <w>moraib</w> .i. <w>co</w> <w>mbidis</w> <w>ind</w>-<w>aenmaigin</w> <w>beus</w> <w>fria</w> n-<w>eg</w>, <w>fobith</w> a n-<w>adnacuil</w> <w>isna</w> <w>muigib</w> <w>sin</w> <w>ondi</w> <w>nad</w> <w>bereth</w> <w>in</w> <w>duineba</w>. <w>ar</w> <w>mad</w> <w>cach</w> <w>ar</w> <w>uair</w> <w>dib</w> <w>ba</w> <w>marb</w> <w>ina</w> <w>maigin</w> <w>fadein</w>, <w>ni</w> <w>berdis</w> <w>dia</w> <w>celluib</w>, <w>ar</w> <w>ni</w> <w>chumcath</w> <w>in</w> <w>tuathad</w> <w>nobid</w> <w>ina</w> <w>mbethaid</w> <w>dar</w> a n-<w>eisi</w>, <w xml:lang="lat">et</w> <w xml:lang="lat">inde</w> <w xml:lang="lat">nuncupantur</w> <w>Tamlachta</w>.\r\n', NULL, 'col. 84', 'Tamlachta(e)');
INSERT INTO `reading` VALUES(18235, 'Tendal', 9, 1235, 'Y.1234', '1234', '', '\r\n<w type="hw" lemma="tendál">Tendal</w> .i. <cb n="col. 85"/> <w>tene</w>-<w>dal</w> .i. <w>dal</w> <w>co</w> <w>teinid</w> .i. <w>cusin</w> <w>inad</w> <w>in</w>-<w>ataither</w> <w>tendal</w>.\r\n', NULL, 'col. 84', 'tendál');
INSERT INTO `reading` VALUES(18236, 'Traig', 9, 1236, 'YAdd.1235', '1235', '', '\r\n<w type="hw" lemma="traig 1">Traig</w> <w xml:lang="lat">a</w> <w xml:lang="lat">tractu</w>, ł <w xml:lang="lat">quasi</w> <w>ter</w>-<w>rig</w> .i. <w>rig</w> <w xml:lang="lat">terram</w>, <w>ar</w> <w>isi</w> <w>benas</w> <w>fri</w> <w>lar</w>.\r\n', 'YAdd', 'col. 85', 'traig 1');
INSERT INTO `reading` VALUES(18237, 'Truid', 9, 1237, 'YAdd.1236', '1236', '', '\r\n<w type="hw" lemma="truit">Truid</w> .i. <w>on</w> <w>treod</w> i <w>mbi</w> <w>asberad</w>, <w>no</w> <w>on</w> <w>traide</w> .i. <w>on</w> <w>luas</w> <w>doni</w>.\r\n', 'YAdd', 'col. 85', 'truit');
INSERT INTO `reading` VALUES(18238, 'Tru', 9, 1238, 'YAdd.1237', '1237', '', '\r\n<w type="hw" lemma="trú">Tru</w> <w xml:lang="lat">quasi</w> <w>do</w>-<w>ru</w> .i. <w>doig</w> a <w>tuitim</w>, <w xml:lang="lat">a</w> <w xml:lang="lat">uerbo</w> <w xml:lang="lat">ruo</w>. ł <w>ti</w>-<w>ru</w>, <w>ar</w> <w>ti</w> <w>tuitme</w> <w>ata</w>. ł <w xml:lang="lat">a</w> <w xml:lang="lat">Troia</w> <w xml:lang="lat">dicitur</w> .i. <w>ar</w> a <w>mince</w> a <w>hairsen</w>.\r\n', 'YAdd', 'col. 85', 'trú');
INSERT INTO `reading` VALUES(18239, 'Truagh', 9, 1239, 'YAdd.1238', '1238', '', '\r\n<w type="hw" lemma="trúag">Truagh</w> .i. <w>tru</w>-<w>agh</w> .i. <w>agusta</w> <w>do</w> <w>gurab</w> <w>tru</w>.\r\n', 'YAdd', 'col. 85', 'trúag');
INSERT INTO `reading` VALUES(18240, 'Torsi', 9, 1240, 'YAdd.1239', '1239', '', '\r\n<w type="hw" lemma="toirse">Torsi</w> .i. <w>tor</w> <w>gach</w> <w>tromm</w> .i. <w>tromsi</w> <w>hi</w>.\r\n', 'YAdd', 'col. 85', 'toirse');
INSERT INTO `reading` VALUES(18241, 'Truail', 9, 1241, 'YAdd.1240', '1240', '', '\r\n<w type="hw" lemma="trúaill 1">Truail</w> .i. <w>dir</w> <w>uailli</w> í.\r\n', 'YAdd', 'col. 85', 'trúaill 1');
INSERT INTO `reading` VALUES(18242, 'Tellair', 9, 1242, 'YAdd.1241', '1241', '', '\r\n<w type="hw" lemma="tellair">Tellair</w> i.e. <w xml:lang="lat">a</w> <w xml:lang="lat">tellure</w>.\r\n', 'YAdd', 'col. 85', 'tellair');
INSERT INTO `reading` VALUES(18243, 'Tarathar', 9, 1243, 'YAdd.1242', '1242', '', '\r\n<w type="hw" lemma="tarathar">Tarathar</w> <w xml:lang="lat">quasi</w> <w>dair</w>-<w>uath</w>-<w>air</w> .i. <w>fuath</w> <w>na</w> <w>darach</w> <w>bis</w> <w>fair</w> .i. <w>ar</w> a <w>sice</w>-<w>si</w> <w>ém</w>.\r\n', 'YAdd', 'col. 85', 'tarathar');
INSERT INTO `reading` VALUES(18244, 'Tonn', 9, 1244, 'YAdd.1243', '1243', '', '\r\n<w type="hw" lemma="tonn 1">Tonn</w> <w xml:lang="lat">a</w> <w xml:lang="lat">uerbo</w> <w xml:lang="lat">tundo.</w> ł <w xml:lang="lat">a</w> <w xml:lang="lat">tondeo</w> .i. <w>ar</w> <w>berraid</w> <w>in</w> <w>fer</w> <w>don</w> <w>murbach</w>.\r\n', 'YAdd', 'col. 85', 'tonn 1');
INSERT INTO `reading` VALUES(18245, 'Turesc', 9, 1245, 'YAdd.1244', '1244', '', '\r\n<w type="hw" lemma="tuiresg">Turesc</w> .i. <w>tar</w>-<w>escc</w> .i. <w>tairis</w> <w>tescas</w> <w>cach</w> <w>ni</w>. <w>no</w> <w>diriuch</w> <w>tescas</w>.\r\n', 'YAdd', 'col. 85', 'tuiresg');
INSERT INTO `reading` VALUES(18246, 'Tulach', 9, 1246, 'YAdd.1245', '1245', '', '\r\n<w type="hw" lemma="tulach 1">Tulach</w> <w xml:lang="lat">quasi</w> <w>tul</w>-<w>uach</w> .i. <w>uacht</w> <w>inti</w> ⁊ <w>sí</w> <w>na</w> <w>tul</w> .i. <w>nocht</w>, <w>ar</w> <w>is</w> <w>tul</w> <w>gach</w> <w>nocht</w>.\r\n', 'YAdd', 'col. 85', 'tulach 1');
INSERT INTO `reading` VALUES(18247, 'Tairsech', 9, 1247, 'YAdd.1246', '1246', '', '\r\n<w type="hw" lemma="tairsech">Tairsech</w> .i. <w>tairis</w> <w>astech</w> <w>tiagair</w>.\r\n', 'YAdd', 'col. 85', 'tairsech');
INSERT INTO `reading` VALUES(18248, 'Tenga', 9, 1248, 'YAdd.1247', '1247', '', '\r\n<w type="hw" lemma="tengae">Tenga</w> .i. <w>te</w> i a <add>i</add> <w>ngabann</w> <w>si</w> .i. <w>in</w> <w>bel</w> <w>tall</w>.\r\n', 'YAdd', 'col. 85', 'tengae');
INSERT INTO `reading` VALUES(18249, 'Troid', 9, 1249, 'YAdd.1248', '1248', '', '\r\n<w type="hw" lemma="trait">Troid</w> .i. <w>obann</w> í, <w>no</w> <w>luath</w>, <w xml:lang="lat">unde</w> <w xml:lang="lat">dicitur</w> <w>ticfa</w> i <w>traite</w> .i. <w>co</w> <w>luath</w>. ł <w xml:lang="lat">quasi</w> <w>trú</w>-<w>ait</w> .i. <w>ait</w> i <w>la</w> <w>troich</w>.\r\n', 'YAdd', 'col. 85', 'trait');
INSERT INTO `reading` VALUES(18250, 'Traill', 9, 1250, 'YAdd.1249', '1249', '', '\r\n<w type="hw" lemma="tráill">Traill</w> <w xml:lang="lat">a</w> <w xml:lang="lat">nomine</w> <w xml:lang="lat">truila</w> .i. <w>lossat</w> .i. <w>ar</w> <w>dóire</w> a <w>fognama</w>.\r\n', 'YAdd', 'col. 85', 'tráill');
INSERT INTO `reading` VALUES(18251, 'Taccad', 9, 1251, 'YAdd.1250', '1250', '', '\r\n<w type="hw" lemma="tocad">Taccad</w> .i. <w>ti</w>-<w>caid</w>, i.e. <w>ar</w> <w>ti</w> <w>cadhussa</w> <w>bis</w>, <w>no</w> <w>ar</w> <w>ti</w> <w>chuad</w> <w>ata</w>.\r\n', 'YAdd', 'col. 85', 'tocad');
INSERT INTO `reading` VALUES(18252, 'Tir', 9, 1252, 'YAdd.1251', '1251', '', '\r\n<w type="hw" lemma="tír 1">Tir</w> i.e. <w xml:lang="lat">a</w> <w xml:lang="lat">terra</w>.\r\n', 'YAdd', 'col. 85', 'tír 1');
INSERT INTO `reading` VALUES(18253, 'Tunti lin', 9, 1253, 'YAdd.1252', '1252', '', '\r\n<w type="hw" lemma="tuinnte 1">Tunti lin</w> <w xml:lang="lat">a</w> <w xml:lang="lat">uerbo</w> <w xml:lang="lat">tundo</w>.\r\n', 'YAdd', 'col. 85', 'tuinnte 1');
INSERT INTO `reading` VALUES(18254, 'Traigli', 9, 1254, 'YAdd.1253', '1253', '', '\r\n<w type="hw" lemma="traigle">Traigli</w> .i. <w>traig</w> a <w>lethet</w>. <w>no</w> <w>da</w> <w>raigled</w> <w>doberar</w> <w>fair</w> <w>ic</w> a <w>beim</w> <w>fein</w> <w>dia</w> <w>thoebaib</w>. <w>no</w> <w>trog</w>-<w>iall</w>-e .i. a <w>ialla</w> <w>fein</w>, <w>is</w> e a <w>trog</w> .i. a <w>clann</w>.\r\n', 'YAdd', 'col. 85', 'traigle');
INSERT INTO `reading` VALUES(18255, 'Tast', 9, 1255, 'YAdd.1254', '1254', '', '\r\n<w type="hw" lemma="tost">Tast</w> .i. <w>tæ</w>-<w>astas</w> <w>he</w>.\r\n', 'YAdd', 'col. 85', 'tost');
INSERT INTO `reading` VALUES(18256, 'Tiag', 9, 1256, 'YAdd.1255', '1255', '', '\r\n<w type="hw" lemma="tíag">Tiag</w> <w>on</w> <w xml:lang="lat">toga</w>, <w>ar</w> <w>is</w> <w>taga</w> <w>set</w> <w>bis</w> <w>inti</w>. ł <w xml:lang="lat">a</w> <w xml:lang="lat">tego</w>.\r\n', 'YAdd', 'col. 85', 'tíag');
INSERT INTO `reading` VALUES(18257, 'Ton', 9, 1257, 'YAdd.1256', '1256', '', '\r\n<w type="hw" lemma="tón">Ton</w> <w xml:lang="lat">a</w> <w xml:lang="lat">tonitro</w> .i. <w>on</w> <w>torainn</w> <w>bis</w> <w>inti</w>, ł <w xml:lang="lat">a</w> <w xml:lang="lat">tono</w>, <w>fograigim</w>.\r\n', 'YAdd', 'col. 85', 'tón');
INSERT INTO `reading` VALUES(18258, 'Tarrach', 9, 1258, 'YAdd.1257', '1257', '', '\r\n<w type="hw" lemma="tarrach">Tarrach</w> .i. <w>uamnach</w>, <w xml:lang="lat">quia</w> <w xml:lang="lat">fit</w> <w>tor</w> .i. <w>ecla</w>.\r\n', 'YAdd', 'col. 85', 'tarrach');
INSERT INTO `reading` VALUES(18259, 'Timpan', 9, 1259, 'YAdd.1258', '1258', '', '\r\n<w type="hw" lemma="timpán">Timpan</w> .i. <w>tim</w> .i. <w>sail</w> ⁊ <w>ban</w> .i. <w>umæ</w> <w>bis</w> <w>inti</w>. ł <w xml:lang="lat">quasi</w> <w>simpan</w> <w xml:lang="lat">a</w> <w xml:lang="lat">simphonia</w> .i. <w>on</w> <w>bindius</w>.\r\n', 'YAdd', 'col. 85', 'timpán');
INSERT INTO `reading` VALUES(18260, 'Tagra', 9, 1260, 'YAdd.1259', '1259', '', '\r\n<w type="hw" lemma="tacra">Tagra</w> <w xml:lang="lat">quasi</w> <w>dagra</w> .i. <w>da</w> n-<w>agra</w> <w>bis</w> <w>ann</w>.\r\n', 'YAdd', 'col. 85', 'tacra');
INSERT INTO `reading` VALUES(18261, 'Tustall', 9, 1261, 'YAdd.1260', '1260', '', '\r\n<w type="hw" lemma="tustall">Tustall</w> .i. <w>ar</w> <w>tus</w> <w>toltair</w> <w>riasin</w> <w>leim</w>.\r\n', 'YAdd', 'col. 85', 'tustall');
INSERT INTO `reading` VALUES(18262, 'Termondd', 9, 1262, 'YAdd.1261', '1261', '', '\r\n<w type="hw" lemma="termonn">Termondd</w> .i. <w>tirma</w> a <w>maine</w> <w>cin</w> a <w>funchad</w> <w>imuich</w>.\r\n', 'YAdd', 'col. 85', 'termonn');
INSERT INTO `reading` VALUES(18263, 'Tairr', 9, 1263, 'YAdd.1262', '1262', '', '\r\n<w type="hw" lemma="tarr">Tairr</w> .i. <w>arinni</w> <w>taircther</w> <w>ind</w> <w>cach</w> <w>biad</w>.\r\n', 'YAdd', 'col. 85', 'tarr');
INSERT INTO `reading` VALUES(18264, 'Tar', 9, 1264, 'YAdd.1263', '1263', '', '\r\n<w type="hw" lemma="tar 3">Tar</w> .i. <w>olc</w>, <w xml:lang="lat">unde</w> <w>rothar</w> .i. <w>roolc</w>.\r\n', 'YAdd', 'col. 85', 'tar 3');
INSERT INTO `reading` VALUES(18265, 'Torrach', 9, 1265, 'YAdd.1264', '1264', '', '\r\n<w type="hw" lemma="torrach">Torrach</w> <w xml:lang="lat">quasi</w> <w>tairr</w>-<w>recht</w> .i. <w>roracht</w> a <w>bru</w> <w>immon</w> <w>ngein</w>. <cb n="col. 86"/>\r\n', 'YAdd', 'col. 85', 'torrach');
INSERT INTO `reading` VALUES(18266, 'Trefot', 9, 1266, 'YAdd.1265', '1265', '', '\r\n<w type="hw" lemma="Trefóit">Trefot</w> .i. <w>Eriu</w> ⁊ <w>Manann</w> ⁊ <w>Albu</w>, <w xml:lang="lat">unde</w> <w xml:lang="lat">dicitur</w> <w>Tre</w>-<w>fot</w> .i. <w>tri</w> <w>foide</w> <w>menn</w> <w>dibertæ</w> <w>as</w> <w>cach</w> <w>tir</w> <w>dib</w> <w>co</w> <w>ndenta</w> <w>oenaicde</w> <w>dib</w> <w>tre</w> <w>druidecht</w> ⁊ <w>rl</w>. <w xml:lang="lat">inde</w> <w xml:lang="lat">dictum</w> <w xml:lang="lat">est</w> <w>ag</w> <w>togail</w> <w>Bruigne</w> <w>da</w> <w>Dergæ</w> <w>maidfe</w> <w>ri</w> <w>ala</w> <w>Fuada</w>. <w>cia</w> <w>asberar</w> <w>didiu</w> <w>Fuada</w>, <w xml:lang="lat">rectius</w> <w>Fotla</w> <w xml:lang="lat">dicitur,</w> <w xml:lang="lat">quae</w> <w xml:lang="lat">regina</w> <w xml:lang="lat">erat</w> <w xml:lang="lat">tertia</w> <w xml:lang="lat">istarum</w> <w xml:lang="lat">trium</w> <w xml:lang="lat">insolarum.</w> <w xml:lang="lat">Tres</w> <w xml:lang="lat">enim</w> <w xml:lang="lat">erant</w> <w xml:lang="lat">regine</w> .i. <w>Ere</w> <w>et</w> <w>Fotla</w> ⁊ <w>Banba</w>. <w xml:lang="lat">lege</w> <w>Gabala</w> <w>Erend</w> <w xml:lang="lat">si</w> <w xml:lang="lat">uis</w> <w xml:lang="lat">plenius</w> <w xml:lang="lat">scire</w>.\r\n', 'YAdd', 'col. 86', 'Trefóit');
INSERT INTO `reading` VALUES(18267, 'Tiag', 9, 1267, 'YAdd.1266', '1266', '', '\r\n<w type="hw" lemma="tíag">Tiag</w> <w xml:lang="lat">quasi</w> teg<w xml:lang="lat">,</w> ł <w xml:lang="lat">a</w> <w xml:lang="lat">nomine</w> <w xml:lang="lat">greco</w> <w xml:lang="lat">costodia,</w> <w xml:lang="lat">unde</w> <w xml:lang="lat">bibliotica</w> .i. <w xml:lang="lat">librorum</w> <w xml:lang="lat">costodia</w>.\r\n', 'YAdd', 'col. 86', 'tíag');
INSERT INTO `reading` VALUES(18268, 'Usarb', 9, 1268, 'Y.1267', '1267', '', '\r\n<w type="hw" lemma="us(s)arb">Usarb</w> .i. <w>bas</w>, <w xml:lang="lat">unde</w> <w xml:lang="lat">dicitur</w> <w>isind</w> <w>Amra</w> <w>Conroi</w> <w>ri</w> <w>rodet</w> <w>donsairb</w> <w>ind</w> <w>Ulltoib</w> .i. <w>rodet</w> <w>do</w> <w>Ulltaib</w> a <w>bas</w>.\r\n', NULL, 'col. 86', 'us(s)arb');
INSERT INTO `reading` VALUES(18269, 'Udmad', 9, 1269, 'Y.1268', '1268', '', '\r\n<w type="hw" lemma="udmad">Udmad</w> .i. <w>ud</w> ⁊ <w>damnad</w> .i. <w>crand</w> <w>ar</w> <w>lias</w> .i. <w>gobung</w> <w>gaibther</w> <w>forsin</w> <w>crand</w> <w>co</w> <w>ndamnaiter</w> a n-<w>ude</w> i <w>comulg</w>.\r\n', NULL, 'col. 86', 'udmad');
INSERT INTO `reading` VALUES(18270, 'Udim', 9, 1270, 'Y.1269', '1269', '', '\r\n<w type="hw" lemma="aidemm">Udim</w> .i. <w xml:lang="lat">nomen</w> <w>dona</w> <w>roi</w> <w>triasa</w> <w>teit</w> <w>in</w> <w>crand</w> <w>bis</w> <w>forsin</w> <w>cleith</w> <w>ocon</w> <w>udmad</w> <w>no</w> <w>occa</w> <w>dunad</w>.\r\n', NULL, 'col. 86', 'aidemm');
