INSERT INTO `reading` VALUES(19067, 'Noindin ulad', 2, 524, 'D1.524', '618.25', '', '\n<w type="hw" lemma="noínden 1">Noindin ulad</w> <w xml:lang="lat">quasi</w> <w xml:lang="lat">nouim</w> <w xml:lang="lat">dies</w>, <w>ar</w> <w>isí</w> <w>ré</w> <w>laithe</w> <w>bitis</w> <w>isin</w> <w>ces</w>.\n', NULL, 'p. 73a', 'noínden 1');
