INSERT INTO `reading` VALUES(20272, 'Dal dige', 10, 296, 'OM1.292', '292', '', '\n<w type="hw" lemma="dál 4">Dal dige</w> a <w>dalo</w> .i. <w>seol</w> <w>bac</w> <w>biss</w> i <w>mbraine</w> <w>muircobl<ex>aig</ex></w>. <w>nosdali</w> <w>iarum</w> <w>in</w> <w>tonn</w> <w>imbi</w>, <w xml:lang="lat">ut</w> <w xml:lang="lat">Isidorus</w> <w xml:lang="lat">dicit</w>. <w xml:lang="lat">Dalum</w> <w xml:lang="lat">minimum</w> <w xml:lang="lat">uelum</w> <w xml:lang="lat">ad</w> <w xml:lang="lat">proram</w> <w xml:lang="lat">defixum</w>. ł <w xml:lang="heb">dail</w> <w xml:lang="lat">ebraice</w> <w>dalilia</w> .i. <w xml:lang="lat">sithula</w> .i. <w>sithal</w>. \n', '§1', 'col. 99', 'dál 4');
