INSERT INTO `reading` VALUES(20372, 'Eim', 10, 397, 'OM1.390', '390', NULL, '\n<w type="hw" lemma="eim *">Eim</w> <w xml:lang="lat">ap</w> <w xml:lang="grc">ema</w> <w xml:lang="lat">grece</w>, <w xml:lang="lat">ema</w> <w xml:lang="lat">sanguis</w>, <w xml:lang="lat">quia</w> <w xml:lang="lat">flegmatæ</w> <w xml:lang="lat">frigita</w> <w xml:lang="lat">colera</w> <w xml:lang="lat">calida</w> <w xml:lang="lat">sanguis</w> <w xml:lang="lat">temperatus</w>. <w xml:lang="lat">IS</w> <w xml:lang="lat">eim</w> <w xml:lang="lat">lim</w> <w xml:lang="lat">didiu</w> <w xml:lang="lat">quicquid</w> <w xml:lang="lat">temperem</w> <w xml:lang="lat">praestat</w>. \n', '§1', 'col. 103', 'eim *');
INSERT INTO `reading` VALUES(20373, 'Emon', 10, 398, 'OM1.391', '391', '', '\n<w type="hw" lemma="emon 2">Emon</w> <w>airchitel</w>, <w>ar</w> <w>it</w> <w>cosmaili</w> a <w>da</w> <w>lethcomarc</w>, <w xml:lang="lat">unde</w> <w>anamain</w> <w xml:lang="lat">dicitur</w> .i. <w>ni</w> <w>emon</w> <w>acht</w> <w>is</w> <w>ceatarreig</w>.\n', '§1', 'col. 103', 'emon 2');
