INSERT INTO `reading` VALUES(20375, 'Émer', 10, 400, 'OM1.393', '393', '', '\n<w type="hw" lemma="eimer 1">Émer</w> .i. <w>ni</w> <w>gle</w>. <w xml:lang="grc">merum</w> <w xml:lang="lat">enim</w> <w xml:lang="lat">grece</w> <w xml:lang="lat">purum</w>, <w xml:lang="lat">unde</w> <w xml:lang="lat">meridiess</w> .i. <w>is</w> <w>emer</w>, <w>ni</w> <w>find</w> <w>in</w> <w>cloch</w>. \n', '§1', 'col. 103', 'eimer 1');
