INSERT INTO `reading` VALUES(20378, 'En', 10, 403, 'OM1.396', '396', '', '\n<w type="hw" lemma="én 1">En</w> <w xml:lang="lat">ebraice</w> <w xml:lang="heb">enean</w> .i. <w xml:lang="lat">nubess</w>, <w xml:lang="lat">quo</w> <w xml:lang="lat">sicut</w> <w xml:lang="lat">nubes</w> <w xml:lang="lat">uolunt</w> <w xml:lang="lat">aues</w>. ł <w>eoin</w> <w xml:lang="lat">ap</w> <w xml:lang="lat">eona</w> .i. <w xml:lang="lat">columba</w> <w>adroille</w> <w>conid</w> a <w>ainm</w> <w>fil</w> <w>foroib</w>. \n', '§1', 'col. 103', 'én 1');
INSERT INTO `reading` VALUES(20379, 'Ennach', 10, 404, 'OM1.397', '397', '', '\n<w type="hw" lemma="ennach 1">Ennach</w> <w>en</w> <w>nocenss</w> <w>ar</w> <w>is</w> <w>donad</w> a <w>smir</w>. \n', '§1', 'col. 103', 'ennach 1');
INSERT INTO `reading` VALUES(20380, 'Encuir', 10, 405, 'OM1.398', '398', '', '\n<w type="hw" lemma="encuir *"><w xml:lang="grc">Encuir</w></w> <w xml:lang="lat">grece</w> <w>fossud</w>, ⁊ <w xml:lang="grc">encoire</w> <w xml:lang="lat">enim</w> <w xml:lang="lat">grece</w> <w xml:lang="lat">auess</w> <w xml:lang="lat">quae</w> <w xml:lang="lat">manet</w> <w xml:lang="lat">in</w> <w xml:lang="lat">locis</w> <w xml:lang="lat">suis</w>, <w xml:lang="lat">unde</w> <w>enchuir</w> ⁊ <w>encorach</w> <w xml:lang="lat">dicitur</w> <w>duine</w> <w>fossad</w> <w>fo</w> <w>craeph</w>. \n', '§1', 'col. 103', 'encuir *');
