INSERT INTO `reading` VALUES(20382, 'Engach', 10, 407, 'OM1.400', '400', '', '\n<w type="hw" lemma="engach 1">Engach</w> .i. <w>en</w>-<w>guach</w> .i. <w>duine</w> <w>labar</w>-<w>guach</w>. \n', '§1', 'col. 103', 'engach 1');
INSERT INTO `reading` VALUES(20383, 'Enach', 10, 408, 'OM1.401', '401', '', '\n<w type="hw" lemma="énach 1">Enach</w> <w>arindi</w> <w>bite</w> <w>eoin</w> <w>ann</w>. \n', '§1', 'col. 103', 'énach 1');
INSERT INTO `reading` VALUES(20384, 'Ena', 10, 409, 'OM1.402', '402', '', '\n<w type="hw" lemma="ena 1">Ena</w> <w xml:lang="lat">a</w> <w xml:lang="lat">uino</w> <w xml:lang="grc">eno</w> <w xml:lang="lat">enim</w> <w xml:lang="lat">grece</w> <w xml:lang="lat">uinum</w>. <w>Eno</w> <cb n="col. 104"/> <w xml:lang="lat">furibundus</w> <w xml:lang="lat">et</w> <w xml:lang="lat">reliqua</w>. <w>ruiced</w> <w>for</w> <w>cech</w> <w>lestra</w> <w>imbi</w> <w>lind</w> <w>messc</w> <w>condat</w> <w>ena</w> <w xml:lang="lat">dicunt</w>ur. <w xml:lang="lat">unde</w> <w>enag</w> .i. <w>ian</w> <w>nige</w>. ⁊ <w>enene</w>. ⁊ <w>englass</w>. 	\n', '§1', 'col. 103', 'ena 1');
INSERT INTO `reading` VALUES(20385, 'Enech', 10, 410, 'OM1.403', '403', '', '\n<w type="hw" lemma="enech 1">Enech</w> <w xml:lang="lat">ebraice</w> .i. <w xml:lang="heb">enec</w> <w xml:lang="lat">portio</w>, <w>ar</w> <w>issi</w> <w>rann</w> i <w>ta</w> <w>fodail</w> <w>na</w> <w>sians</w> <w>hi</w> <w xml:lang="lat">facies</w>. ł <w>enech</w> é-<w>nech</w>, <w>ar</w> <w>is</w> a <w>gnuiss</w> <w>rofintar</w> <w>in</w> <w>he</w> <w>ba</w> <w>na</w> <w>he</w>, <w xml:lang="lat">unde</w> <w xml:lang="lat">dicitur</w> <w>inchuban</w> .i. <w>enchaib</w> <w>ban</w>. <w>ar</w> <w>argaibtiside</w> <w>enech</w> <w>iar</w> <w>cech</w> <w>mebuil</w> <w>chetni</w>. <w xml:lang="lat">grece</w> <w xml:lang="lat">quoque</w> <w xml:lang="grc">enos</w> <w xml:lang="lat">species</w> <w xml:lang="lat">interpretatur</w>, <w xml:lang="lat">unde</w> <w>eneclann</w> i <w>ndilius</w>, <w>enechtres</w> i n-<w>indilius</w>. <w>dede</w>, <w xml:lang="lat">quia</w> <w>dat</w> <w>caem</w> a <w>enech</w> <w xml:lang="lat">quam</w> <w xml:lang="lat">homo</w> <w>olchena</w>, ⁊ <w>ara</w> <w>nemrenar</w> <w>enechcland</w>, <w>ar</w> <w>is</w> i n-<w>inchaib</w> <w>atat</w> <w>na</w> <w>cétfaide</w> .i. <w xml:lang="lat">uisus</w> <w xml:lang="lat">gustus</w> <w xml:lang="lat">auditus</w> <w xml:lang="lat">adoratus</w> <w xml:lang="lat">tactus</w>, ⁊ <w>issé</w> <w>ball</w> <w>fo</w> a <w>taet</w> <w>imdergæ</w> <w>sech</w> <w>in</w> <w>corp</w> <w>olchena</w>. \n', '§1', 'col. 104', 'enech 1');
INSERT INTO `reading` VALUES(20386, 'Eol', 10, 411, 'OM1.404', '404', '', '\n<w type="hw" lemma="eól 1">Eol</w> <w xml:lang="lat">ab</w> <w>Eoliss</w> .i. <w>Grecis</w> .i. <w xml:lang="lat">propria</w> <w xml:lang="lat">hereditas</w> <w xml:lang="lat">eorum</w>. <w xml:lang="lat">unde</w> <w>eol</w> ⁊ <w>aneol</w> <w xml:lang="lat">dicitur</w>, <w>eola</w> <w>aneola</w>. ł <w>eol</w> <w xml:lang="lat">ab</w> <w>Eolo</w> <w xml:lang="lat">qui</w> <w xml:lang="lat">deus</w> <w xml:lang="lat">uenti</w> <w xml:lang="lat">dicebatur</w> s⁊ <w xml:lang="lat">insolis</w> <w xml:lang="lat">eo</w> <w xml:lang="lat">locis</w>. <w xml:lang="lat">Uarro</w> <w xml:lang="lat">autem</w> <w xml:lang="lat">dicit:</w> <w xml:lang="lat">Eolus</w> <w xml:lang="lat">rector</w> <w xml:lang="lat">fuit</w> <w xml:lang="lat">istarum</w> <w xml:lang="lat">insolarum</w>, <w xml:lang="lat">et</w> <w xml:lang="lat">quia</w> <w xml:lang="lat">ex</w> <w xml:lang="lat">earum</w> <w xml:lang="lat">nebulis</w> <w xml:lang="lat">et</w> <w xml:lang="lat">fumo</w> <w xml:lang="lat">futuros</w> <w xml:lang="lat">praedicabat</w> <w xml:lang="lat">flatus</w> <w xml:lang="lat">uentorum</w>, <w xml:lang="lat">ab</w> <w xml:lang="lat">impidis</w> <w xml:lang="lat">deus</w> <w xml:lang="lat">uenti</w> <w xml:lang="lat">dictus</w> <w xml:lang="lat">est</w>. <w xml:lang="lat">Eolus</w> <w xml:lang="lat">didiu</w> <w xml:lang="lat">quia</w> <w xml:lang="lat">recti</w> <w xml:lang="lat">flant</w> <w xml:lang="lat">uenti</w>. \n', '§1', 'col. 104', 'eól 1');
