INSERT INTO `reading` VALUES(20391, 'Eir', 10, 416, 'OM1.409', '409', '', '\n<w type="hw" lemma="ér 1">Eir</w> <w xml:lang="lat">grece</w> <w>ondi</w> <w>as</w> <w xml:lang="grc">heros</w>. <w xml:lang="lat">eros</w> <w xml:lang="lat">aliquando</w> <w xml:lang="lat">ł</w> <w xml:lang="lat">dominus</w>, <w xml:lang="lat">aliquando</w> <w xml:lang="lat">sacerdos</w>, <w xml:lang="lat">aliquando</w> <w xml:lang="lat">uir</w> <w xml:lang="lat">fortis</w> <w xml:lang="lat">et</w> <w xml:lang="lat">sapiens</w>. <w xml:lang="lat">cum</w> <w xml:lang="lat">adspiratione</w> <w xml:lang="lat">dominum</w> <w xml:lang="lat">dicimus</w>, <w xml:lang="lat">per</w> e <w xml:lang="lat">solam</w> <w xml:lang="lat">sacerdotem</w>, <w xml:lang="lat">cum</w> <w xml:lang="lat">dipton<ex>go</ex></w> <w xml:lang="lat">uirum</w> <w xml:lang="lat">fortem</w>. <w xml:lang="lat">eir</w> <w xml:lang="lat">didiu</w> <w xml:lang="lat">trenfer</w>, <w xml:lang="lat">unde</w> <w xml:lang="lat">eroicum</w> <w xml:lang="lat">metrum</w> <w xml:lang="lat">dicitur</w>, <w xml:lang="lat">quia</w> <w xml:lang="lat">in</w> <w xml:lang="lat">eo</w> <w xml:lang="lat">uiri</w> <w xml:lang="lat">epei</w> <w xml:lang="lat">celo</w> <w xml:lang="lat">digni</w> <w xml:lang="lat">propter</w> <w xml:lang="lat">fortitudinem</w> <w xml:lang="lat">sapien<ex>tiam</ex></w> <w xml:lang="lat">discribuntur</w>. \n', '§1', 'col. 104', 'ér 1');
INSERT INTO `reading` VALUES(20392, 'Erreg', 10, 417, 'OM1.410', '410', '', '\n<w type="hw" lemma="errach 2">Erreg</w> .i. <w>eirr</w>-<w>seg</w>, <w>ar</w> <w>is</w> <w>he</w> <w>is</w> <w>tresam</w> <w>di</w> <w>segib</w>. <w>erreg</w> <w>eitni</w> <w>berthæ</w> <w>trenfir</w> <w>ar</w> <w>niurt</w>. \n', '§1', 'col. 104', 'errach 2');
INSERT INTO `reading` VALUES(20393, 'Eraim', 10, 418, 'OM1.411', '411', '', '\n<w type="hw" lemma="érimm">Eraim</w> <w>reim</w> n-<w>erreth</w> ł <w>tren</w>-<w>imrim</w>. ł <w>er</w> .i. <w>sol</w>. <w>reim</w> o <w>turgb<ex>ail</ex></w> <w>co</w> <w>fuineth</w>. \n', '§1', 'col. 104', 'érimm');
INSERT INTO `reading` VALUES(20394, 'Ere', 10, 419, 'OM1.412', '412', '', '\n<w type="hw" lemma="aire 2">Ere</w> .i. <w>ondi</w> <cb n="col. 105"/> <w>as</w> <w xml:lang="grc">eris</w> .i. <w xml:lang="lat">tollis</w>. <w xml:lang="grc">ero</w> <w xml:lang="lat">grece</w> <w xml:lang="lat">tolla</w> <w xml:lang="lat">latine</w>. <w xml:lang="grc">erate</w> <w xml:lang="lat">tollite</w>. <w>ere</w> <w>uadh</w>.\n', '§1', 'col. 104', 'aire 2');
INSERT INTO `reading` VALUES(20395, 'Erge', 10, 420, 'OM1.413', '413', '', '\n<w type="hw" lemma="éirge">Erge</w> <w xml:lang="lat">ab</w> <w>erga</w> .i. <w xml:lang="lat">opera</w> <w xml:lang="lat">uocant</w>, <w xml:lang="lat">unde</w> <w>erge</w> ⁊ <w>ericus</w>, <w xml:lang="lat">unde</w> <w>inergia</w> <w>enairte</w>, <w xml:lang="lat">quia</w> <w xml:lang="lat">non</w> <w xml:lang="lat">potest</w> <w xml:lang="lat">operare</w>. <w xml:lang="heb">er</w> <w xml:lang="lat">autem</w> <w xml:lang="lat">ebraice</w> <w xml:lang="lat">uigelans</w>, <w>erge</w> <w>uad</w> ⁊ <w>ergbal</w>. \n', '§1', 'col. 105', 'éirge');
