INSERT INTO `reading` VALUES(20397, 'Eraic', 10, 422, 'OM1.415', '415', '', '\n<w type="hw" lemma="éric">Eraic</w> <w xml:lang="lat">grece</w> <w xml:lang="grc">erciscunda</w> <w xml:lang="lat">diuicio</w> <w xml:lang="lat">communis</w> <w xml:lang="lat">rei</w>.\n', '§1', 'col. 105', 'éric');
INSERT INTO `reading` VALUES(20398, 'Eriu', 10, 423, 'OM1.416', '416', '', '\n<w type="hw" lemma="Ériu">Eriu</w> <w xml:lang="lat">quasi</w> <w>Hebriu</w>, <w xml:lang="lat">ab</w> <w xml:lang="lat">Hiberia</w>, <w xml:lang="lat">hoc</w> <w xml:lang="lat">est</w> <w xml:lang="lat">ab</w> <w xml:lang="lat">Hispania</w>, <w>ar</w> <w>is</w> <w>di</w> <w>is</w> <w>nessam</w> ⁊ <w>is</w> <w>ese</w> <w>rogabad</w>. <w>is</w> <w>cian</w> <w>ria</w> <w>nEiber</w> <w>mac</w> <w>Mil<ex>ed</ex></w> <w>ro</w> <w>hainmnig<ex>ed</ex></w> .i. o <w>ros</w> <w>gab</w> <w>Partholon</w> ⁊ <w>Nemed</w>, <w>Gand</w> ⁊ <w>Sengand</w>. \n', '§1', 'col. 105', 'Ériu');
INSERT INTO `reading` VALUES(20399, 'Eraind', 10, 424, 'OM1.417', '417', '', '\n<w type="hw" lemma="Érainn">Eraind</w> .i. <w>fir</w> <w>Erainn</w>, <w>ar</w> <w>it</w> é <w>rogabsat</w> a <w>cetleth</w> <w>di</w> <w>Erind</w>. <w>IT</w> <w>he</w> <w>Darfhine</w> <w>insin</w> .i. <w>fine</w> <w>Daire</w> <w>Doimtigh</w> <w>m<ex>ai</ex>c</w> <w>Itha</w> <w>m<ex>ai</ex>c</w> <w>Bile</w> <w>m<ex>ai</ex>c</w> <w>Bregainn</w>. <w>ainm</w> <w>doib</w> <w>iertain</w> <w>Tuatha</w> <w>Ier</w> .i. <w>is</w> <w>diib</w> <w>Eterscél</w> <w>mac</w> <w>hui</w> <w>Ier</w> ⁊ <w>Conaire</w> ⁊ <w>Curoi</w>. <w>batar</w> <w>diib</w> <w>righ</w> <w>Muman</w> <w>ria</w> <w>nEoghanacht</w>. \n', '§1', 'col. 105', 'Érainn');
INSERT INTO `reading` VALUES(20400, 'Eirbe', 10, 425, 'OM1.418', '418', '', '\n<w type="hw" lemma="eirbe">Eirbe</w> .i. <w xml:lang="lat">ab</w> <w>erba</w> .i. <w xml:lang="lat">a</w> <w xml:lang="lat">uerbo</w>. <w>arindi</w> <w>conói</w> <w>fer</w>, <w>ar</w> <w>is</w> <w xml:lang="lat">erba</w> <w xml:lang="lat">uocatur</w> <w>tosach</w> <w>na</w> <w>cland</w>. \n', '§1', 'col. 105', 'eirbe');
INSERT INTO `reading` VALUES(20401, 'Eres', 10, 426, 'OM1.419', '419', '', '\n<w type="hw" lemma="eres">Eres</w> <w xml:lang="lat">ab</w> <w xml:lang="lat">eresi</w> .i. <w xml:lang="lat">electio</w>. ł <w>eres</w> <w xml:lang="lat">ab</w> <w>erison</w> .i. <w>certam<ex>en</ex></w> .i. <w>cathugud</w> <w>fri</w> <w>hiris</w> <w>an</w> <w>eres</w>. \n', '§1', 'col. 105', 'eres');
INSERT INTO `reading` VALUES(20402, 'Ernmein', 10, 427, 'OM1.420', '420', '', '\n<w type="hw" lemma="ernméin">Ernmein</w> .i. <w>mein</w> <w>eirnd</w> <w>oca</w> <w>chomailt</w> <w>co</w> <w>cloich</w>. \n', '§1', 'col. 105', 'ernméin');
