INSERT INTO `reading` VALUES(20404, 'Eirmed', 10, 429, 'OM1.422', '422', '', '\n<w type="hw" lemma="airmed">Eirmed</w> <w xml:lang="lat">quia</w> <w xml:lang="lat">res</w> <w xml:lang="lat">aridas</w> <w xml:lang="lat">semimetitur</w> .i. <w>tirim</w>-<w>medh</w>.\n', '§1', 'col. 105', 'airmed');
