INSERT INTO `reading` VALUES(20406, 'Eirbire', 10, 431, 'OM1.424', '424', '', '<w type="hw" lemma="airbire">Eirbire</w> <w>didiu</w> .i. <w>aer</w>-<w>breit</w> <w>aor</w>-<w>baro</w> <w>ar</w> <w>dorucastar</w> ⁊ <w>dofuarcar</w> <w>al</w>-<w>lar</w> n-<w>athæ</w>, <w>sic</w> <w>aiged</w> <w>indi</w> <w>aerthair</w>. <w>eirbire</w> <w>didiu</w> <w>breth</w> <w>aeire</w>. \r\n', '§1', 'col. 105', 'airbire');
