INSERT INTO `reading` VALUES(20409, 'Ess', 10, 434, 'OM1.427', '427', '', '\n<w type="hw" lemma="es(s) 3">Ess</w> o <w>eistin</w> <w>cene</w> <w>imme</w> <w>nessamar</w> <w>cech</w> <w>lind</w> <w>is</w> <w>ess</w> a <w>ainm</w>. <w xml:lang="lat">unde</w> <w>escræ</w> o <w>ess</w> ⁊ <w>ære</w> <w xml:lang="lat">unde</w> <w>dalem</w> <w xml:lang="lat">unde</w> <w>ess</w> <w xml:lang="lat">aqua</w> <w xml:lang="lat">quia</w> <w>estuat</w> .i. <w xml:lang="lat">feruet</w>, ⁊ <w>escibi</w> <w xml:lang="lat">unde</w> <w>esci<add>pi</add>bul</w>. <w xml:lang="lat">unde</w> <w>esconn</w> o <w>ess</w> ⁊ <w>canda</w> .i. <w>canda</w> <w>lem</w>. \n', '§1', 'col. 105', 'es(s) 3');
INSERT INTO `reading` VALUES(20410, 'Escara', 10, 435, 'OM1.428', '428', '', '\n<w type="hw" lemma="escarae">Escara</w> .i. <w>ni</w> <w>cara</w>. <w>cara</w> <w xml:lang="lat">a</w> <w xml:lang="lat">caro</w>. \n', '§1', 'col. 105', 'escarae');
INSERT INTO `reading` VALUES(20411, 'Eslabar', 10, 436, 'OM1.429', '429', '', '\n<w type="hw" lemma="eslabar">Eslabar</w> .i. <w>slabrad</w> <w>oss</w>. <w>labar</w> .i. <w>cumang</w>. <w>eslabar</w> <w>didiu</w> <w>fairsing</w> <cb n="col. 106"/> <w>obronnad</w>. <w xml:lang="lat">inde</w> <w>gigas</w> <w xml:lang="lat">dicit</w> <w>dith</w> <w>slabre</w> <w>slabir</w> <w>coindith</w>. \n', '§1', 'col. 105', 'eslabar');
INSERT INTO `reading` VALUES(20412, 'Essad', 10, 437, 'OM1.430', '430', '', '\n<w type="hw" lemma="es(s)ad">Essad</w> <w xml:lang="lat">ebraice</w> <w xml:lang="heb">esda</w> <w xml:lang="lat">enim</w> <w xml:lang="lat">misericordiæ</w>. <w>is</w> <w>esad</w> <w>is</w> <w>cride</w> <w>dia</w> <w>airchisecht</w>. \n', '§1', 'col. 106', 'es(s)ad');
