INSERT INTO `reading` VALUES(20414, 'Esconn', 10, 439, 'OM1.432', '432', '', '\n<w type="hw" lemma="esconn 1">Esconn</w> <w>cen</w> <w>chonn</w>. \n', '§1', 'col. 106', 'esconn 1');
INSERT INTO `reading` VALUES(20415, 'Esc', 10, 440, 'OM1.433', '433', '', '\n<w type="hw" lemma="esc 1">Esc</w> .i. <w>feith</w> <w>us<ex>ci</ex></w> <w>cechraig</w>, <w xml:lang="lat">unde</w> <w>escmuga</w> .i. <w>escmuc</w>, <w xml:lang="lat">quia</w> <w xml:lang="lat">pinguis</w> <w xml:lang="lat">sicut</w> <w xml:lang="lat">suus</w> <w xml:lang="lat">et</w> <w xml:lang="lat">fodit</w> <w xml:lang="lat">terram</w> ⁊ <w>claidid</w> <w>in</w> <w>talaman</w>. \n', '§1', 'col. 106', 'esc 1');
INSERT INTO `reading` VALUES(20416, 'Eiscir', 10, 441, 'OM1.434', '434', '', '\n<w type="hw" lemma="escir">Eiscir</w> .i. <w>cir</w> <w>oc</w> <w>eisc</w>, <w>ar</w> <w>ni</w> <w>bi</w> <w>ard</w> <w>cen</w> <w>fan</w> <w>occa</w>. ł <w>eiscir</w> .i. <w>ni</w> <w>gnim</w> <w>lam</w> <w>acht</w> <w>is</w> <w>dia</w> <w>dorigni</w> <w>in</w> <w>tocbail</w> <w>sin</w>. <w xml:lang="grc">ciris</w> <w xml:lang="lat">grece</w> <w xml:lang="lat">manus</w> <w xml:lang="lat">interpretatur</w>. \n', '§1', 'col. 106', 'escir');
