INSERT INTO `reading` VALUES(20419, 'Es', 10, 444, 'OM1.437', '437', '', '\n<w type="hw" lemma="eis 1 3">Es</w> <w>integ</w> ⁊ <w>guide</w> ⁊ <w>slicht</w> ⁊ <w>cuimrech</w>. \n', '§1', 'col. 106', 'eis 1 3');
INSERT INTO `reading` VALUES(20420, 'Esert', 10, 445, 'OM1.438', '438', '', '\n<w type="hw" lemma="esert">Esert</w> .i. <w>ni</w> <w>huisi</w> <w>do</w> <w>fert</w>, <w>ar</w> <w>is</w> <w>dó</w> <w>clanta</w> <w>fert</w>, <w>don</w> <w>ti</w> <w>bid</w> <w>caem</w>. <w>coairt</w> <w>imorro</w> <w>coir</w> <w>dó</w> <w>fert</w>. <w>esfert</w> .i. <w>can</w> <w>fert</w>. \n', '§1', 'col. 106', 'esert');
INSERT INTO `reading` VALUES(20421, 'Eslind', 10, 446, 'OM1.439', '439', '', '\n<w type="hw" lemma="éislinn">Eslind</w> .i. <w>esinnill</w>. <w>inill</w> <w xml:lang="lat">ab</w> <w>ello</w> .i. <w xml:lang="lat">intus</w>. <w>inill</w> <w>didiu</w> i <w>medon</w>. <w>eslind</w> .i. <w xml:lang="lat">extra</w>. \n', '§1', 'col. 106', 'éislinn');
