INSERT INTO `reading` VALUES(20423, 'Eisrecht', 10, 448, 'OM1.441', '441', '', '\n<w type="hw" lemma="eisrecht">Eisrecht</w> .i. <w>cen</w> <w>recht</w>. \n', '§1', 'col. 106', 'eisrecht');
INSERT INTO `reading` VALUES(20424, 'Eiss', 10, 449, 'OM1.442', '442', '', '\n<w type="hw" lemma="éis 2">Eiss</w> <w>cach</w> <w>la</w> <w>chein</w> <w>is</w> <w>integ</w> ⁊ <w>slicht</w>, <w xml:lang="lat">aliquando</w> <w>is</w> <w>cuimrech</w>, <w xml:lang="lat">ailiquando</w> <w>is</w> <w>guide</w> .i. <w>eis</w> ⁊ <w>lorg</w> <w>eisi</w> <w>ech</w>. <w>eissem</w> <w>dameisiur</w> ⁊ a <w>guide</w> <w>eiside</w> <w>ratha</w> .i. <w>guide</w> ⁊ <w>cumrech</w>. \n', '§1', 'col. 106', 'éis 2');
