INSERT INTO `reading` VALUES(20427, 'Esclæs', 10, 452, 'OM1.445', '445', '', '\n<w type="hw" lemma="esclae">Esclæs</w> .i. <w>laa</w> n-<w>escomlaithe</w> .i. <w>la</w> <w>suabais</w> <w>do</w> <w>imtecht</w>. \n', '§1', 'col. 106', 'esclae');
INSERT INTO `reading` VALUES(20428, 'Esserge', 10, 453, 'OM1.446', '446', '', '\n<w type="hw" xml:lang="heb" lemma="es(s)éirge">Esserge</w> <w xml:lang="lat">ebraice</w> <w xml:lang="lat">uigilans</w> <w xml:lang="lat">et</w> <w xml:lang="lat">surgens</w>. <w xml:lang="lat">esserge</w> <w xml:lang="lat">a</w> <w xml:lang="lat">sepulcro</w>. <w>esserige</w> .i. <w>nemopuir</w> <w>do</w> <w>corpuib</w>. <w>erga</w> <w xml:lang="lat">enim</w> <w xml:lang="lat">opera</w> .i. <w>ni</w> <w>pa</w> <w>ar</w> <w>cend</w> <w>gnimrad</w> <w>asseirset</w>. \n', '§1', 'col. 106', 'es(s)éirge');
INSERT INTO `reading` VALUES(20429, 'Esarn', 10, 454, 'OM1.447', '447', '', '\n<w type="hw" lemma="esarn *">Esarn</w> .i. <w>ni</w> <w>úrfin</w>. <w>ero</w> <w xml:lang="lat">enim</w> <w xml:lang="lat">uinum</w>. <w>ur</w> .i. <w xml:lang="lat">nouum</w>. <w>esuern</w> <w xml:lang="lat">autem</w> <w>ní</w> <w>nue</w> <w>ḟin</w> <w xml:lang="lat">sed</w> <w xml:lang="lat">uetuss</w>. \n', '§1', 'col. 106', 'esarn *');
