INSERT INTO `reading` VALUES(20438, 'Eit', 10, 462, 'OM1.456', '456', '', '\n<w type="hw" lemma="éit">Eit</w> .i. <w xml:lang="lat">nomen</w> <w>cethræ</w>, <w xml:lang="lat">unde</w> <w xml:lang="lat">dicitur</w> <w>eitged</w> .i. <w>ain</w> <w>eiti</w> <w>as</w> <w>do</w> <w>thir</w>, <w>ce</w> <w>rosní</w> <w>dith</w> <w>noco</w> <w>ni</w> <w>erranar</w> <w>dondi</w> <w>assa</w> <w>ái</w>, <w>arr</w> <w>it</w> <w>he</w> <w>ceithri</w> <w>anmand</w> <w>cinath</w> <w>conlat</w> <w>ar</w> <w>diuit</w>, <w>tucait</w>, <w>ag</w>, <w>acais</w>, <w>etgid</w>. <w>coig</w> <w>anmand</w> <w>cinath</w> <w>immorro</w> <w>conlat</w> <w>ar</w> <w>andug</w>, <w>fall</w>, <w>eislis</w>, <w>elgon</w>, <w>imraichne</w>, <w>anfot</w>. <w>ruced</w> <w>didiu</w> <w>eitg<ex>ed</ex></w> <w>conid</w> <w>anim</w> <w>cach</w> <w>gnima</w> <w>na</w> <w>dene</w> <w>nech</w> <w>ar</w> <w>elgoin</w>. <w>et</w> o <w>eit</w>, <w xml:lang="lat">quia</w> <w xml:lang="lat">mos</w> <w xml:lang="lat">est</w> <w xml:lang="lat">animalium</w> <w xml:lang="lat">et</w> <w xml:lang="lat">auium</w> <w xml:lang="lat">et</w> <w xml:lang="lat">reliqua</w>. \n', '§1', 'col. 107', 'éit');
INSERT INTO `reading` VALUES(20439, 'Etred', 10, 463, 'OM1.457', '457', '', '\n<w type="hw" lemma="étrad">Etred</w> o <w>eit</w>, <w xml:lang="lat">quia</w> <w xml:lang="lat">illa</w> <w xml:lang="lat">concipiunt</w> <w xml:lang="lat">et</w> <w xml:lang="lat">parturiunt</w>. ł <w>etred</w> .i. <w>riad</w> n-<w>etere</w>. <w>etera</w> .i. <w xml:lang="lat">meretrix</w>. \n', '§1', 'col. 107', 'étrad');
