INSERT INTO `reading` VALUES(20442, 'Et', 10, 466, 'OM1.460', '460', '', '\n<w type="hw" xml:lang="heb" lemma="ét 1">Et</w> <w xml:lang="lat">autem</w> <w xml:lang="lat">ebraice</w>, <w xml:lang="lat">timuere</w> <w xml:lang="lat">et</w> <w xml:lang="lat">obstipuere</w>, <w>ar</w> <w>is</w> <w>omun</w> ⁊ <w>mothugad</w> <w>bes</w> <w>ina</w> <w>cethrae</w>. <w>eti</w> <w xml:lang="lat">quoque</w> <w xml:lang="lat">mecum</w>, <w>ar</w> <w>is</w> <w>selb</w> <w>cach</w> <w>oin</w> a <w>cethra</w> <w>diless</w>. \n', '§1', 'col. 107', 'ét 1');
INSERT INTO `reading` VALUES(20443, 'Etoil', 10, 467, 'OM1.461', '461', '', '\n<w type="hw" lemma="étoil">Etoil</w> .i. <w>cen</w> <w>toil</w> .i. <w xml:lang="lat">sine</w> <w xml:lang="lat">pecato</w>. ł <w>etuil</w> .i. <w>ni</w> <w>dúil</w>. \n', '§1', 'col. 107', 'étoil');
INSERT INTO `reading` VALUES(20444, 'Etich', 10, 468, 'OM1.462', '462', '', '\n<w type="hw" lemma="étig">Etich</w> .i. <w>nephdithe</w> .i. <w>is</w> <w>doescair</w> <w>cach</w> <w>can</w> <w>etach</w> n-<w>imbe</w>. <w>etig</w> <w>didiu</w> <w>ni</w> <w>cumtaig</w> <w>cruth</w>. <w>etach</w> <w>arindi</w> <w>intugadar</w>. <w xml:lang="lat">toga</w> <w xml:lang="lat">enim</w> <w xml:lang="lat">dicta</w> <w xml:lang="lat">quia</w> <w xml:lang="lat">tegit</w>. \n', '§1', 'col. 107', 'étig');
INSERT INTO `reading` VALUES(20445, 'Ethad', 10, 469, 'OM1.463', '463', '', '\n<w type="hw" lemma="ethad 2">Ethad</w> ⁊ <w>etham</w> <w xml:lang="lat">ab</w> <w>ædo</w>, <w xml:lang="lat">dicitur</w> <w xml:lang="lat">enim</w> <w>etam</w> <w>ni</w> <w>etham</w> <w>tabron</w> <w>arindí</w> <w>ethaid</w> <w>oine</w> ⁊ <w>eti</w> a <w>torad</w>. \n', '§1', 'col. 107', 'ethad 2');
INSERT INTO `reading` VALUES(20446, 'Etur', 10, 470, 'OM1.464', '464', '', '\n<w type="hw" lemma="etur *">Etur</w> <w>tor</w>-<w>eite</w> .i. <w>is</w> <w>mbruig</w> <w>eite</w> <w>ar</w> a <w>meit</w>, <w>is</w> <w>tor</w> <w>ara</w> <w>airde</w>. <w>etur</w> <w>dano</w> <w>ondi</w> <w>as</w> <w>itur</w>, <w>ar</w> <w>ata</w> <w>cos</w> <w>escrae</w> <w>as</w> <w>for</w> a <w>tigar</w>.\n', '§1', 'col. 107', 'etur *');
INSERT INTO `reading` VALUES(20447, 'Etargna', 10, 471, 'OM1.465', '465', '', '\n<w type="hw" lemma="etargne">Etargna</w> .i. <w xml:lang="lat">gnosia</w> ⁊ <w>et<ex>ar</ex></w> .i. <w>fis</w> <w>esimbuil</w>. \n', '§1', 'col. 107', 'etargne');
INSERT INTO `reading` VALUES(20448, 'Ethar', 10, 472, 'OM1.466', '466', '', '\n<w type="hw" lemma="ethar">Ethar</w> <w xml:lang="lat">ebraice</w> <w xml:lang="heb">edor</w> <w xml:lang="lat">enim</w> <w xml:lang="heb">eber</w> <w xml:lang="lat">inundatio</w> <w xml:lang="lat">pascet</w> <w xml:lang="lat">me</w> .i. <w>ibid</w> <gap extent="c. 4 letters" reason="damage"/>.\n', '§1', 'col. 107', 'ethar');
INSERT INTO `reading` VALUES(20449, 'Etaim', 10, 473, 'OM1.467', '467', '', '\n<w type="hw" lemma="et(a)im">Etaim</w> .i. <w>gell</w> <w>do</w> <w>thuit</w> <w>ar</w> <w>eit</w> <w>do</w> <w>buith</w> i <w>tir</w> <w>comaithig</w>. <w xml:lang="heb">ettim</w> <w xml:lang="lat">ebraice</w> <w xml:lang="lat">robustoriam</w>, <w>ar</w> <w>is</w> <w>ar</w> <w>niurt</w> <w>berair</w>. \n', '§1', 'col. 107', 'et(a)im');
INSERT INTO `reading` VALUES(20450, 'Ethne', 10, 474, 'OM1.468', '468', '', '\n<w type="hw" lemma="ethne *">Ethne</w> .i. <w>cenéldae</w>. <w>ethnæ</w> <w xml:lang="lat">enim</w> <w xml:lang="lat">genus</w>. \n', '§1', 'col. 107', 'ethne *');
INSERT INTO `reading` VALUES(20451, 'Etag', 10, 475, 'OM1.469', '469', '', '\n<w type="hw" lemma="etag">Etag</w> ⁊ <w>iath</w> <w>anmann</w> <w>fethal</w> <w>la</w> <cb n="col. 108"/> <w>gentiu</w>, <w xml:lang="lat">ut</w> <w xml:lang="lat">dicitur</w>, <w>dar</w> <w>an</w> <w>iath</w>-<w>sæ</w> ⁊ <w>an</w> <w>etag</w>. <w xml:lang="lat">unde</w> <w>etech</w> <w xml:lang="lat">dicitur</w>. e. <w xml:lang="lat">enim</w> <w xml:lang="lat">aduerbium</w> <w xml:lang="lat">iurandi</w> <w xml:lang="lat">est</w>, <w xml:lang="lat">ut</w> <w xml:lang="lat">dicitur</w>, e <w>Pul</w>, <w>Castur</w>, <w>Ercle</w> 7rl. .i. <w>tuncca</w> <w>tar</w> <w>tar</w> <w>Pul</w>, <w>dar</w> <w>Ercle</w>, <w>dei</w> <w>idal</w> <w>leisum</w> <w>indsin</w>. \n', '§1', 'col. 107', 'etag');
