INSERT INTO `reading` VALUES(20463, 'Emdæ', 10, 487, 'OM1.481', '481', '', '\n<w type="hw" lemma="eimde">Emdæ</w> .i. <w>fomnæ</w>. ł <w>bid</w> <w>do</w> <w>menmæ</w>. A <w>mic</w>, <w>ni</w> <w>mait</w> <w>in</w> <w>dogni</w>, <w>indred</w> <w>tire</w> <w>Muscraide</w>. <w>Eimde</w> <w>na</w> <w>tarset</w> <w>óga</w> <w>dub</w>-<w>Tire</w> <w>da</w> <w>Glas</w> <w>fotæ</w>. \n', '§2', 'col. 108', 'eimde');
