INSERT INTO `reading` VALUES(20762, 'Lagin', 10, 787, 'OM1.779', '779', '', '\n<w type="hw" lemma="láigen">Lagin</w> <w xml:lang="lat">quasi</w> <w>login</w> <w>ar</w> <w>is</w> o <w>Lægaire</w> <w>genetar</w>. ł <w>lagin</w> <w xml:lang="lat">a</w> <w xml:lang="lat">lancis</w> .i. o <w>gaib</w> <w>ar</w> <w>gabsat</w> <w>in</w> n-<w>arm</w> <w>sin</w> <w>la</w> <w>Labraid</w> <w>hue</w> <w>Luirc</w>. <w>Labraid</w> <w>lathiu</w> <w>Galiuin</w> <w>gabsait</w> <w>inna</w> <w>lathib</w> <w>lagina</w>, <w>Domnaind</w> <w>dogairdis</w> <w>riam</w>. <w>Galeoin</w> <w>immorro</w> <w>aicme</w> <w>do</w> <w>Gallaib</w>. <w>It</w> e <w>aitte</w> <w>Labr<ex>ada</ex></w> <w>Loingsig</w>. <w xml:lang="lat">Et</w> <w>it</w> <w>eat</w> <w>ro</w> <w>altsat</w> <w>Labr<ex>ad</ex></w> <w>for</w> a <w>longus</w>, ⁊ <w>it</w> <w>Galeoin</w> <w>robatar</w> <w>ac</w> <w>cobraid</w> <w>Ailillæ</w> <w>m<ex>ai</ex>c</w> <w>Rossæ</w> a <w>mbrathar</w> <w>for</w> <w>Tain</w> <w>Bu</w> <w>Cuailnge</w>, <w xml:lang="lat">unde</w> <w xml:lang="lat">dicitur</w> <w>tricha</w> <w>cét</w> <w>na</w> <w>nGaleoin</w>, ⁊ <w>nidat</w> <w>Galenga</w>, <w>ar</w> <w>is</w> <w>cian</w> <w>mar</w> <w>ria</w> <w>Corm<ex>ac</ex></w> <w>Galeng</w> <w>ro</w> <w>ferad</w> <w>Tain</w> <w>Bo</w> <w>Qailnge</w>. \n', '§1', 'col. 118', 'láigen');
