INSERT INTO `reading` VALUES(20813, 'Nemed', 10, 838, 'OM1.830', '830', '', '\n<w type="hw" lemma="neimed">Nemed</w> .i. <w>fil<ex>i</ex></w>, a <w>nemore</w>, <w>ar</w> <w>is</w> a <w>fidnemedaib</w> <w>fognitis</w> <w>fil<ex>id</ex></w> a <w>ngressa</w>. <w>Nemid</w> <w>intan</w> <w>is</w> <w>fri</w> <w>hecl<ex>ais</ex></w> .i. <w>nem</w>-<w>iath</w> .i. <w>iath</w> <w>neme</w>. <w>Nemed</w> <w>flathae</w> .i. <w>neim</w> <add>ł <w>nim</w></add> <w>aith</w> .i. <w>aith</w> <w>neime</w> <add>ł <w>nime</w></add> <w>for</w> <w>armaib</w> <w>inn</w> <w>oesa</w> <w>flathae</w>. <w>Nemed</w> <w>filed</w> .i. <w>nim</w>-<w>uath</w>, <w>uath</w> <w>nime</w> <w>for</w> <w>tengthaib</w> <w>na</w> <w>filed</w>. <w>Nemed</w> .i. <w>nem</w>-<w>od</w> .i. <w>od</w> <w>ceol</w>, <w>ar</w> <w>is</w> o <w>cheol</w> <w>atá</w> <w>nemhtecus</w> <w>don</w> <w>fiallach</w> <w>airfit<ex>id</ex></w>, <w xml:lang="lat">ut</w> <w xml:lang="lat">dicitur</w> <w>Aos</w> <w>danae</w> <w>in</w> <w>rig</w> <w>co</w> <w>rinnib</w>, <w xml:lang="lat">et</w> <w xml:lang="lat">reliqua</w>. <w>Nemeth</w> <w>bó</w> .i. <w>nem</w>-<w>suth</w> .i. <w>suth</w> <w>lacht</w>. <w>ar</w> <w>is</w> o <w>lacht</w> <w>ata</w> <w>nemth<ex>en</ex>c<ex>us</ex></w> <w>do</w> <w>cethra</w>, <w xml:lang="lat">ut</w> <w xml:lang="lat">dicitur</w> <w>Mingur</w> <w>gringur</w> <w>certan</w> <w>cruinne</w>, <gap extent="c. 3 letters" reason="damage"/> <w>for</w> <w>barraib</w>, <w>bind</w> a <w>guth</w>, <w>rongab</w> <gap extent="c. 3 letters" reason="damage"/><w>land</w> <w>tria</w> <w>gai</w> <w>ngreine</w>, rocar<gap extent="c. 5 letters" reason="damage"/> <w>slebe</w> <w>in</w> <w>suth</w>. <w>Tri</w> <w>neimid</w> <w>uaisli</w> <w>adriomthar</w> <w>sund</w> .i. <w>nem</w>-<w>iath</w> ⁊ <w>nem</w>-<w>uath</w> ⁊ <w>nem</w>-<w>aith</w>. <w>Nem</w>-<w>iath</w> <w>fri</w> <w>hecluiss</w> <gap extent="c. 3 letters" reason="damage"/> <w>iathaib</w> ⁊ <w>mindaib</w>. <w>Nem</w>-<w>uath</w> <w>fri</w> <w>filedaib</w> <w>iarsinni</w> <w>aerait</w> <w>nech</w> <w>co</w> n-<w>epil</w> <w>de</w> <w>amal</w> <w>difoeth</w> <w>la</w> <w>nimh</w>. <w>Nem</w>-<w>aith</w>, <w>la</w> <w>riga</w> ⁊ <w>flathe</w>, <w>ar</w> <w>is</w> <w>maith</w> <w>in</w> <w>neimed</w> <w>sin</w> <w>esccaire</w> <w>cecha</w> <w>maithiusa</w> ⁊ <w>irgaire</w> <w>cacha</w> <w>huilc</w>. <w>Atrimther</w> <w>cethre</w> <w>nemed</w> <w>aile</w> <w>and</w> .i. <w>nem</w>-<w>aod</w>, <w>nem</w>-<w>mod</w>, <w>nemh</w>-<w>odh</w>, <w>nem</w>-<w>suth</w>. <w>Nem</w>-<w>aodh</w> <w>la</w> <w>cerda</w> ⁊ <w>goibniu</w>, <w>ar</w> <w>issed</w> <w>dobeir</w> <w>nemhtench<ex>as</ex></w> <w>doib</w> <w>in</w> <w>feith</w> <w>doberait</w> <w>tre</w> <w>aed</w> <w>tre</w> <w>tine</w>, <w xml:lang="lat">ut</w> <w xml:lang="lat">dicitur</w> <w>Ronbris</w>, <w>ronbrúi</w>, <w>ronbaid</w>, a <w>ri</w> <w>in</w> <w>richid</w> <w>rindglaine</w>, <w>rongeilt</w> <w>in</w> <w>gaeth</w> <w>feib</w> <w>geilius</w>, <w>aod</w> <w>forderg</w> <w>fidnime</w>. <w>Nem</w>-<w>mod</w> <w>la</w> <w>saoruib</w>, <w>ar</w> <w>issed</w> <w>dobeir</w> <w>nemtenchus</w> <cb n="col. 121"/> <w>doib</w>, <w>in</w> <w>mod</w> <w>dogniat</w> <w>tria</w> a <w>neim</w> .i. <w>tria</w> a <w>mbeim</w>. ł <w>niam</w>-<w>feith</w>, <w>ar</w> <w>ised</w> <w>dobeir</w> <w>nemtenchas</w> <w>doib</w> <w>ind</w> <w>feth</w> <w>doniat</w> <w>tré</w> <w>neim</w>. <w>Nem</w>-<w>odh</w> <w>la</w> <w>haos</w> <w>ciuil</w>, <w>ar</w> <w>issed</w> <w>diber</w> <w>nemtencus</w> <w>doib</w> a <w>ceol</w>. <w>Nem</w> <w>suth</w> <w>intan</w> <w>is</w> <w>fri</w> <w>cethrae</w>, <w>ar</w> <w>issed</w> <w>nos</w> <w>nemtig<ex>enn</ex></w> <w>al</w>-<w>lacht</w> ⁊ a <w>carnae</w>, <w xml:lang="lat">et</w> <w xml:lang="lat">reliqua</w>. \n', '§2', 'col. 120', 'neimed');
